едмично или месечно, с ново копие на официалната база данни.','etimalta',1575884614,'caoimhinsmo',1579300253),(17,'br','Emaoc\'h o labourat gant ur {gopienn} eus an diaz-roadennoù An Sruth. C\'hwi pe n\'eus forzh piv a zo aotreet da skrivañ ha d\'ober taolioù-arnod amañ evel ho peus c\'hoant, dre ma vo flastret an diaz-roadennoù-mañ bep ar mare, evel da skouer bep sizhun pe bep miz, gant ur gopienn nevez eus an diaz-roadennoù hag a ro an ton.','Pêr',1579394623,'Pêr',1579685891),(17,'da','Du arbejder med en <b> kopi </b> af An Sruth-databasen. Alle har lov til at skrive og eksperimentere så meget som de vil, fordi denne database overskrives nu og da med en opdateret kopi af referencedatabasen. Normalt en gang om ugen eller en måned.','Rex',1600719539,'Rex',1600719539),(17,'de','Du arbeitest hier mit einer <b>Kopie</b> der An Sruth-Datenbank.  Es dürfen alle hier schreiben und herumexperimentieren so viel sie wollen, weil diese Datenbank ab und zu mit einer aktuellen Kopie der Referenzdatenbank überschrieben wird, i.d. Regel einmal die Woche oder im Monat.','2000-mmd',1571574936,'2000-mmd',1571574936),(17,'en','You are working here with a {copy} of the An Sruth database.  You or anyone are free to write and experiment here as much as you like, because this database will be overwritten from time to time, perhaps weekly or monthly, with a fresh copy of the authoritative database.','',0,'caoimhinsmo',1579300275),(17,'fr','Vous travaillez ici avec une {copie} de la base de données An Sruth. Vous ou n\'importe qui êtes libre d\'écrire et d\'expérimenter ici autant que vous le souhaitez, car cette base de données sera écrasée de temps en temps, par exemple chaque semaine ou chaque mois, par une nouvelle copie de la base de données faisant autorité.','',0,'caoimhinsmo',1579300288),(17,'ga','Tá tú ag obair anseo le {cóip} de bhunachar sonraí An Sruth.  Thig leatsa no le duine ar bith sgríobh agus trialacha a dhéanamh anseo mar is mian leat.  Oir forscríofar an bunachar sonraí seo ó am go ham, gach seachtain nó gach mí b’fhéidir, le cóip nua den bhunachar sonraí údarásach.','',0,'caoimhinsmo',1579300299),(17,'gd','Tha thu ag obair an seo le {lethbhreac} den stòr-dàta An Sruth. Faodaidh tusa no duine sam bith sgrìobhadh agus cluich agus deuchainnean a dhèanamh mar a thogras sibh an seo. Oir théid sgrìobhadh thairis air an stòr-dàta seo bho àm gu àm, is dòcha a h-uile seachdain no a h-uile mìos, le dàta bhon stòr-dàta ùghdarrasail.','',0,'caoimhinsmo',1579299888),(17,'it','Stai lavorando qui con una {copia} del database An Sruth. Tu o chiunque sei libero di scrivere e sperimentare qui quanto vuoi, perché questo database verrà sovrascritto di volta in volta, forse settimanalmente o mensilmente, con una nuova copia del database autorevole.','pizzoccheriale',1575479685,'caoimhinsmo',1579300316),(17,'lt','Jūs dirbate čia su {copy}, kuri(s) priklauso An Sruth duomenų bazei. Jūs ar bet kas kitas galite rašyti ir eksperimentuoti nevaržomai, nes ši duomenų bazė kartas nuo karto, galbūt kas savaitę, ar kas mėnesį, bus perrašoma su nauja patvirtintos duomenų bazės kopija ','etimalta',1575365415,'caoimhinsmo',1579300327),(17,'pt','Você está trabalhando aqui com uma {cópia} do banco de dados An Sruth. Você ou qualquer pessoa é livre para escrever e experimentar aqui o quanto quiser, porque esse banco de dados será substituído de tempos em tempos, talvez semanalmente ou mensalmente, com uma nova cópia do banco de dados oficial.','etimalta',1577438958,'caoimhinsmo',1579300339),(17,'sh','Radis ovde sa jednom {copia} od banke podataka An Sruth. Ti ili bilo ko ste slobodni da pisete i eksperimentisete ovde koliko hocete, zato sto ce ova banka podataka biti prepisana  svaki put, mozda nedeljno ili mesecno, sa novom kopijom banke podataka','giuseppelic',1582716853,'giuseppelic',1582717451),(18,'bg','до','etimalta',1575886351,'etimalta',1575886351),(18,'br','da','Pêr',1579394623,'',0),(18,'da','til','Malene89',1575486785,'Malene89',1575486785),(18,'de','nach'