il diese Datenbank ab und zu mit einer aktuellen Kopie der Referenzdatenbank überschrieben wird, i.d. Regel einmal die Woche oder im Monat.','2000-mmd',1571566730,'caoimhinsmo',1579374856),(257,'en','You are working here with a {copy} of the Bunadas database.  You or anyone are free to write and experiment here as much as you like, because this database will be overwritten from time to time, perhaps weekly or monthly, with a fresh copy of the authoritative database.','',0,'caoimhinsmo',1579374859),(257,'es','Estás trabajando con una {copia} de la base de datos Bunadas. Puedes experimentar con el sistema todo los que qieras.','',0,'caoimhinsmo',1579374863),(257,'fr','Vous travaillez ici avec une {copie} de la base de données Bunadas. Vous ou n\'importe qui êtes libre d\'écrire et d\'expérimenter ici autant que vous le souhaitez, car cette base de données sera écrasée de temps en temps, par exemple chaque semaine ou chaque mois, par une nouvelle copie de la base de données faisant autorité.','',0,'caoimhinsmo',1579374869),(257,'ga','Tá tú ag obair anseo le {cóip} de bhunachar sonraí Bunadas.  Thig leatsa nó le duine ar bith scríobh agus trialacha a dhéanamh anseo mar is mian leat.  Óir forscríofar an bunachar sonraí seo ó am go ham, gach seachtain nó gach mí b’fhéidir, le cóip nua den bhunachar sonraí údarásach.','',0,'CÓD',1579872842),(257,'gd','Tha thu ag obair an seo le {lethbhreac} den stòr-dàta Bunadas. Faodaidh tusa no duine sam bith sgrìobhadh agus cluich agus deuchainnean a dhèanamh mar a thogras sibh an seo. Oir théid sgrìobhadh thairis air an stòr-dàta seo bho àm gu àm, is dòcha a h-uile seachdain no a h-uile mìos, le dàta bhon stòr-dàta ùghdarrasail.','',0,'caoimhinsmo',1579374881),(257,'it','Stai lavorando con una {copia} del database Bunadas. Tu o chiunque altro siete liberi di scrivere e sperimentare quanto volete, perché questo database viene sovrascritto di tanto in tanto, talvolta settimanalmente o mensilmente, con una nuova copia del database principale.','AlexT',1575465837,'caoimhinsmo',1579374885),(257,'lt','Jūs dirbate čia su {>copy} iš Bunadas duomenų bazės. Jūs, ar bet kas kitas, galite nevaržomai rašyti ir eksperimentuoti kiek jum norisi, kadangi ši duomenų bazė kartas nuo karto, galbūt kartą per savaitę ar per mėnesį, bus atnaujinama iš patikrintos duomenų bazės','etimalta',1574937371,'caoimhinsmo',1579374891),(257,'pt','Você está trabalhando aqui com uma {cópia} do banco de dados Bunadas. Você ou qualquer pessoa é livre para escrever e experimentar aqui o quanto quiser, porque esse banco de dados será substituído de tempos em tempos, talvez semanalmente ou mensalmente, com uma nova cópia do banco de dados oficial.','etimalta',1577452800,'caoimhinsmo',1579374898),(257,'sh','Radis na jednoj {kopiji} banke podataka Bunadas. Ti ili bilo ko drugi ste slobodni da pisete i esperimentisete koliko hocete, zato sto ce ova banka podataka biti prepisana povremeno, ponekad nedeljno ili mesecno, sa novom kopijom glavne banke podataka. ','giuseppelic',1582803073,'giuseppelic',1582803229),(258,'bg','Лексикално подобни думи','etimalta',1575962670,'etimalta',1575962670),(258,'br','Gerioù heñvel a-fet geriaoueg','Pêr',1579394623,'',0),(258,'da','Lexikalt lignende ord','Rex',1600718426,'Rex',1600718426),(258,'de','Lexikalisch ähnliche Wörter','2000-mmd',1571568871,'2000-mmd',1571568871),(258,'en','Lexically similar words','',0,'',0),(258,'fr','Mots similaires lexiquement','',0,'',0),(258,'ga','Focail atá cosúil lena chéile ó thaobh litrithe de','',0,'CÓD',1579870654),(258,'gd','Faclan a tha coltach a thaobh litreachaidh','',0,'',0),(258,'it','Parola simili lessicalmente','AlexT',1575466898,'AlexT',1575466898),(258,'lt','Leksiškai panašūs žodžiai','etimalta',1574938912,'etimalta',1574938912),(258,'pt','Palavras lexicamente semelhantes','etimalta',1577454219,'etimalta',1577454219),(258,'sh','Leksikalno slicne reci ','giuseppelic',1582804905,'giuseppelic',1582804905),(259,'bg','Думи, чиито правопис се застъпва с тази, дори и 