,1576786541),(515,'it','Padronanza in situazioni complesse','caoimhinsmo',1576764868,'caoimhinsmo',1576764868),(515,'pt','Proficiência','etimalta',1577445823,'etimalta',1577445823),(515,'sh','Vestina u slozenim situacijama','giuseppelic',1582793129,'giuseppelic',1582793129),(516,'br','aes','Pêr',1579394623,'Pêr',1579614007),(516,'da','lettere side','fred',1577003236,'fred',1577003236),(516,'en','easier side','caoimhinsmo',1576760930,'caoimhinsmo',1576760930),(516,'es','lado más fácil','sodisar',1578681274,'sodisar',1578681274),(516,'fr','facile','Pêr',1579614002,'Pêr',1579614002),(516,'ga','an taobh is fusa','CÓD',1579909606,'CÓD',1579909606),(516,'gd','taobh nas fhasa','caoimhinsmo',1576761016,'caoimhinsmo',1576761016),(516,'it','lato più facile','AlexT',1577557353,'AlexT',1577557353),(516,'pt','lado mais fácil','etimalta',1577446469,'etimalta',1577446469),(516,'sh','Laksa strana','giuseppelic',1582797660,'giuseppelic',1582797660),(517,'br','diaes','Pêr',1579394623,'Pêr',1579613894),(517,'da','sværere side','fred',1577003245,'fred',1577003245),(517,'en','harder side','caoimhinsmo',1576760930,'caoimhinsmo',1576760981),(517,'es','lado más difícil','sodisar',1578681724,'sodisar',1578681724),(517,'fr','difficile','Pêr',1579613865,'Pêr',1579613886),(517,'ga','an taobh is deacra','CÓD',1579909040,'CÓD',1579909621),(517,'gd','taobh nas dorra','caoimhinsmo',1576760992,'caoimhinsmo',1576760992),(517,'it','lato più difficile','AlexT',1577557370,'AlexT',1577557370),(517,'pt','lado mais difícil','etimalta',1577446485,'etimalta',1577446485),(517,'sh','teza strana ','giuseppelic',1582798235,'giuseppelic',1582798235),(520,'bg','Може да разбира и използва познати и всекидневни изрази, както и много прости изрече-ния, които имат за цел да отговорят на конкретни нужди. Може да се представя или дапредставя някого и да задава въпроси на друг човек, напр. за мястото, където той живее,хората, които познава, нещата, които притежава и т.н., и може да отговоря на подобнивъпроси. Може да общува по елементарен начин, ако събеседникът му говори бавно и от-четливо и му помага в общуването.','caoimhinsmo',1576774932,'caoimhinsmo',1577905291),(520,'br','Gellout a ra kompren hag ober gant troiennoù-lavar pemdeziek ha poblek ha frazennoù gant ar pal da da vezañ en e vleud en un doare pleustrek. Gellout a ra lavaret piv eo (eñ/hi) hag ar re all ha gellout a ra goulenn ha respont d\'ar goulennoù diwar-benn munudoù personel evel da skouer pelec\'h emañ (eñ/hi) o vevañ, an dud anvavezet gantañ/ganti hag an traoù perc\'hennet gantañ/ganti. Gellout a ra kaout eskemmoù en un doare eeun gant an dud all pa gaozeont dousik hag en un doare sklaer hag a zo prest da sikour.','Pêr',1579394623,'',0),(520,'da','Kan forstå og bruge almindelige, enkle dagligdags udtryk til at få opfyldt helt konkrete  kommunikationsbehov. Kan præsentere sig selv eller andre, kan både stille og besvare spørgsmål om personlige forhold, som fx hvor han/hun bor, mennesker han/hun kender eller ting, som han/hun har. Kan indgå i en enkel samtale, hvis den anden part taler langsomt og tydeligt og er indstillet på at hjælpe.','fred',1576835324,'caoimhinsmo',1576840473),(520,'de','Kann vertraute, alltägliche Ausdrücke und ganz einfache Sätze verstehen und verwenden, die auf die Befriedigung konkreter Bedürfnisse zielen. Kann sich und andere vorstellen und anderen Leuten Fragen zu ihrer Person stellen – z. B. wo sie wohnen, welche Leute sie kennen oder welche Dinge sie haben – und kann auf Fragen dieser Art Antwort geben.  Kann sich auf einfache Art verständigen, wenn die Gesprächspartner langsam und deutlich sprechen und bereit sind zu helfen.','caoimhinsmo',1576766358,'caoimhinsmo',1579377942),(520,'en','Can understand and use familiar everyday expressions and very basic phrases aimed at the satisfaction of needs of a concrete type. Can introduce him/herself and others and can ask and answer questions about personal details such as where he/she lives, people he/she knows and things he/she has. Can interact in a simple way provided the other person talks slowly and clearly and is prepared to help.','caoimhinsmo',1576766093,'caoimhinsmo',1579377947),(520,'es','Es capaz de comprender y utilizar expresiones cotidianas de uso muy frecuente así como frases sencillas destinadas a satisfacer necesidades de tipo inmediato. Puede presentarse a sí mismo y a otros, pedir y dar información personal básica sobre su domicilio, sus pertenencias y las personas que conoce. Puede relacionarse de forma elemental siempre que su interlocutor hable despacio y con claridad y esté dispuesto a cooperar. ','caoimhinsmo',1576770383,'caoimhinsmo',1576770383),(520,'fr','Peut comprendre et utiliser des expressions familières et quotidiennes ainsi que des énoncés très simples qui visent à satisfaire des besoins concrets. Peut se présenter ou présenter quelqu\'un et poser à une personne des questions la concernant - par exemple, sur son lieu d\'habitation, ses relations, ce qui lui appartient, etc. - et peut répondre au même type de questions. Peut communiquer de façon simple si l\'interlocuteur parle lentement et distinctement et se montre coopératif.','caoimhinsmo',1576838727,'caoimhinsmo',1576838727),(520,'ga','Is féidir leis nathanna cainte laethúla agus coitianta a thuiscint agus a úsáid mar aon le frásaí an-bhunúsacha a úsáidtear chun riachtanais de chineál nithiúil a shásamh. Is féidir leis é féin agus daoine eile a chur in aithne agus ceisteanna a chur agus a fhreagairt faoi shonraí pearsanta, amhail an áit a bhfuil sé ina chónaí, daoine a bhfuil aithne aige orthu agus rudaí atá aige. Is féidir leis caidreamh a dhéanamh ar bhealach simplí le duine eile fad a labhraíonn an duine sin go mall agus go soiléir agus atá sé sásta cuidiú a thabhairt dó. ','CÓD',1579557625,'CÓD',1579905382),(520,'gd','Tuigidh agus cleachdaidh e/i beannachdan làitheil, agus abairtean gu math math sìmplidh gus riatanasan bunaiteach na beatha iarraidh. Cuiridh e e fhéin an aithne do dhaoine eile, agus is urrainn dha ceistean a chur agus a fhreagairt a thaobh ghnothaichean pearsanta leithid an àite far a bheil e a’ fuireachd, daoine is aithne dha, agus rudan a th’ aige. Nì e còmhra sìmplidh a-null ’s a-nall ma bhios an duine eile deònach labhairt gu slaodach agus a bhith ga chuideachadh.','caoimhinsmo',1576787304,'caoimhinsmo',1579377978),(520,'it','Si comprendono e si usano espressioni di uso quotidiano e frasi basilari tese a soddisfare bisogni di tipo concreto. Si sa presentare se stessi e gli altri e si è in grado di fare domande e rispondere su particolari personali come dove si abita, le persone che si conoscono e le cose che si possiedono. Si interagisce in modo semplice, purché l\'altra persona parli lentamente e chiaramente e sia disposta a collaborare.','caoimhinsmo',1576774148,'caoimhinsmo',1576774148),(520,'pt','É capaz de compreender e utilizar expressões familiares e correntes assim como enunciados simples que visam satisfazer necessidades imediatas. É capaz de apresentar-se ou apresentar alguém e colocar questões ao seu interlocutor sobre assuntos como, por exemplo, o local onde vive, as suas relações, o que lhe pertence, etc. É capaz de responder ao mesmo tipo de questões. É capaz de comunicar de forma simples desde que o seu interlocutor fale clara e pausadamente e se mostre colaborante.','caoimhinsmo',1576841086,'caoimhinsmo',1576841086),(520,'sh','Razumeju se i koriste se izrazi iz svakodnevnog zivota i prosti izrazi usmereni da zadvolje konkretne potrebe. Zna se predstaviti se i predstaviti druge i umogucnosti  je da se postavljaju pitanja i daju odgovori kao gde se zivi, osobe koje se poznaju i sta poseduju. Interakcije su jednostavne , sve dok druga osoba prica polako i jasno i saradjuje.','giuseppelic',1582747885,'giuseppelic',1582748292),(521,'bg','Може да разбира отделни изречения и често употребявани изрази, свързани с непосред-ственото обкръжение и всекидневие (напр. елементарна лична и семейна информация, по-купки, близко обкръжение, работа). Може да общува по време на несложни и обичайни дей-ности, които изискват обмен на несложна и пряка информация по познати и всекидневнитеми. Може да описва с несложни езикови средства своето образование, непосредственотоси обкръжение и да говори по теми според преките си потребности.','caoimhinsmo',1576774960,'caoimhinsmo',1577905374),(521,'br','Gellout a ra kompren frazennoù ha troiennoù-lavar liammet gant tachennoù \'zo gant berzh kazimant diouzhtu (d.sk. titouroù diazez diwar-e-benn/diwar-he-fenn pe e/he familh, evit ober prenadennoù, geografiezh lec\'hel, e labour). Gellout a ra komz en un doare eeun ha diwar-benn an traoù en/he deus d\'ober war ar pemdez hag a c\'houlenn un eskemm prim hag eeun a ditouroù diwar-benn goulennoù/kudennoù a vez (eñ/hi) boaz outo ha bevet er vuhez pemdeziek. Gellout a ra (eñ/hi) deskrivañ e meur a zoare e/he istor, e/he endro nes ha goulennoù/kudennoù e/he ezhommoù a vez gantañ/ganti diouzhtu-dak.','Pêr',1579394623,'',0),(521,'da','Kan forstå sætninger og ofte anvendte udtryk, der omhandler vigtige, relevante dagligdags områder fx basale oplysninger om sig selv og sin familie, om indkøb, omgivelser og arbejde). Kan kommunikere om enkle og dagligdags emner, der kun kræver en enkel og direkte udveksling af information. Kan med enkle udtryk beskrive hans/hendes baggrund og nærmiljø samt udtrykke umiddelbare behov.','caoimhinsmo',1576840522,'caoimhinsmo',1576840522),(521,'de','Kann Sätze und häufig gebrauchte Ausdrücke verstehen, die mit Bereichen von ganz unmittelbarer Bedeutung zusammenhängen (z. B. Informationen zur Person und zur Familie, Einkaufen, Arbeit, nähere Umgebung).  Kann sich in einfachen, routinemäßigen Situationen verständigen, in denen es um einen einfachen und direkten Austausch von Informationen über vertraute und geläufige Dinge geht.  Kann mit einfachen Mitteln die eigene Herkunft und Ausbildung, die direkte Umgebung und Dinge im Zusammenhang mit unmittelbaren Bedürfnissen beschreiben. ','caoimhinsmo',1576768416,'caoimhinsmo',1576769821),(521,'en','Can understand sentences and frequently used expressions related to areas of most immediate relevance (e.g. very basic personal and family information, shopping, local geography, employment). Can communicate in simple and routine tasks requiring a simple and direct exchange of information on familiar and routine matters. Can describe in simple terms aspects of his/her background, immediate environment and matters in areas of immediate need.','caoimhinsmo',1576766132,'caoimhinsmo',1579378012),(521,'es','Es capaz de comprender frases y expresiones de uso frecuente relacionadas con áreas de experiencia que le son especialmente relevantes (información básica sobre sí mismo y su familia, compras, lugares de interés, ocupaciones, etc). Sabe comunicarse a la hora de llevar a cabo tareas simples y cotidianas que no requieran más que intercambios sencillos y directos de información sobre cuestiones que le son conocidas o habituales. Sabe describir en términos sencillos aspectos de su pasado y su entorno así como cuestiones relacionadas con sus necesidades inmediatas. ','caoimhinsmo',1576770404,'caoimhinsmo',1576770404),(521,'fr','Peut comprendre des phrases isolées et des expressions fréquemment utilisées en relation avec des domaines immédiats de priorité (par exemple, informations personnelles et familiales simples, achats, environnement proche, travail). Peut communiquer lors de tâches simples et habituelles ne demandant qu\'un échange d\'informations simple et direct sur des sujets familiers et habituels. Peut décrire avec des moyens simples sa formation, son environnement immédiat et évoquer des sujets qui correspondent à des besoins immédiats.','caoimhinsmo',1576838750,'caoimhinsmo',1576838750),(521,'ga','Is féidir leis abairtí agus nathanna cainte coitianta a bhaineann le réimsí lena ngabhann an ábharthacht is láithrí a thuiscint (m.sh. faisnéis an-bhunúsach phearsanta agus teaghlaigh, siopadóireacht, an ceantar áitiúil, fostaíocht). Is féidir leis cumarsáid a dhéanamh le linn gnáth-thascanna simplí nuair nach bhfuil i gceist iontu ach malartú faisnéise díreach agus simplí maidir le gnáthchúrsaí coitianta. Is féidir leis cur síos a dhéanamh i dtéarmaí simplí ar ghnéithe dá chúlra, dá gharthimpeallacht agus de cheisteanna a bhaineann le riachtanas láithreach. ','CÓD',1579557654,'CÓD',1579905438),(521,'gd','Tuigidh e/i abairtean agus gnàthasan-cainnt cumanta a bhuineas gu dìreach ri gnothaichean làitheil (mar eisimpleir. fiosrachadh bunaiteach pearsanta agus teaghlaich, ceannachd sna bùthan, an sgìre, an obair). Nì e còmhradh tuigseach mu ghnothaichean a tha sìmplidh, dìreach, àbhaisteach. Bheir e tuairisgeil sìmplidh air a bheatha fhéin, gnothaichean mun cuairt, agus feumalachdan bunaiteach.','caoimhinsmo',1576790322,'caoimhinsmo',1579378029),(521,'it','Comunica in attività semplici e di abitudine che richiedono un semplice scambio di informazioni su argomenti familiari e comuni. Sa descrivere in termini semplici aspetti della sua vita, dell\'ambiente circostante; sa esprimere bisogni immediati.','caoimhinsmo',1576774164,'caoimhinsmo',1576774164),(521,'pt','É capaz de compreender frases isoladas e expressões de uso frequente relacionadas com assuntos de prioridade imediata (por exemplo, informações pessoais e familiares simples, compras, meio envolvente, trabalho). É capaz de comunicar em situações correntes que apenas exijam trocas de informações simples e directas sobre assuntos e actividades habituais. É capaz de descrever com meios simples a sua formação, o seu meio envolvente e referir assuntos que correspondam a necessidades imediatas.','caoimhinsmo',1576841115,'caoimhinsmo',1576841115),(521,'sh','Komunicirajte jednostavnim i uobičajenim aktivnostima koje zahtijevaju jednostavnu razmjenu informacija o poznatim i uobičajenim temama. Može na jednostavan način opisati aspekte svoga života, okoline; može izraziti neposredne potrebe.','giuseppelic',1582791285,'giuseppelic',1582791321),(522,'bg','Може да разбира основни моменти, когато се използва ясен и стандартен език, от познатитеми, свързани с работата, училището, свободното време и др. Може да се справя в пове-чето ситуации по време на пътуване в страна, където се говори изучаваният език. Можеда се изразява просто и смислено по познати теми и по теми от своя кръг от интереси.Може да разказва събитие, случка или мечта, да описва очакване или цел и да излага на-кратко причини или обяснения за проект или идея','caoimhinsmo',1576774980,'caoimhinsmo',1577905433),(522,'br','Gellout a ra kompren krafoù-pennañ un enmont sklaer ha standard e-barzh goulennoù/kudennoù a vez merzhet gantañ/ganti pa vez en e/he labour, skol, dudioù, hag all hag all. En e vleud emañ (eñ/hi) ne vern ket e peseurt pleg emañ (eñ/hi) evit mont war wellaat p\'emañ (eñ/hi) o veajiñ en ur zonenn a vez komzet ar yezh enni. Gellout a ra produiñ testennoù eeun ha kevreet d\'ar sujedoù a zo anavezet gantañ/ganti war ar pemdez pe e vez (eñ/hi) desachet ganto en un doare personel. Gellout a ra deskrivañ traoù bet bevet gantañ/ganti ha darvoudoù, hunvreoù, spioù &amp; hag ivez c\'hoantoù hag reiñ e-berr gomzoù abegoù ha displegadurioù d\'e/he v/mennoioù ha d\'e/he b/flañioù.','Pêr',1579394623,'',0),(522,'da','Kan forstå hovedpunkterne i en klar fremstilling om dagligdags forhold, som man støder på i forbindelse med arbejde, skole, fritidsaktiviteter, mv. Kan håndtere de fleste situationer, som kan forudses i forbindelse med at rejse i et land, hvor sproget tales. Kan producere en enkel, sammenhængende tekst om dagligdags emner, og emner som har han/hendes specielle interesse. Kan redegøre for en oplevelse, en begivenhed, for personlige drømme og mål, samt kort fremføre begrundelser og forklaringer i forbindelse med et personligt projekt.','caoimhinsmo',1576840679,'caoimhinsmo',1576840679),(522,'de','Kann die Hauptpunkte verstehen, wenn klare Standardsprache verwendet wird und wenn es um vertraute Dinge aus Arbeit, Schule, Freizeit usw. geht.Kann die meisten Situationen bewältigen, denen man auf Reisen im Sprachgebiet begegnet.  Kann sich einfach und zusammenhängend über vertraute Themen und persönliche Interessengebiete äußern.  Kann über Erfahrungen und Ereignisse berichten, Träume, Hoffnungen und Ziele beschreiben und zu Plänen und Ansichten kurze Begründungen oder Erklärungen geben.','caoimhinsmo',1576769034,'caoimhinsmo',1576769860),(522,'en','Can understand the main points of clear standard input on familiar matters regularly encountered in work, school, leisure, etc. Can deal with most situations likely to arise whilst travelling in an area where the language is spoken. Can produce simple connected text on topics which are familiar or of personal interest. Can describe experiences and events, dreams, hopes and ambitions and briefly give reasons and explanations for opinions and plans.','caoimhinsmo',1576766170,'caoimhinsmo',1579378160),(522,'es','Es capaz de comprender los puntos principales de textos claros y en lengua estándar si tratan sobre cuestiones que le son conocidas, ya sea en situaciones de trabajo, de estudio o de ocio. Sabe desenvolverse en la mayor parte de las situaciones que pueden surgir durante un viaje por zonas donde se utiliza la lengua. Es capaz de producir textos sencillos y coherentes sobre temas que le son familiares o en los que tiene un interés personal. Puede describir experiencias, acontecimientos, deseos y aspiraciones, así como justificar brevemente sus opiniones o explicar sus planes. ','caoimhinsmo',1576770419,'caoimhinsmo',1576770419),(522,'fr','Peut comprendre les points essentiels quand un langage clair et standard est utilisé et s\'il s\'agit de choses familières dans le travail, à l\'école, dans les loisirs, etc. Peut se débrouiller dans la plupart des situations rencontrées en voyage dans une région où la langue cible est parlée. Peut produire un discours simple et cohérent sur des sujets familiers et dans ses domaines d\'intérêt. Peut raconter un événement, une expérience ou un rêve, décrire un espoir ou un but et exposer brièvement des raisons ou explications pour un projet ou une idée.','caoimhinsmo',1576838765,'caoimhinsmo',1576838765),(522,'ga','Is féidir leis na príomhphointí a thuiscint i ngnáthchaint shoiléir agus chaighdeánach ar chúrsaí coitianta a bpléitear go rialta leo san áit oibre, ar scoil, le linn caitheamh aimsire, etc. Is féidir leis déileáil le formhór na gcásanna ar dóigh dóibh teacht chun cinn agus é ag taisteal i gceantar ina labhraítear an teanga. Is féidir leis téacs atá simplí agus nasctha a tháirgeadh ar thopaicí a bhfuil cur amach aige orthu nó a bhfuil spéis phearsanta aige iontu. Is féidir leis trácht a dhéanamh ar eispéiris, ar eachtraí, ar mhianta, ar ábhair dhóchais agus ar uaillmhianta agus cúiseanna achoimre a thabhairt le tuairimí agus le pleananna agus mínithe achoimre a thabhairt orthu. ','CÓD',1579557689,'CÓD',1579557689),(522,'gd','Tuigidh e/i na prìomh phuingean ann an conaltradh soilleir air gnothaichean air a bheil e eòlach anns an obair, sgoil, cur-seachadan, 7c. Nì e an gnothach anns a’ mhórchuid de shuidheachaidhean a dh’ éiricheas fhad’s a tha e a’ siubhal ann an sgìre far a bheilear a’ bruidhinn a’ chànain. Sgrìobhaidh e teacsa sìmplidh leantannach mu chuspairean air a bheil e eòlach no anns a bheil ùidh aige.  Bheir e cunntas air rudan a thachair dha, air a dhòchasan, aislingean agus amasan, agus bheir e adhbharan agus mìneachaidhean goirid air beachdan agus planaichean.','caoimhinsmo',1576795110,'caoimhinsmo',1579377875),(522,'it','Comprende i punti chiave di argomenti familiari che riguardano la scuola, il tempo libero ecc. Sa muoversi con disinvoltura in situazioni che possono verificarsi mentre viaggia nel Paese di cui parla la lingua. È in grado di produrre un testo semplice relativo ad argomenti che siano familiari o di interesse personale. È in grado di esprimere esperienze e avvenimenti, sogni, speranze e ambizioni, e anche di spiegare brevemente le ragioni delle sue opinioni e dei suoi progetti.','caoimhinsmo',1576774182,'caoimhinsmo',1576774182),(522,'pt','É capaz de compreender os pontos essenciais quando a linguagem padrão utilizada é clara, tratando-se de aspectos familiares em contextos de: trabalho, escola, tempos livres, etc. É capaz de participar na maior parte das situações que podem ocorrer em viagem, numa região onde a língua alvo é falada. É capaz de organizar um discurso simples e coerente sobre assuntos familiares, em diferentes domínios de interesse. É capaz de relatar acontecimentos, experiências ou um sonho, expressar um desejo ou uma ambição e justificar, de forma breve, as razões de um projecto ou de uma ideia.','caoimhinsmo',1576841138,'caoimhinsmo',1576841138),(522,'sh','Uključuje ključne točke poznatih tema vezanih za školu, slobodno vrijeme itd. Zna kako se lako kretati u situacijama koje se mogu dogoditi tijekom putovanja u zemlju o kojoj govori jezikom. Može stvoriti jednostavan tekst koji se odnosi na poznate teme ili iz osobnog interesa. U stanju je izraziti iskustva i događaje, snove, nade i ambicije, a ujedno i ukratko objasniti razloge svojih mišljenja i projekata.','giuseppelic',1582791496,'giuseppelic',1582791585),(523,'bg','Може да разбира основното съдържание на конкретни или абстрактни теми в сложентекст, както и в дискусия на професионални теми по своята специалност. Може да общував известна степен спонтанно и непринудено при разговор с носител на езика без напреже-ние за двете страни. Може да се изразява ясно и подробно по широк кръг от теми, да из-казва мнение по актуални теми и да излага предимствата и недостатъците при различнивъзможности.','caoimhinsmo',1576774997,'caoimhinsmo',1577905466),(523,'br','Gellout a ra (eñ/hi) kompren mennozhioù-pennañ un destenn luziet war sujedoù fetis ha difetis, en o mesk eskemmoù teknikel e-barzh e/he d/zachenn spis. Gellout a ra (eñ/he) kaout eskemmoù en un doare aes ha gant kalz brimded ar pezh a ro an tu dezhañ da gaout eskemmoù gant tud komzerien a-vihanik posupl pe dost hep striv ebet evit an daou du. Gellout a ra (eñ/hi) produiñ testennoù sklaer, e-leizh a vunudoù diwar-benn a bep seurt tachenn ha displegañ ur sav-boent diwar-benn ur gudenn en ur reiñ ar perzhioù mat hag ar sioù a zo evit meur a dra.','Pêr',1579394623,'',0),(523,'da','Kan forstå hovedpunkterne i en kompleks tekst om både konkrete og abstrakte emner, herunder faglige diskussioner inden for et for han/hende kendt fagområde. Kan indgå i samtale med ’native speakers’ med så meget fluency og spontanitet, at samtalen ikke bliver anstrengende for nogen af parterne.  Kan udtrykke sig klart og detaljeret om en bred vifte af emner, fremsætte sin mening om dagsaktuelle begivenheder samt udtrykke fordele og ulemper, når han/hun skal forholde sig til forskellige problemstillinger.','caoimhinsmo',1576840719,'caoimhinsmo',1576840719),(523,'de','Kann die Hauptinhalte komplexer Texte zu konkreten und abstrakten Themen verstehen; versteht im eigenen Spezialgebiet auch Fachdiskussionen.  Kann sich so spontan und fließend verständigen, dass ein normales Gespräch mit Muttersprachlern ohne größere Anstrengung auf beiden Seiten gut möglich ist.  Kann sich zu einem breiten Themenspektrum klar und detailliert ausdrücken, einen Standpunkt zu einer aktuellen Frage erläutern und die Vor- und Nachteile verschiedener Möglichkeiten angeben. ','caoimhinsmo',1576770041,'caoimhinsmo',1576770073),(523,'en','Can understand the main ideas of complex text on both concrete and abstract topics, including technical discussions in his/her field of specialisation. Can interact with a degree of fluency and spontaneity that makes regular interaction with native speakers quite possible without strain for either party. Can produce clear, detailed text on a wide range of subjects and explain a viewpoint on a topical issue giving the advantages and disadvantages of various options.','caoimhinsmo',1576766197,'caoimhinsmo',1579378254),(523,'es','Es capaz de entender las ideas principales de textos complejos que traten de temas tanto concretos como abstractos, incluso si son de carácter técnico siempre que estén dentro de su campo de especialización. Puede relacionarse con hablantes nativos con un grado suficiente de fluidez y naturalidad de modo que la comunicación se realice sin esfuerzo por parte de ninguno de los interlocutores. Puede producir textos claros y detallados sobre temas diversos así como defender un punto de vista sobre temas generales indicando los pros y los contras de las distintas opciones. ','caoimhinsmo',1576773819,'caoimhinsmo',1576773819),(523,'fr','Peut comprendre le contenu essentiel de sujets concrets ou abstraits dans un texte complexe, y compris une discussion technique dans sa spécialité. Peut communiquer avec un degré de spontanéité et d\'aisance tel qu\'une conversation avec un locuteur natif ne comportant de tension ni pour l\'un ni pour l\'autre. Peut s\'exprimer de façon claire et détaillée sur une grande gamme de sujets, émettre un avis sur un sujet d’actualité et exposer les avantages et les inconvénients de différentes possibilités.','caoimhinsmo',1576838799,'caoimhinsmo',1576838799),(523,'ga','Is féidir leis na príomhsmaointe a thuiscint i dtéacsanna casta a bhaineann le topaicí nithiúla agus le topaicí teibí araon, lena n-áirítear díospóireachtaí teicniúla ina shainréimse spéise féin. Is féidir leis caidreamh a dhéanamh go measartha líofa agus gan réamhsmaoineamh, a fhágann go mbíonn sé in ann caidreamh rialta a dhéanamh le cainteoirí dúchais gan mórán stró ar cheachtar acu. Is féidir leis téacs atá soiléir agus mionsonraithe a tháirgeadh ar raon leathan ábhar agus míniú a thabhairt ar thuairim ar cheist thráthúil, agus na buntáistí agus na míbhuntáistí a bhaineann le roghanna éagsúla á gcur in iúl aige. ','CÓD',1579557738,'CÓD',1579557738),(523,'gd','Tuigidh e/i na prìomh-bheachdan ann an teagsa ioma-fhillteach air an dà chuid cuspairean cruaidh agus cuspairean feallsanachdail, agus tuigidh e deasbad teicnigeach anns a’ chuspair air a bheil e fhéin mion-eòlach. Nì e còmhradh a tha fileanta agus luath gu leòr agus gum faod e conaltradh cunbhalach a dhèanamh ri luchd-labhairt dùchasach gun móran spàirn air taobh seach taobh. Sgrìobhaidh e teagsa soilleir mionaideach air raon farsaing de chuspairean, agus bheir e beachd air cuspair a tha sna naidheachdan, a’ mìneachadh nan leasan agus nam mì-leasan a bhuineas ri na diofar roghainnean.','caoimhinsmo',1576797433,'caoimhinsmo',1579378264),(523,'it','Comprende le idee principali di testi complessi su argomenti sia concreti sia astratti, come pure le discussioni tecniche sul proprio campo di specializzazione. È in grado di interagire con una certa scioltezza e spontaneità che rendono possibile un\'interazione naturale con i parlanti nativi senza sforzo per l\'interlocutore. Sa produrre un testo chiaro e dettagliato su un\'ampia gamma di argomenti e riesce a spiegare un punto di vista su un argomento fornendo i pro e i contro delle varie opzioni.','caoimhinsmo',1576774194,'caoimhinsmo',1576774194),(523,'pt','É capaz de compreender o conteúdo essencial de assuntos concretos ou abstractos num texto complexo, incluindo uma discussão técnica na sua especialidade. É capaz de comunicar com uma grande espontaneidade que permita uma conversa com um falante nativo, não se detectando tensão em nenhum dos falantes. É capaz de exprimir-se de forma clara e pormenorizada sobre uma vasta gama de assuntos, emitir uma opinião sobre uma questão actual e discutir sobre as vantagens e as desvantagens de diferentes argumentos.','caoimhinsmo',1576841159,'caoimhinsmo',1576841159),(523,'sh','Ukljucuje glavne ideje opseznih  tekstova u vezi konkretnih i apstraktnih tema, kao tehnicke rasprave u vlastitom podrucju specijalizacije. U stanju je komunicirati fluidno i spontano sto omogucuje prirodnu interakciju sa izvornim govornicima bez napora za sagovornika. Može izraditi jasan i detaljan tekst o širokom rasponu tema i objasniti točku gledišta na temu pružajući prednosti i nedostatke različitih opcija.','giuseppelic',1582791671,'giuseppelic',1582792494),(524,'bg','Може да разбира широк кръг от дълги и сложни текстове, както и да долавя имплицитниидеи. Може да се изразяваспонтанно и свободно, без явно затруднение при намирането нанеобходимите думи. Може да използва ефикасно и гъвкаво езика в своя социален, професио-нален или академичен живот. Може да се изказва ясно и добре структурирано по сложнитеми и да владее добре средствата за организация, артикулация и свързаност на речта.','caoimhinsmo',1576803336,'caoimhinsmo',1577905510),(524,'br','Gellout a ra (eñ/he) komprenn ur bladigenn ledan a dachennoù spis-daonet, testennoù hir, ha gouest eo da anavezout termennadennoù ampsis. Gellout a ra (eñ/he) ezteurel e soñjoù en un doare aeset ha prim da vat hep n\'en/he dije da glask war-lerc\'h troiennoù-lavar. Gellout a ra (eñ/he) diskouez e oar (eñ/he) ur yezh wevn hag efedus evit ezhommoù sokial, skol-veurel ha micherel war gement-se. Gellout a ra (eñ/he) produiñ testennoù sklaer, aozet-kaer, gant munudoù e-leizh war a bep seurt sujed, o tiskouez un implij eus patromoù kontrollet hag aozet, stagelloù hag evit echuiñ ganti stignadurioù kenstagus.','Pêr',1579394623,'',0),(524,'da','Kan forstå og gennemskue et bredt udvalg af  længere, krævende tekster. Kan udtrykke sig flydende og spontant uden alt for synligt at lede efter ordene. Kan bruge sproget effektivt og nuanceret i såvel sociale, som studiemæssige og professionelle sammenhænge. Kan udtrykke sig klart og velstruktureret om komplekse emner, samt benytte sproglige redskaber, der sikrer sammenhæng og overblik i det han/hun vil udtrykke.','caoimhinsmo',1576840763,'caoimhinsmo',1576840763),(524,'de','Kann ein breites Spektrum anspruchsvoller, längerer Texte verstehen und auch implizite Bedeutungen erfassen.  Kann sich spontan und fließend ausdrücken, ohne öfter deutlich erkennbar nach Worten suchen zu müssen.  Kann die Sprache im gesellschaftlichen und beruflichen Leben oder in Ausbildung und Studium wirksam und flexibel gebrauchen.  Kann sich klar, strukturiert und ausführlich zu komplexen Sachverhalten äußern und dabei verschiedene Mittel zur Textverknüpfung angemessen verwenden. ','caoimhinsmo',1576770123,'caoimhinsmo',1576770231),(524,'en','Can understand a wide range of demanding, longer texts, and recognise implicit meaning. Can express him/herself fluently and spontaneously without much obvious searching for expressions. Can use language flexibly and effectively for social, academic and professional purposes. Can produce clear, well-structured, detailed text on complex subjects, showing controlled use of organisational patterns, connectors and cohesive devices.','caoimhinsmo',1576766235,'caoimhinsmo',1579378302),(524,'es','Es capaz de comprender una amplia variedad de textos extensos y con cierto nivel de exigencia, así como reconocer en ellos sentidos implícitos. Sabe expresarse de forma fluida y espontánea sin muestras muy evidentes de esfuerzo para encontrar la expresión adecuada. Puede hacer un uso flexible y efectivo del idioma para fines sociales, académicos y profesionales. Puede producir textos claros, bien estructurados y detallados sobre temas de cierta complejidad, mostrando un uso correcto de los mecanismos de organización, articulación y cohesión del texto. ','caoimhinsmo',1576773837,'caoimhinsmo',1576773837),(524,'fr','Peut comprendre une grande gamme de textes longs et exigeants, ainsi que saisir des significations implicites. Peut s\'exprimer spontanément et couramment sans trop apparemment devoir chercher ses mots. Peut utiliser la langue de façon efficace et souple dans sa vie sociale, professionnelle ou académique. Peut s\'exprimer sur des sujets complexes de façon claire et bien structurée et manifester son contrôle des outils d\'organisation, d\'articulation et de cohésion du discours.','caoimhinsmo',1576838815,'caoimhinsmo',1576838815),(524,'ga','Is féidir leis raon leathan téacsanna atá casta agus fada a thuiscint, agus an bhunbhrí intuigthe a aithint. Is féidir leis é féin a chur in iúl go líofa agus gan réamhsmaoineamh, gan nathanna cainte a chuardach go follasach. Is féidir leis teanga a úsáid go solúbtha agus go héifeachtach chun críocha sóisialta, acadúla agus gairmiúla. Is féidir leis téacs atá soiléir, dea-struchtúrtha agus mionsonraithe a tháirgeadh ar ábhair chasta, agus úsáid rialaithe as patrúin eagraíochtúla, as nascairí agus as seifteanna comhtháite a thaispeáint. ','CÓD',1579557765,'CÓD',1579557765),(524,'gd','Tuigidh e/i raon farsaing de theacsaichean fada dùbhlanacha, agus aithnichidh e brìgh a tha falaichte. Cuiridh e a bheachdan an céill gu fileanta agus anns a bhad, gun sporghail ro fhollaiseach airson fhaclan iomchaidh. Cleachdaidh e an cànan gu sùbailte agus gu h-éifeachdach airson ghnothaichean sòisealta, acadaimigeach agus proifeasanta. Sgrìobhaidh e teacsa soilleir, rianail, mionaideach, co-sheasmhach air chuspairean ioma-fhillteach, a’ cur feum gu h-ealanta air dòighean rianaidh agus dòighean co-cheangail.','caoimhinsmo',1576801021,'caoimhinsmo',1579378316),(524,'it','Comprende un\'ampia gamma di testi complessi e lunghi e ne sa riconoscere il significato implicito. Si esprime con scioltezza e naturalezza. Usa la lingua in modo flessibile ed efficace per scopi sociali, professionali e accademici. Riesce a produrre testi chiari, ben costruiti, dettagliati su argomenti complessi, mostrando un controllo sicuro della struttura testuale, dei connettori e degli elementi di coesione.','caoimhinsmo',1576774207,'caoimhinsmo',1576774207),(524,'pt','É capaz de compreender uma vasta gama de textos longos e complexos, assim como detectar significações implícitas. É capaz de exprimir-se de forma espontânea e fluente sem, aparentemente, ter de procurar as palavras. É capaz de utilizar a língua de maneira eficaz e flexível na sua vida social, profissional ou académica. É capaz de exprimir-se sobre assuntos complexos, de forma clara e bem estruturada, e de mostrar domínio dos meios de organização, de articulação e de coesão do discurso.','caoimhinsmo',1576841186,'caoimhinsmo',1576841186),(524,'sh','Sadrži širok raspon složenih i dugih tekstova i može prepoznati njihovo implicitno značenje. Izražava se tečno i prirodno. Upotrebljavajte jezik fleksibilno i efikasno u društvene, profesionalne i akademske svrhe. Uspijeva stvoriti jasne, dobro sastavljene, detaljne tekstove o složenim temama, pokazujući sigurnu kontrolu nad tekstualnom strukturom, veznicima i elementima kohezije.','giuseppelic',1582792688,'giuseppelic',1582792867),(525,'bg','Може да разбира без усилие практически всичко, което чете или чува. Може да възстановя-ва факти и аргументи от различни писмени и устни източници, като ги резюмира взаимо-свързано. Може да се изразява спонтанно, много свободно и точно. Може да отличава финисмислови нюанси дори в по-сложни ситуации.','caoimhinsmo',1576803357,'caoimhinsmo',1577905541),(525,'br','Gellout a ra (eñ/he) kompren en un doare aeset pep-tra klevet pe skrivet. Gellout a ra (eñ/he) ober ur verradenn diwar meur a vammenn komzet pe skrivet, en ur adsevel arguzennoù ha kontoù e-barzh ur c\'hinnig kempoell. Gellout a ra (eñ/hi) komz prim, en un doare aeset ha spis-ruz, en ur ober an diforc\'h etre skeudoù moanañ al lavar ha pa vefe er c\'hendestennoù luzietañ a vez.','Pêr',1579394623,'',0),(525,'da','Kan uden besvær forstå næsten alt hvad han/hun læser eller hører. Kan opsummere informationer og argumenter fra både mundtlige og skrevne kilder og gengive disse på en sammenhængende måde.  Kan udtrykke sig spontant, meget flydende og præcist, med evne til at gennemskue betydningsnuancer selv i komplekse sammenhænge.','caoimhinsmo',1576840805,'caoimhinsmo',1576840805),(525,'de','Kann praktisch alles, was er/sie liest oder hört, mühelos verstehen.  Kann Informationen aus verschiedenen schriftlichen und mündlichen Quellen zusammenfassen und dabei Begründungen und Erklärungen in einer zusammenhängenden Darstellung wiedergeben.  Kann sich spontan, sehr flüssig und genau ausdrücken und auch bei komplexeren Sachverhalten feinere Bedeutungsnuancen deutlich machen.','caoimhinsmo',1576770138,'caoimhinsmo',1576803275),(525,'en','Can understand with ease virtually everything heard or read. Can summarise information from different spoken and written sources, reconstructing arguments and accounts in a coherent presentation. Can express him/herself spontaneously, very fluently and precisely, differentiating finer shades of meaning even in the most complex situations.','caoimhinsmo',1576766264,'caoimhinsmo',1579377750),(525,'es','Es capaz de comprender con facilidad prácticamente todo lo que oye o lee. Sabe reconstruir la información y los argumentos procedentes de diversas fuentes, ya sean en lengua hablada o escrita, y presentarlos de manera coherente y resumida. Puede expresarse espontáneamente, con gran fluidez y con un grado de precisión que le permite diferenciar pequeños matices de significado incluso en situaciones de mayor complejidad. ','caoimhinsmo',1576773850,'caoimhinsmo',1576773850),(525,'fr','Peut comprendre sans effort pratiquement tout ce qu\'il/elle lit ou entend. Peut restituer faits et arguments de diverses sources écrites et orales en les résumant de façon cohérente. Peut s\'exprimer spontanément, très couramment et de façon précise et peut rendre distinctes de fines nuances de sens en rapport avec des sujets complexes.','caoimhinsmo',1576838826,'caoimhinsmo',1576841263),(525,'ga','Is féidir leis beagnach gach rud a chloiseann nó a léann sé a thuiscint. Is féidir leis achoimre a dhéanamh ar fhaisnéis a fhaightear ó fhoinsí difriúla labhartha agus scríofa, agus argóintí agus cuntais a athinsint i gcur i láthair comhleanúnach. Is féidir leis é féin a chur in iúl gan réamhsmaoineamh, go líofa agus go beacht, agus miondifríochtaí céille a chur in iúl go cruinn is cuma cé chomh casta is atá na cúinsí. ','CÓD',1579557796,'CÓD',1579557796),(525,'gd','Tuigidh e/i gun strì cha mhór a h-uile rud a leigheas e agus a chluinneas e. Nì e sùmhlachadh air fiosrachadh sgaipte, an dà chuid sgrìobhte agus labhairteach, gus beachdan agus iomraidhean a chur ri chéile ann an tuairisgeul co-sheasmhach. Cuiridh e e fhéin an céill sa bhad, ann an dòigh air leth fileanta agus mionaideach, a’ sgaradh mion-chaochlaideachd brìghe, eadhan ann an suidheachaidhean gu math ioma-fhillteach.','caoimhinsmo',1576803179,'caoimhinsmo',1579377773),(525,'it','Comprende con facilità praticamente tutto ciò che sente e legge. Sa riassumere informazioni provenienti da diverse fonti sia parlate che scritte, ristrutturando gli argomenti in una presentazione coerente. Sa esprimersi spontaneamente, in modo molto scorrevole e preciso, individuando le sfumature di significato più sottili in situazioni complesse.','caoimhinsmo',1576774222,'caoimhinsmo',1576774222),(525,'pt','É capaz de compreender sem esforço praticamente tudo o que lê ou ouve. É capaz de reconstituir factos e argumentos de fontes diversas, escritas e orais, resumindo-as de forma coerente.É capaz de se exprimir de forma espontânea, fluente e precisa e de distinguir pequenas diferenças de sentido relacionadas com assuntos complexos.','caoimhinsmo',1576841213,'caoimhinsmo',1576841213),(525,'sh','Razumije praktički sve što čuje i pročita. On može sažeti informacije iz različitih govornih i pisanih izvora, reorganizirajući teme u skladnoj prezentaciji. Zna kako se spontano, na vrlo tečan i precizan način izraziti, prepoznavajući najsitnije nijanse značenja u složenim situacijama.','giuseppelic',1582792946,'giuseppelic',1582792946),(526,'bg','Вид медия','caoimhinsmo',1576848395,'caoimhinsmo',1576848395),(526,'br','Doare media','Pêr',1579394623,'',0),(526,'da','Medietype','caoimhinsmo',1576848407,'caoimhinsmo',1576848407),(526,'en','Media type','caoimhinsmo',1576845141,'caoimhinsmo',1576845141),(526,'es','Tipo de archivo multimedia','sodisar',1578741399,'sodisar',1578741399),(526,'fr','Type de média','Pêr',1577705535,'Pêr',1577705535),(5