'sh','Brisanje jedinice nije uspelo %d','giuseppelic',1582798682,'giuseppelic',1582798682),(593,'br','Clilstore a zo ur stokadur danvez {endalc\'had ha yezhoù enkorfet deskiñ} gant gwirioù ha n\'int ket strizh.','Pêr',1579601213,'Pêr',1579601290),(593,'da','Clilstore er en database med copyleft  CLIL {indholds og sprogintegreret lærings} materialer.','fred',1578309989,'fred',1578309989),(593,'en','Clilstore is a store of copyleft {content and language integrated learning} materials.','caoimhinsmo',1578254715,'caoimhinsmo',1578255129),(593,'es','Clilstore es un repositorio de materiales copyleft de {Aprendizaje Integrado de Contenidos y Lenguas Extranjeras} (AICLE).','sodisar',1578682055,'agimeno',1578862096),(593,'fr','Clilstore est un magasin de matériel copyleft {contenu et langage intégré}.','Pêr',1579613619,'Pêr',1579613619),(593,'ga','Stóras d\'ábhair cóipchearta {foghlaim chomhtháite ábhar agus teanga} is ea Clilstore','CÓD',1579908053,'CÓD',1579908053),(593,'gd','’S e a tha ann an Clilstore ach stòras de stuth “CLIL” {(content and language integrated learning)} a ghabhas a chleachdadh saor ’s an asgaidh gus cànan agus cuspair air choireigin eile a ionnsachadh aig an aon àm.','caoimhinsmo',1578254936,'caoimhinsmo',1578255467),(593,'it','Clilstore è una contenitore di materiali copyleft { apprendimento integrato di contenuto e  lingua }.','pizzoccheriale',1578587422,'sodisar',1578682029),(593,'pt','Clilstore é uma loja de materiais copyleft {conteúdo e aprendizagem integrada de linguagem}.','etimalta',1600426678,'etimalta',1600426678),(593,'sh','Clilstore je banka podataka materijala copyleft { integrirano ucenje sadrzaja i jezika }.','giuseppelic',1582798917,'giuseppelic',1582799067),(594,'br','Diorret e vez gant {Caoimhín Ó Donnaíle} e {Sabhal Mòr Ostaig} war an enezenn Skye evel bezañ ar raktres {COOL} arc\'hantaouet gant Europa (etre 2018-2021), renet gant {Ana Gimeno} e {Universitat Politècnica de València} e Bro-Spagn, sikouret Kent Andersen e {FAZ} e Bro-Danmark, ha gant kevelerien all gant {Ollscoil Uladh} e Bro-Iwerzhon, {Kroggårdsskolen} en Odense e Bro-Danmark, {ETI Malta (Executive Training Institute)}, hag {Liceo Scientifico Statale Elio Vittorini} e Milan Bro-Italia.','Pêr',1579601308,'Pêr',1579692961),(594,'da','Det udvikles af {Caoimhín Ó Donnaíle} i {Sabhal Mòr Ostaig} i Skye som en del af det europæiske finansierede {COOL} -projekt (2018-2021), ledet af {Ana Gimeno} på {Universitat Politècnica de València} i Spanien, assisteret af Kent Andersen i {FAZ} i Danmark og med andre partnere fra {Ollscoil Uladh} i Irland, {Kroggårdsskolen} i Odense i Danmark, {ETI Malta (Executive Training Institute)} og {Liceo Scientifico Statale Elio Vittorini} i Milan i Italien.','fred',1578310037,'fred',1578310037),(594,'en','It is being developed by {Caoimhín Ó Donnaíle} at {Sabhal Mòr Ostaig} in Skye as part of the European funded {COOL} project (2018-2021), led by {Ana Gimeno} at {Universitat Politècnica de València} in Spain, assisted by Kent Andersen at {FAZ} in Denmark, Caoimhín Ó Dónaill {Ulster University} in Ireland, and other partners from {Kroggårdsskolen} in Odense in Denmark, {ETI Malta (Executive Training Institute)}, and {Liceo Scientifico Statale Elio Vittorini} in Milan in Italy.','caoimhinsmo',1578256072,'CÓD',1579907365),(594,'es','Lo está desarrollando {Caoimhín Ó Donnaíle} de {Sabhal Mòr Ostaig} en Syke (Escocia) como parte del proyecto {COOL}, cofinanciado por la Comisión Europea y dirigido por {Ana Gimeno} de la {Universitat Politècnica de València} en España, asistida por Kent Andersen de {FAZ}, Dinamarca, Caoimhín Ó Dónaill {Ollscoil Uladh} en Irlanda, y por otros socios de {Kroggårdsskolen} en Odense, Dinamarca, {ETI Malta (Executive Training Institute)}, y el {Liceo Scientifico Statale Elio Vittorini} en Milán, Italia.','sodisar',1578682388,'CÓD',1579907558),(594,'fr','Développé par {Caoimhín Ó Donnaíle} à {Sabhal Mòr Ostaig} à Skye dans le cadre du projet {COOL} financé par l\'Europe (2018-2021), par {Universitat Politècnica de València} en Espagne, assisté de Kent Andersen à {FAZ} au Danemark, et avec d\'autres partenaires de {University of Ulster} en Irlande, {Kroggårdsskolen} à Odense au Danemark, {ETI Malta (Executive Training Institute)} et {Liceo Scientifico Statale Elio Vittorini} à Milan en Italie.','Pêr',1579613600,'Pêr',1579613600),(594,'ga','Tá sé á fhorbairt ag {Caoimhín Ó Donnaíle} i {Sabhal Mòr Ostaig} ar an Eilean Sgitheanach mar chuid den tionscadal Eorpach {COOL} (2018-2021), comhordaithe ag {Ana Gimeno} in {Universitat Politècnica de València} sa Spáinn, i gcomhair le Kent Andersen ó {FAZ} sa Danmhairg, Caoimhín Ó Dónaill {Ollscoil Uladh} in Éirinn, agus páirtnéirí eile ó {Kroggårdsskolen} in Odense sa Danmhairg, {ETI Malta (Executive Training Institute)}, agus {Liceo Scientifico Statale Elio Vittorini} i Milan na hIodáile.','CÓD',1579906890,'CÓD',1579907938),(594,'gd','Tha e ga phrògramadh agus ga leasachadh le {Caoimhín Ó Donnaíle} aig {Sabhal Mòr Ostaig} san Eilean Sgitheanach mar phàirt den phròiseact Eòrpach {COOL} (2018-2021). Tha COOL ga stiùireadh le {Ana Gimeno} aig {Universitat Politècnica de València} sa Spàinn, le taic bho Kent Andersen aig {FAZ} san Danmhairg, agus le com-pàirtichean eile bho {Ollscoil Uladh} ann an Éirinn, {Kroggårdsskolen} ann an Odense san Danmhairg, {ETI Malta (Executive Training Institute)} ann am Malta, agus {Liceo Scientifico Statale Elio Vittorini} ann am Milano san Eadailt.','caoimhinsmo',1578260227,'caoimhinsmo',1578260738),(594,'it','È stato sviluppato da {Caoimhín Ó Donnaíle} presso {Sabhal Mòr Ostaig} a Skye nell\'ambito del progetto {COOL} finanziato dall\'Europa (2018-2021), guidato da {Ana Gimeno} presso {Universitat Politècnica de València} in Spagna, assistito da Kent Andersen presso {FAZ} in Danimarca e con altri partner: da {Ollscoil Uladh} in Irlanda, {Kroggårdsskolen} a Odense in Danimarca, {ETI Malta (Executive Training Institute)} e {Liceo Scientifico Statale Elio Vittorini} in Milano in Italia.','pizzoccheriale',1578589701,'pizzoccheriale',1578589789),(594,'pt','Ele está sendo desenvolvido por {Caoimhín Ó Donnaíle} em {Sabhal Mòr Ostaig} em Skye como parte do projeto {COOL} financiado pela Europa (2018-2021), liderado por {Ana Gimeno} na {Universitat Politècnica de València} na Espanha, assistido por Kent Andersen em {FAZ} na Dinamarca, Caoimhín Ó Dónaill {Ulster University} na Irlanda, e outros parceiros de {Kroggårdsskolen} em Odense na Dinamarca, {ETI Malta (Executive Training Institute)} e {Liceo Scientifico Statale Elio Vittorini } em Milão, na Itália.','etimalta',1600426629,'etimalta',1600426629),(594,'sh','Razvio ga je {Caoimhín Ó Donnaíle} u {Sabhal Mòr Ostaig} na Skye u okviru projekta {COOL} finansiranog od Evrope (2018-2021), vodjen od {Ana Gimeno} pri {Universitat Politècnica de València} u Spaniji, uz pomoc Kent Andersen pri {FAZ} u  Danskoj sa partnerima: {Ollscoil Uladh} u Irskoj, {Kroggårdsskolen} iz Odense u Danskoj, {ETI Malta (Executive Training Institute)} i {Liceo Scientifico Statale Elio Vittorini} iz Milano u Italiji.','giuseppelic',1582799144,'giuseppelic',1582799514),(595,'br','Diorret en deroù gant Caoimhín Ó Donnaíle e Sabhal Mòr Ostaig evel bezañ unan eus ar raktresoù {TOOLS} arc\'hantaouet gant Europa (etre 2012-2014), renet gant Kent Andersen e {{Denmark1}} ha gant kevelerien eus {{Denmark2}}, {{Ireland}}, {{Lithuania}}, {{Portugal}}, {{Spain}} hag ivez {EuroCALL}.','Pêr',1579601591,'Pêr',1579692984),(595,'da','Det blev oprindeligt udviklet af Caoimhín Ó Donnaíle i Sabhal Mòr Ostaig som en del af det europæiske finansierede {TOOLS} -projekt (2012-2014), ledet af Kent Andersen i {{Denmark1}} og med andre partnere fra {{Denmark2}}, {{Ireland}}, {{Lithuania}}, {{Portugal}}, {{Spain}} og {EuroCALL}.','fred',1578310089,'caoimhinsmo',1578325712),(595,'en','It was originally developed by Caoimhín Ó Donnaíle at Sabhal Mòr Ostaig as part of the European funded {TOOLS} project (2012-2014), led by Kent Andersen in {{Denmark1}} and with other partners from {{Denmark2}}, {{Ireland}}, {{Lithuania}}, {{Portugal}}, {{Spain}} and {EuroCALL}.','caoimhinsmo',1578260860,'caoimhinsmo',1578325830),(595,'es','Originalmente fue creado por Caoimhín Ó Donnaíle, de Sabhal Mòr Ostaig, como parte del projecto {TOOLS} (2012-2014), cofinanciado por la Comisión Europea y dirigido por Kent Andersen de {{Denmark1}}, y con socios de {{Denmark2}}, {{Ireland}}, {{Lithuania}}, {{Portugal}}, {{Spain}} y {EuroCALL}.','sodisar',1578739655,'agimeno',1578862440),(595,'fr','A été initialement développé par Caoimhín Ó Donnaíle à Sabhal Mòr Ostaig dans le cadre du projet {TOOLS} financé par l\'Europe (2012-2014), par Kent Andersen en {{Denmark1}}, et avec d\'autres partenaires de {{Denmark2}}, { {Irlande}}, {{Lituanie}}, {{Portugal}}, {{Espagne}} ainsi que {EuroCALL}.','Pêr',1579613485,'Pêr',1579613534),(595,'ga','D\'fhorbair Caoimhín Ó Donnaíle ó Sabhal Mòr Ostaig é ar an chéad dul síos mar chuid den tionscadal Eorpach {TOOLs} (2012-2014), comhordaithe ag Kent Andersen sa {{Denmark1}} agus le comhpháirtithe eile ó {{Denmark2}}, {{Ireland}}, {{Lithuania}}, {{Portugal}}, {{Spain}} agus {EuroCALL}.','CÓD',1579907651,'CÓD',1579907778),(595,'gd','Chaidh a chruthachadh an toiseach le Caoimhín Ó Donnaíle aig Sabhal Mòr Ostaig mar phàirt den phròiseact Eòrpach {TOOLS} (2012-2014), a chaidh a stiùireadh le Kent Andersen san {{Denmark1}} agus aig an robh com-pàirtichean eile san {{Denmark2}}, {{Ireland}}, {{Lithuania}}, {{Portugal}}, {{Spain}} agus {EuroCALL}.','caoimhinsmo',1578261898,'caoimhinsmo',1578269362),(595,'it','È stato originariamente sviluppato da Caoimhín Ó Donnaíle presso Sabhal Mòr Ostaig nell\'ambito del progetto {TOOLS} finanziato dall\'UE (2012-2014), guidato da Kent Andersen in {{Denmark1}} e con altri partner di {{Denmark2}}, {{Ireland}}, {{Lithuania}}, {{Portugal}}, {{Spain}} e {EuroCALL}.','pizzoccheriale',1578589283,'caoimhinsmo',1578777873),(595,'pt','It was originally developed by Caoimhín Ó Donnaíle at Sabhal Mòr Ostaig as part of the European funded {TOOLS} project (2012-2014), led by Kent Andersen in {{Denmark1}} and with other partners from {{Denmark2}}, {{Ireland}}, {{Lithuania}}, {{Portugal}}, {{Spain}} and {EuroCALL}.','etimalta',1600426588,'etimalta',1600426588),(595,'sh','Na pocetku je bio razvijen od strane Caoimhín Ó Donnaíle pri Sabhal Mòr Ostai u okviru projekta {TOOLS} finansiranog  od UE (2012-2014), vodjen od Kent Andersen u {{Denmark1}} sa partnerima iz {{Denmark2}}, {{Ireland}}, {{Lithuania}}, {{Portugal}}, {{Spain}} e {EuroCALL}.','giuseppelic',1582799561,'giuseppelic',1582799718),(596,'br','Clilstore a implij {Wordlink}, un aozadur diazezet war WWW hag a em-liamm en un doare tid al lec\'hiennoù web, ger-ha-ger gant lec\'hiennoù enlinenn. Ha Wordlink a gustum implijout {Multidict}, un aozadur evit kavout e meur a c\'heriadur hag a implij geriadurioù enlinenn hegerz en un doare digoust ha frank. An daou raktres \"Wordlink\" ha \"Multidict\" a zo bet diorroet evel bezañ raktresoù arc\'hantaouet gant ar font European {POOLS-T} (etre 2008-2010) hag o diorroadur a vez kendalc\'het en devezh a hiziv e-diabarzh stern ar raktres \"COOL\"-red.','Pêr',1579601729,'Pêr',1579693510),(596,'da','Clilstore bruger {Wordlink}, en WWW-baseret facilitet, der automatisk forbinder vilkårlige websider, ord for ord med online ordbøger. Og Wordlink bruger på sin side {Multidict}, en opslagsfacilitet til flere ordbøger, der gør brug af frit tilgængelige online ordbøger. Både Wordlink og Multidict blev udviklet som en del af det europæiske finansierede {POOLS-T} -projekt (2008-2010), og deres udvikling fortsætter som en del af det nuværende COOL-projekt.','fred',1578310132,'fred',1578310132),(596,'en','Clilstore uses {Wordlink}, a WWW based facility which links arbitrary webpages automatically, word by word with online dictionaries. And Wordlink in turn uses {Multidict}, a multiple dictionary lookup facility which makes use of freely available online dictionaries. Both Wordlink and Multidict were developed as part of the European funded {POOLS-T} project (2008-2010) and their development is continuing as part of the present COOL project.','caoimhinsmo',1578263221,'caoimhinsmo',1578263287),(596,'es','Clilstore utiliza {Wordlink}, una herramienta que enlaza automáticamente cualquier página web, palabra por palabra, a una selección de diccionarios en línea. Wordlink, en cambio, utiliza {Multidict}, una herramienta de búsqueda de palabras en múltiples diccionarios en línea, disponibles gratuitamente a través de la web. Ambos fueron desarrollados como parte del proyecto {POOLS-T} (2008-2010), cofinanciado por la Comisión Europea. A través del proyecto COOL (2018-2021) se están mejorando estas tres herramientas y añadiéndoles muchas más funcionalidades.','sodisar',1578739846,'agimeno',1578863021),(596,'fr','Clilstore utilise {Wordlink}, une installation basée sur WWW qui relie automatiquement des pages Web arbitraires, mot à mot, à des dictionnaires en ligne. Wordlink utilise à son tour {Multidict}, une fonction de recherche de plusieurs dictionnaires qui utilise des dictionnaires en ligne librement disponibles. « Wordlink » et « Multidict » ont été développés dans le cadre du projet {POOLS-T} financé par l\'Europe (2008-2010) et leur développement se poursuit dans le cadre du projet COOL actuel.','Pêr',1579613288,'Pêr',1579693231),(596,'ga','Úsáideann Clilstore {Wordlink}, saoráid idirlín a nascann leathanach idirlínm ar bith focal ar fhocal le foclóirí ar líne. Úsáideann Wordlink {Multidict} dá réir sin, saoráid a cheadaíonn sraith foclóirí ar líne atá ar fáil saor in aisce ag an aon am amháin. Forbraíodh Wordlink agus Multidict mar chuid den tionscadal {POOLS-T} (2008-2010) a mhaoinigh an tAontas Eorpach, agus leanann a bhforbairt ar aghaidh mar chuid den tionscadal reatha COOL.','CÓD',1579901890,'CÓD',1579902601),(596,'gd','Tha Clilstore a’ cur feum air {Wordlink}, goireas Eadarlìn a tha comasach air cha mhór duilleag WWW sam bith a cheangal facal air an fhacal ri faclairean air-loidhne. Tha Wordlink fhéin a’ cur feum air {Multidict}, goireas a tha a’ cur feum air na ceudan de dh’fhaclairean fosgailte air-loidhne agus a tha ga fhàgail furasta leum gu luath eadarra. Chaidh an dà chuid Wordlink agus Multidict a chruthachadh mar phàirt den phròiseact Eòrpach {POOLS-T} (2008-2019), agus tha an obair leasachaidh orra a’ leantainn oirre mar phàrt den phròiseact COOL.','caoimhinsmo',1578263696,'caoimhinsmo',1578264407),(596,'it','Clilstore utilizza {Wordlink}, una struttura basata sul WWW che collega automaticamente pagine Web arbitrarie, parola per parola con dizionari online.E Wordlink a sua volta utilizza {Multidict}, una funzione di ricerca di più dizionari che utilizza dizionari online disponibili gratuitamente. Sia Wordlink che Multidict sono stati sviluppati nell\'ambito del progetto {POOLS-T} finanziato dall\'UE (2008-2010) e il loro sviluppo sta proseguendo nell\'ambito del presente progetto COOL.','pizzoccheriale',1578669463,'pizzoccheriale',1578669523),(596,'pt','O Clilstore usa {Wordlink}, um recurso baseado em WWW que vincula páginas da web arbitrárias automaticamente, palavra por palavra, com dicionários online. E o Wordlink, por sua vez, usa {Multidict}, um recurso de pesquisa de múltiplos dicionários que faz uso de dicionários online disponíveis gratuitamente. Tanto o Wordlink quanto o Multidict foram desenvolvidos como parte do projeto europeu {POOLS-T} (2008-2010) e seu desenvolvimento continua como parte do presente projeto COOL.','etimalta',1600426574,'etimalta',1600426574),(596,'sh','Clilstore koristi {Wordlink}, strukturu basiranu na WWW sto automacki povezuje proizvoljne  Web stranice, rec po rec sa recnicima online. Sa svoje strane Wordlink koristi {Multidict}, sa funkcijom trazenja vise recnika sto koriste dostupne recnike online gratis. I Wordlink i Multidict su razvijeni u okviru projekta {POOLS-T} finansiranog od UE (2008-2010) i njihovo razvijanje je nastavljeno u okviru projekta COOL.','giuseppelic',1582799750,'giuseppelic',1582800275),(597,'br','Bez e vimp kontant-tre o resevout evezhiadennoù pe kinnigadennoù war an aozadur-mañ - Kasit anezho ken eeun ha tra da {caoimhin@smo.uhi.ac.uk} e (n\'eus forzh peseurt yezh). M\'ho peus kinnigadennoù evel da skouer geriadurioù all en ho soñj hag a c\'hallfe bezañ ouzhpennet da Multidict, kontant-tre e vimp da goñsideriñ anezho.','Pêr',1579609120,'Pêr',1579693556),(597,'da','Vi ville virkelig være meget glade for at modtage kommentarer eller forslag til denne facilitet - bare send sådanne via e-mail (på ethvert sprog) til {caoimhin@smo.uhi.ac.uk}. Hvis du har forslag til andre online ordbøger, som du mener ville være værd at tilføje til Multidict, ville vi være meget glade for at overveje dem.','fred',1578310188,'fred',1578310188),(597,'en','We would be very glad indeed to receive comments or suggestions on this facility - Simply send them by e-mail (in any language) to {caoimhin@smo.uhi.ac.uk}. If you have suggestions as to other online dictionaries which you think would be worth adding to Multidict, we would be very happy to consider them.','caoimhinsmo',1578264553,'caoimhinsmo',1578264579),(597,'es','De hecho, nos complacería mucho recibir comentarios o sugerencias sobre estas herramientas. Simplemente envíenlas por correo electrónico (en cualquier idioma) a {caoimhin@smo.uhi.ac.uk}. Si crees que debiéramos incluir algún otro diccionario en Multidict, por favor, dínoslo.','sodisar',1578740953,'agimeno',1578863223),(597,'fr','Nous serions très heureux de recevoir des commentaires ou des suggestions sur cette installation  - Envoyez-les simplement par e-mail (dans n\'importe quelle langue) à {caoimhin@smo.uhi.ac.uk}. Si vous avez des suggestions concernant d\'autres dictionnaires en ligne qui, selon vous, mériteraient d\'être ajoutés à Multidict, nous serions très heureux de les prendre en considération.','Pêr',1579613162,'Pêr',1579613265),(597,'ga','Bheimis an-sásta go deimhin moltaí a fháil ar an tsaoráid seo - níl le déanamh ach iad a chur trí ríomhphost (in aon teanga) chuig {caoimhin@smo.uhi.ac.uk}. Má tá moltaí agat maidir le foclóirí eile a shíleann tú gurbh fhiú iad a chur le Multidict, bheimis sásta breathnú orthu.\n','CÓD',1579901569,'CÓD',1579901866),(597,'gd','Bhitheamaid air leth toilichte molaidhean agus beachdan fhaighinn a thaobh a’ ghoireas Eadarlìn a tha seo - Cuir sa phost-d iad (ann an cànan sam bith) gu {caoimhin@smo.uhi.ac.uk}. Agus ma tha molaidhean agad a thaobh faclairean air-loidhne eile a b’fhiach feuchainn ri’n cur ri Multidict, bhitheamaid toilichte sùil a chur orra.','caoimhinsmo',1578264856,'caoimhinsmo',1578265843),(597,'it','Ci farebbe davvero molto piacere ricevere commenti o suggerimenti riguardo a questo strumento-Potete inviarli via e-mail (in qualsiasi lingua) a {caoimhin@smo.uhi.ac.uk}. Se avete dei suggerimenti a proposito di altri dizionari online che ritenete valga la pena aggiungere al sistema, li prenderemo sicuramente in considerazione.','AlexT',1578833385,'AlexT',1578833385),(597,'pt','Ficaríamos muito contentes em receber comentários ou sugestões sobre este recurso - basta enviá-los por e-mail (em qualquer idioma) para {caoimhin@smo.uhi.ac.uk}. Se você tiver sugestões de outros dicionários online que você acha que valem a pena adicionar ao Multidict, ficaremos muito felizes em considerá-las.','etimalta',1600426562,'etimalta',1600426562),(597,'sh','Bilo bi nam veliko zadovoljstvo da primimo vase komentare ili predloge u vezi ovog istrumenta - Mozete ih poslati preko e-mail (na bilo kom jeziku) na {caoimhin@smo.uhi.ac.uk}. Ako imate predloge u vezi drugih recnika online sto mislite da vedi dodati sistemu, sigurno cemo ih razmotriti.','giuseppelic',1582800446,'giuseppelic',1582800588),(598,'br','\"COOL\" a zo ur raktres azasaet d\'ar mediaoù sokial, ha pedet emaoc\'h da gas evezhiadennoù ha da reiñ ho menno dre {Facebook}, {Linkedin}, {Twitter}, hag ivez {Wordpress}. Gellout a rit gwelet hon {albomioù skeudennoù} war Facebook.','Pêr',1579608869,'Pêr',1579693585),(598,'da','COOL er et medievenligt projekt, og du opfordres til at komme med forslag og give feedback via {mail eller Facebook}','fred',1578310268,'fred',1578310268),(598,'en','COOL is a social media friendly project, and you are warmly invited to make suggestions and give feedback via {Facebook}, {Linkedin}, {Twitter}, and {Wordpress}. You can see our {photo albums} on Facebook.','caoimhinsmo',1578266402,'caoimhinsmo',1578267615),(598,'es','COOL es un proyecto con visibilidad en varias redes sociales. Te invitamos a que nos sigas y a hacer comentarios o sugerencias de mejora a través de {Facebook}, {Linkedin}, {Twitter} o {Wordpress}. Puedes ver nuestro {photo albums} en Facebook.','sodisar',1578741104,'agimeno',1578863449),(598,'fr','« COOL » est un projet adapté aux médias sociaux, et vous êtes chaleureusement invité à faire des suggestions et à donner votre avis via {Facebook}, {Linkedin}, {Twitter} et {Wordpress}. Vous pouvez voir nos {albums photos} sur Facebook.','Pêr',1579613103,'Pêr',1579693597),(598,'ga','Fáiltíonn COOL roimh na meáin shoisialta, bheimis an-sásta glacadh le moltaí agus aiseolas trí {Facebook}, {Linkedin}, {Twitter}, agus {Wordpress}. Is féidir leat breathnú ar ár n-{albaim grianghraf} ar Facebook.','CÓD',1579894891,'CÓD',1579895316),(598,'gd','Tha am pròiseact COOL measail air na meadhanan soisealta. Faodaidh tu do bheachdan a chur thugainn air {Facebook}, {Linkedin}, {Twitter}, agus {Wordpress}. Chì thu ar cruinneachaidhean de {photo albums} air Facebook.','caoimhinsmo',1578266539,'caoimhinsmo',1578268824),(598,'it','COOL è un progetto che prevede anche il collegamento ai social media, e siete caldamente invitati a dare suggerimenti o feedback tramite {Facebook}, {Linkedin}, {Twitter}, e {Wordpress}. Potete vedere il nostro {album di foto} su Facebook.','AlexT',1578833488,'AlexT',1578833544),(598,'pt','COOL é um projeto amigável de mídia social, e você está calorosamente convidado a fazer sugestões e fornecer feedback via {Facebook}, {Linkedin}, {Twitter} e {Wordpress}. Você pode ver nossos {álbuns de fotos} no Facebook.','etimalta',1600426537,'etimalta',1600426537),(598,'sh','COOL je projekat sto predvidja povezivanje sa drustvenim mrezama, mi vas srcano pozivamo da nam date vase predloge ili feedback preko {Facebook}, {Linkedin}, {Twitter}, i {Wordpress}. Mozete pogledati nas {foto album} na Facebook.','giuseppelic',1582800624,'giuseppelic',1582800836),(600,'br','Bro-Danmark','Pêr',1579605402,'Pêr',1579605402),(600,'da','Danmark','fred',1578310343,'fred',1578310343),(600,'en','Denmark','caoimhinsmo',1578262251,'caoimhinsmo',1578262251),(600,'es','Dinamarca','agimeno',1578617095,'agimeno',1578617095),(600,'fr','Danemark','Pêr',1579613045,'Pêr',1579613045),(600,'ga','An Danmhairg','CÓD',1578948889,'CÓD',1578948889),(600,'gd','Danmhairg','caoimhinsmo',1578262260,'caoimhinsmo',1578262260),(600,'it','Danimarca','pizzoccheriale',1578590524,'pizzoccheriale',1578590524),(600,'pt','Dinamarca','etimalta',1600425334,'etimalta',1600425334),(600,'sh','Danska','giuseppelic',1581936524,'giuseppelic',1581936524),(601,'br','Bro-Iwerzhon','Pêr',1579605433,'Pêr',1579605433),(601,'da','Irland','fred',1578310350,'fred',1578310350),(601,'en','Ireland','caoimhinsmo',1578262650,'caoimhinsmo',1578262650),(601,'es','Irlanda','agimeno',1578617173,'agimeno',1578617173),(601,'fr','Irlande','Pêr',1579613020,'Pêr',1579613020),(601,'ga','Éire','CÓD',1578949635,'CÓD',1578949635),(601,'gd','Éirinn','caoimhinsmo',1578262656,'caoimhinsmo',1578262656),(601,'it','Irlanda','pizzoccheriale',1578590572,'pizzoccheriale',1578590572),(601,'pt','Irlanda','etimalta',1600425384,'etimalta',1600425384),(601,'sh','Irska','giuseppelic',1581937611,'giuseppelic',1581937611),(602,'br','Bro-Lituania','Pêr',1579605454,'Pêr',1579605454),(602,'da','Litauen','fred',1578310364,'fred',1578310364),(602,'en','Lithuania','caoimhinsmo',1578262690,'caoimhinsmo',1578262690),(602,'es','Lituania','agimeno',1578617200