606653,'Pêr',1579688345),(629,'da','Bemærkning til ejerne/udgiverne af online ordbøger','fred',1578480740,'fred',1578480740),(629,'en','A note for dictionary owners','caoimhinsmo',1578438507,'caoimhinsmo',1578438507),(629,'es','Nota para propietarios de diccionarios','agimeno',1578616186,'agimeno',1578616186),(629,'fr','Une note pour les propriétaires de dictionnaire','Pêr',1579617142,'Pêr',1579617142),(629,'ga','Nóta d\'úinéirí foclóirí.','CÓD',1579294386,'CÓD',1579294386),(629,'gd','Fios do dh’urraidhean nam faclairean air-loidhne','caoimhinsmo',1578438932,'caoimhinsmo',1578438932),(629,'it','Avviso ai possessori del dizionario','AlexT',1578833324,'AlexT',1578833349),(629,'pt','Uma nota para proprietários de dicionário','etimalta',1601551508,'etimalta',1601551508),(629,'sh','Obavestenje vlasnicima recnika ','giuseppelic',1582727116,'giuseppelic',1582727116),(630,'br','{Multidict} a zo un etrefas evit gellout kas da benn enklaskoù e-barzh meur a c\'heriadur. Diorroet eo bet gant {Caoimhín Ó Donnaíle} e {Sabhal Mòr Ostaig} evit gellout labourat gant {Wordlink} (hag a-fet istor gant Kent Andersen’s TextBlender), evel bezañ ul lodenn eus ar raktresoù arc\'hantaouet gant ar font European {POOLS-T} (etre 2008-2010). Dalc\'het en deus da vont war-raok an diorren evel ul lodenn eus ar raktres arc\'hantaouet gant ar font European {TOOLS} (etre 2012-2014). Kenderc\'hel a ra da vezañ diorroet evel bezañ ul lodenn eus ar raktresoù arc\'hantaouet gant ar font European {COOL} (etre 2018-2021).','Pêr',1579610083,'Pêr',1579687837),(630,'da','{Multidict} er en opslagsfacilitet til flere ordbøger. Det blev udviklet af {Caoimhín Ó Donnaíle} i {Sabhal Mòr Ostaig} for at arbejde sammen med {Wordlink} (og historisk med Kent Andersens TextBlender), som en del af Den Europæiske Unions finansierede {POOLS-T} -projekt (2008-2010) . Udviklingen fortsatte som en del af EU-finansieret {TOOLS} -projekt (2012-2014). Det udvikles nu yderligere som en del af EU-finansieret {COOL} -projekt (2018-2021).','fred',1578480605,'fred',1578480605),(630,'en','{Multidict} is a multiple dictionary lookup facility. It was developed by {Caoimhín Ó Donnaíle} at {Sabhal Mòr Ostaig} to work in conjuction with {Wordlink} (and historically with Kent Andersen’s TextBlender), as part of the European Union funded {POOLS-T} project (2008-2010). Development continued as part of the European Union funded {TOOLS} project (2012-2014). It is now being further developed as part of the European Union funded {COOL} project (2018-2021).','caoimhinsmo',1578439607,'caoimhinsmo',1578439792),(630,'es','{Multidict} es una interfaz de búsqueda de palabras en múltiples diccionarios. Fue originalmente creado por {Caoimhín Ó Donnaíle} de {Sabhal Mòr Ostaig} para funcionar en conjunción con {Wordlink} (e inicialmente con TextBlender, diseñado por Kent Andersen), dentro del proyecto {POOLS-T} (2008-2010). Su desarrollo continuó a través del proyecto {TOOLS} (2012-2014). Ahora se sigue desarrollando y mejorando gracias al proyecto {COOL} (2018-2021). Todos estos proyectos han sido cofinanciados por la Comisión Europea.','agimeno',1578614924,'agimeno',1578614924),(630,'fr','{Multidict} est une fonction de recherche dans plusieurs dictionnaires. Il a été développé par {Caoimhín Ó Donnaíle} à {Sabhal Mòr Ostaig} pour fonctionner en conjonction avec {Wordlink} (et historiquement avec Kent Andersen\'s TextBlender), dans le cadre du projet {POOLS-T} financé par l\'Union européenne (2008-2010) . Le développement s\'est poursuivi dans le cadre du projet {TOOLS} financé par l\'Union européenne (2012-2014). Il est en cours de développement dans le cadre du projet {COOL} financé par l\'Union européenne (2018-2021).','Pêr',1579617253,'Pêr',1579617253),(630,'ga','Is saoráid í Multidict a cheadaíonn flúirse foclóirí ag an aon am amháin. D\'fhorbair {Caoimhín Ó Donnaíle} ag {Sabhal Mòr Ostaig} é le hoibriú i gcomhair le {Wordlink} (agus roimhe seo le TextBlender bogearra a d\'fhorbair Kent Andersen) mar chuid den tionscadal {POOLS-T} (2008-2010) a mhaoinigh an Coimisiún Eorpach. Lean an obair forbartha ar aghaidh mar chuid den tionscadal Eorpach {TOOLS} (2012-2014), agus tá tuilleadh forbartha a dhéanamh air anois mar chuid den tionscadal {COOL}(2018-2022),atá á chómhaoiniú ag an Choimisiún Eorpach. ','CÓD',1579290775,'CÓD',1579292108),(630,'gd','’S e goireas a tha ann an {Multidict} a tha ga fhàgail furasta facal a shireadh ann an iomadh faclair air-loidhne.  Chaidh a chruthachadh le {Caoimhín Ó Donnaíle} aig {Sabhal Mòr Ostaig} airson a bhith ag obair còmhla ri {Wordlink} (agus gu h-eachdraidheil leis an TextBlender aig Kent Andersen), mar phàirt den phròiseact Eòrpach {POOLS-T} (2008-2010). Chaidh a leasachadh mar phàirt den phròiseact Eòrpach {TOOLS} (2012-2014). Tha an obair leasachaidh a’ leantainn oirre mar phàirt den phròiseact Eòrpach {COOL} (2018-2021).','caoimhinsmo',1578441311,'caoimhinsmo',1578441579),(630,'it','{Multidict} è un sistema di ricerca su più dizionari online. E\' stato sviluppato da {Caoimhín Ó Donnaíle} a {Sabhal Mòr Ostaig} per funzionare in combinazione con {Wordlink} (e storicamente con il TextBlender di Kent Andersen), quale parte del progetto finanziato dall\'Unione Europea {POOLS-T} del (2008-2010). Lo sviluppo è proseguito inserito nel progetto finanziato dall\'Unione Europea {TOOLS}del (2012-2014). Al momento è ulteriormente sviluppato nell\'ambito del progetto finanziato dall\'Unione Europea {COOL} del (2018-2021).','AlexT',1578833681,'AlexT',1578834040),(630,'pt','{Multidict} é um recurso de pesquisa de múltiplos dicionários. Foi desenvolvido por {Caoimhín Ó Donnaíle} em {Sabhal Mòr Ostaig} para trabalhar em conjunto com {Wordlink} (e historicamente com TextBlender de Kent Andersen), como parte do projeto {POOLS-T} financiado pela União Europeia (2008-2010) . O desenvolvimento continuou como parte do projeto {TOOLS} financiado pela União Europeia (2012-2014). Agora está sendo desenvolvido como parte do projeto {COOL} financiado pela União Europeia (2018-2021).','etimalta',1601551452,'etimalta',1601551452),(630,'sh','{Multidict} je jedan deo sistema trazenja na vise recnika online. Kreirali su ga {Caoimhín Ó Donnaíle} i {Sabhal Mòr Ostaig} da bi radio u kombinaciji sa  {Wordlink} (i povjesno sa TextBlender di Kent Andersen), kao deo projekta finansiranog od Evropske Unije {POOLS-T} iz (2012-2014). Trenutno je detaljnije razvijen u okviru projekta finansiranog  od Evropske Unije {COOL} od (2018-2021).','giuseppelic',1582725488,'giuseppelic',1582725853),(631,'br','Multidict a ro tu d\'an implijader da ziuzañ en un doare aes e-touesk un dibab geriadurioù enlinenn. Enderc\'hel a ra un diazez-roadennoù ledan a c\'heriadurioù gant titouroù diwar-benn ar yezhoù a vez degemeret ganto hag an arventennoù rekiset ganto. Multidict a glask mirout en e soñj peseurt geriadur a zo bet dibabet a-ziagent gant an implijader evit gellet fonnusaat an diuzañ da-heul. Multidict a enkorf en ennañ ivez ur mod aes evit gellout liammañ er stumm bajenn-skeudenn e dielloù ar Web (Web Archive), levrioù Google (Google Books), hag all hag all, dre un indeks eus ar ger-pennañ war gement pajenn.','Pêr',1579607184,'Pêr',1579688201),(631,'da','Multidict giver brugeren mulighed for let at vælge fra et valg af online ordbøger. Indbygget i det er en stor database med ordbøger med information om de sprog, de leverer til, og de parametre, de har brug for. Multidict forsøger at huske brugerens tidligere ordbogvalg for at fremskynde efterfølgende valg. Multidict inkluderer også en mulighed for at linke til ordbøger i sidebilledformat på Webarkivet, Google Bøger osv. Via et indeks over det indledende ord på hver side.','fred',1578480647,'fred',1578480647),(631,'en','Multidict allows the user to select easily from a choice of online dictionaries. Built into it is a large database of dictionaries with information on the languages they cater for and the parameters they require. Multidict attempts to remember the user’s previous dictionary choices so as to speed up subsequent selection. Multidict also includes a facility to link to dictionaries in page-image format at the Web Archive, Google Books, etc, via an index of the initial word on each page.','caoimhinsmo',1578440613,'caoimhinsmo',1578440613),(631,'es','Con Multidict se puede cambiar de un diccionario a otro con toda facilidad. Se compone de una base de datos de diccionarios en línea con información sobre los idiomas que incluyen y los parámetros que requieren para funcionar. Multidict mantiene en su memoria el último diccionario utilizado por un usuario para agilizar las búsquedas. También incluye una utilidad para enlazar a diccionarios que utilizan páginas-imagen como en el Web Archive, Google Books, etc., por medio de un índice de la palabra inicial de cada página.','agimeno',1578615035,'agimeno',1578615729),(631,'fr','Multidict permet à l\'utilisateur de sélectionner facilement parmi un choix de dictionnaires en ligne. Il contient une grande base de données de dictionnaires avec des informations sur les langues qu\'ils couvrent et les paramètres dont ils ont besoin. Multidict tente de se souvenir des choix de dictionnaire précédents de l\'utilisateur afin d\'accélérer la sélection suivante. Multidict comprend également une fonction de lien vers des dictionnaires au format image de page dans les archives Web, Google Books, etc., via un index du mot initial sur chaque page.','Pêr',1579617225,'Pêr',1579617225),(631,'ga','Ligeann Multidict don úsáideoir roghnú go furasta idir sraith d\'fhoclóirí ar líne. Mar chuid lárnach de, tá bunachar mór d\'fhoclóirí le heolas faoi na teangacha ar a fhreastalaíonn sé agus na paraiméadair a theastaíonn uathu. Déanann Multidict iarracht cuimhneamh ar na roghanna foclóra a rinne an t-úsáideoir roimhe chun roghanna ina dhiaidh sin a bhrostú. Tá saoráid ag Multidict fosta chun nascadh le foclóirí sa Web Archive nó ag Google Books ina bhfuil íomhánna de na leathanaigh, trí innéacs den chéad fhocal ar gach leathanach.','CÓD',1579292709,'CÓD',1579293470),(631,'gd','Tha Multidict a’ leigeil dhan neach-cleachdaidh taghadh agus ath-thaghadh a dhèanamh gu furasta bho raon de dh’fhaclairean air-loidhne.  ’Na bhroinn tha stòr-dàta mór de dh’fhaclairean, stòras de dh’fhiosrachadh air na cànanan ris a bheil iad a’ déiligeadh agus na paramadairean rannsachaidh air a bheil iad feumach.  Tha Multidict a’ feuchainn ri na cànanan agus faclairean a chleachd thu roimhe a chuimhneachadh gus am bi an taghadh ag obair nas luaithe an ath-thuras.  Tha Multidict cuideachd comasach air iomadh seann-fhaclair a chleachdadh a th’aig a’ Web Archive, Google Books, 7c mar ìomhaighean de na duilleagan, tro chlàr-amais a th’aige den fhacal tòiseachaidh air gach duilleig.','caoimhinsmo',1578442160,'caoimhinsmo',1578604380),(631,'it','Multidict permette all\'utente di selezionare facilmente un dizionario da una scelta di vocabolari online. Contiene un ampio database di dizionari e informazioni sulle relative lingue e sui parametri richiesti. Multidict può memorizzare le parole selezionate dall\'utente in modo da velocizzare le ricerche successive. Multidict include anche una funzione che permette di collegarsi a dizionari in formato di immagine sull\'archivio Web, Google Books, ecc, tramite l\'indice delle parole iniziali su ciascuna pagina. ','AlexT',1578585951,'AlexT',1578586764),(631,'pt','Multidict permite que o usuário selecione facilmente a partir de uma escolha de dicionários online. Integrado a ele está um grande banco de dados de dicionários com informações sobre os idiomas que atendem e os parâmetros de que necessitam. Multidict tenta lembrar as escolhas anteriores do dicionário do usuário para acelerar a seleção subsequente. Multidict também inclui um recurso de link para dicionários em formato de imagem de página no Web Archive, Google Books, etc., por meio de um índice da palavra inicial em cada página.','etimalta',1601551466,'etimalta',1601551466),(631,'sh','Multidikt dopusta korisniku da lako izabere jedan recnik iz ponudjenih recnika online. Sadrzi jednu opsirnu banku podataka recnika i informacija o jezicima i trazenim parametrima, Multidict moze da zapamti izabrane reci korisnika tako da ubrza sledece trazenje. Multidict sadrzi i jednu funkciju pomocu koje se povezuje sa recnicima u formatu slika na arhiv Web, Google Books, itd. pomocu indeksa pocenih reci na svakoj stranici.','giuseppelic',1582726030,'giuseppelic',1582726569),(632,'br','Laouen-kenañ e vimp o resevout evezhiadennoù pe kinnigadennoù war an aozadur-mañ - Kasit anezho ken eeun ha tra dre bostel (e n\'eus forzh peseurt yezh) da {caoimhinsmo.uhi.ac.uk}. M\'ho peus kinnigadennoù war ar sujed a c\'heriadurioù all enlinenn hag a c\'hallfe bezañ ouzhpennet d\'ar sistem hervezoc\'h, bez e vimp kontant-tre da gemer anezho e kont.','Pêr',1579619488,'Pêr',1579688280),(632,'da','Vi ville virkelig være meget glade for at modtage kommentarer eller forslag til denne facilitet - bare send dem via e-mail (på ethvert sprog) til {caoimhin@smo.uhi.ac.uk}. Hvis du har forslag til andre online ordbøger, som du mener ville være værd at tilføje til systemet, ville vi være meget glade for at overveje dem.','fred',1578480683,'fred',1578480683),(632,'en','We would be very glad indeed to receive comments or suggestions on this facility - Simply send them by e-mail (in any language) to {caoimhin@smo.uhi.ac.uk}. If you have suggestions as to other online dictionaries which you think would be worth adding to the system, we would be very happy to consider them.','caoimhinsmo',1578440680,'caoimhinsmo',1578440696),(632,'es','Nos encantaría recibir vuestros comentarios o sugerencias de mejora. Simplemente escríbenos (en cualquier idioma) a {caoimhin@smo.uhi.ac.uk}. Si hay algún diccionario que te gustaría que incluyéramos, dínoslo también.','agimeno',1578615861,'agimeno',1578615979),(632,'fr','Nous serions très heureux de recevoir des commentaires ou des suggestions sur cette installation - Envoyez-les simplement par e-mail (dans n\'importe quelle langue) à {caoimhinsmo.uhi.ac.uk}. Si vous avez des suggestions concernant d\'autres dictionnaires en ligne qui, selon vous, mériteraient d\'être ajoutés au système, nous serions très heureux de les considérer.','Pêr',1579617190,'Pêr',1579617190),(632,'ga','Fáiltímid roimh thuairimí nó mholtaí ar an tsaoráid seo - cuir ríomhphost i dteanga ar bith chuig {caoimhin@smo.uhi.ac.uk}. Má tá moltaí agat maidir le foclóirí ar line eile a shíleann tú a chuirfeadh leis an chóras, bheimis sásta breathnú orthu.','CÓD',1579293534,'CÓD',1579293534),(632,'gd','Bhiothamaid air leth toilichte beachdan fhaighinn air a’ ghoireas seo.  Cuir sa phost-dealain iad, ann an cànan sam bith, gu {caoimhin@smo.uhi.ac.uk}.  Agus ma tha molaidhean agad a thaobh faclairean eile a bu toigh leat fhaicinn ceangailte ris an t-siostam, bhiothamaid gu math toilichte sùil a chur orra.','caoimhinsmo',1578442632,'caoimhinsmo',1578442782),(632,'it','Ci farebbe davvero molto piacere ricevere commenti o suggerimenti riguardo a questo strumento-Potete inviarli via e-mail (in qualsiasi lingua) a {caoimhin@smo.uhi.ac.uk}. Se avete dei suggerimenti a proposito di altri dizionari online che ritenete valga la pena aggiungere al sistema, li prenderemo sicuramente in considerazione.','AlexT',1578833134,'AlexT',1578833269),(632,'pt','Ficaríamos muito contentes em receber comentários ou sugestões sobre este recurso - basta enviá-los por e-mail (em qualquer idioma) para {caoimhin@smo.uhi.ac.uk}. Se você tiver sugestões de outros dicionários online que julgue valerem a pena adicionar ao sistema, ficaríamos muito felizes em considerá-las.','etimalta',1601551476,'etimalta',1601551476),(632,'sh','Bilo bi nam svakao mnogo zadovoljstvo da primimo komentare ili predloge u vezi ovog istrumenta - Mozete ih poslati elektronskom postom (na bilo kom jeziku) na {caoimhin@smo.uhi.ac.uk}. Ako imate preporuke u vezi drugih recnika online sto mislite da treba dodati sistemu, svakako cemo razmotriti vas predlog. ','giuseppelic',1582726692,'giuseppelic',1582726949),(633,'br','Degemer Multidict','Pêr',1579600242,'Pêr',1579600280),(633,'da','Multidict hjemside','fred',1578519276,'fred',1578519276),(633,'en','Multidict home page','caoimhinsmo',1578488225,'caoimhinsmo',1578494268),(633,'es','Página principal de Multidict','sodisar',1578656588,'sodisar',1578656588),(633,'fr','Page d\'accueil de Multidict','Pêr',1579616895,'Pêr',1579616895),(633,'ga','Leathanach baile Multidict','CÓD',1579298777,'CÓD',1579298777),(633,'gd','Prìomh-dhuilleag Multidict','caoimhinsmo',1578494280,'caoimhinsmo',1578494280),(633,'it','Multidict home page ','pizzoccheriale',1578669145,'pizzoccheriale',1578669145),(633,'pt','Página inicial Multidict','etimalta',1600425983,'etimalta',1600425983),(633,'sh','Multidict pocetna stranica ','giuseppelic',1582746499,'giuseppelic',1582746499),(634,'br','Plijet e voc\'h emichañs gant Multidict. Ne \"vrasnij\" ha ne gemm e mod ebet ho pajennadoù, en liammañ a ra outo setu ma raio muioc\'h a dremenerezh davet ho keriadur.','Pêr',1579619471,'Pêr',1579687450),(634,'da','Vi håber, du vil kunne lide Multidict. Multidict \"skimmer\" ikke, eller på nogen måde ændrer dine sider, men linker blot til dem og genererer trafik til din ordbog.','fred',1578557723,'fred',1578557723),(634,'en','We hope you will like Multidict. It does not “skim” or alter your pages in any way, but links to them and will drive traffic to your dictionary.','caoimhinsmo',1578502593,'caoimhinsmo',1578502593),(634,'es','Esperamos que le guste Multidict. No se modifican de ningún modo las páginas web sino que únicamente se enlazan las palabras al diccionario que se seleccione.','agimeno',1578613094,'agimeno',1578861796),(634,'fr','Nous espérons que vous aimerez Multidict. Il ne « survole » ni ne modifie en aucune façon vos pages, mais les relie à celles-ci et générera du trafic vers votre dictionnaire.','Pêr',1579617322,'Pêr',1579687471),(634,'ga','Tá súil againn go dtaitneoidh Multidict leat. Ní dhéanann sé scimeáil ar do leathanaigh agus ní athraíonn sé iad ar aon bhealach, ach nascann sé leo agus tiomáinfidh sé trácht chuig d\'fhoclóir.','CÓD',1579283685,'CÓD',1579283685),(634,'gd','Tha sinn an dòchas gum bi Multidict a’ còrdadh ruibh. Chan eil Multidict ag ‘skim-adh’ no ag atharrachadh ur duilleagan ann an dòigh sam bith. Tha e a’ dèanamh ceangal a-null thuca, agus cuiridh e barrachd luchd-cleachdaidh dhan fhaclair agaibh.','caoimhinsmo',1578503739,'agimeno',1578612852),(634,'it','Speriamo che apprezzerai Multidict. Non modifica o altera in nessun modo le tue pagine, ma si connette ad esse e collega le parole al dizionario.','AlexT',1578575388,'AlexT',1578575520),(634,'pt','Esperamos que goste do Multidict. Ele não “desliza” ou altera suas páginas de nenhuma forma, mas vincula a elas e direciona o tráfego para o seu dicionário.','etimalta',1601551408,'etimalta',1601551408),(634,'sh','Nadamo se da ce vam se svideti Multidict, Ne menja i ne preuredjuje nikako vase stranice,  nego se povezuje sa njima da bi povezao reci sa recnikom.','giuseppelic',1582724834,'giuseppelic',1582724834),(635,'br','Ma neket liammet Multidict d\'ho keriadur hag e fellfe deoc\'h e vefe enkorfet ganeomp, kasit deomp ur postel da (caoimhin@smo.uhi.ac.uk) hag e vo taolet ur sell ouzh ar pezh ho peus da ginnig. Geriadurioù \'zo a vez aesoc\'h da liammañ evit na vez geriadurioù all. Geriadurioù \'zo az a gwelloc\'h en-dro gant Wordlink evit na ra lod all - peurvuiañ ar re hag a vez epuret hag a c\'hall diskwel o disoc\'hoù en ur prenestr treut az a muioc\'h en-dro.','Pêr',1579619477,'Pêr',1579687517),(635,'da','Hvis Multidict ikke i øjeblikket linker til din ordbog, og du gerne vil have os til at forsøge at inkludere den, så send os en e-mail (caoimhin@smo.uhi.ac.uk), så ser vi på det. Nogle ordbøger er meget lettere at linke til end andre. Nogle ordbøger fungerer også meget bedre med Wordlink end andre.','fred',1578557794,'fred',1578557794),(635,'en','If Multidict  does not currently link to your dictionary, and you would like us to try to include it, send us an e-mail (caoimhin@smo.uhi.ac.uk) and we will have a look. Some dictionaries are much easier to link to than others. Some dictionaries too, work much better with Wordlink than others - generally those which are uncluttered and will display their results easily within a narrow window.','caoimhinsmo',1578502699,'fred',1578557732),(635,'es','Si no hemos incluido un enlace a su diccionario en Multidict y le gustaría que lo incluyéramos, escríbanos a caoimhin@smo.uhi.ac.uk e intentaremos enlazarlo. Es más fácil incluir algunos diccionarios que otros. Del mismo modo, algunos diccionarios funcionan mejor que otros en Wordlink. Los que mejor funcionan son, por regla general, los que muestran las entradas en páginas despejadas que se pueden abrir en una ventana estrecha.','agimeno',1578613483,'agimeno',1578614101),(635,'fr','Si Multidict ne fait actuellement pas de lien avec votre dictionnaire et que vous souhaitez que nous essayions de l\'inclure, envoyez-nous un e-mail (caoimhin@smo.uhi.ac.uk) et nous y jetterons un œil. Certains dictionnaires sont plus faciles à lier que d\'autres. Certains dictionnaires fonctionnent également mieux avec Wordlink que d\'autres - généralement ceux qui sont épurés et afficheront facilement leurs résultats dans une fenêtre étroite.','Pêr',1579617306,'Pêr',1579620139),(635,'ga','Mura nascann Multidict le d\'fhoclóir faoi láthair agus gur mhaith leat go gcuirfimis san áireamh é, cuir ríomhphost chugainn (caoimhin@smo.uhi.ac.uk) agus amharcfaimid air. Tá foclóirí áirithe ann a bhfuil sé níos fusa nascadh leo i gcomparáid le cinn eile. Tá foclóirí áirithe ann a oibríonn i bhfad níos fearr le Wordlink ná cinn eile, go hiondúil iad siúd atá slachtmhar agus a tháispeánann a dtorthaí go simplí laistigh d\'fhuinneog chúng.','CÓD',1579285344,'CÓD',1579288920),(635,'gd','Ma ’s e ’s gu bheil faclair agaibh nach eil Multidict a’ ceangal ris fhathast agus nam bu toigh leibh gum biodh, cuiribh post-d thugainn (caoimhin@smo.uhi.ac.uk) agus bheir sinn sùil air a dh’fhaicinn an gabh sin a dhèanamh.  Tha cuid de dh’fhaclairean fada nas fhasa ceangal a dhèanamh riutha na tha cuid eile.  Agus tha cuid de dh’fhaclairean ag obair fada nas fhearr le Wordlink - mar as trice an fheadhainn aig nach eil cus buairis air an duilleig agus a ghabhas an taisbeanadh ann an uinneig chumhaing.','caoimhinsmo',1578504310,'caoimhinsmo',1578506478),(635,'it','Se Multidict non si collega al tuo dizionario, e desideri invece che il dizionario venga incluso, scrivi una mail a (caoimhin@smo.uhi.ac.uk) e daremo un\'occhiata. Alcuni dizionari sono più facilmente collegabili di altri. Alcuni dizionari funzionano meglio su Multidict di altri-di solito sono quelli più lineari che mostrano i risultati  in modo chiaro in una finestra piccola.','AlexT',1578575610,'AlexT',1578576059),(635,'pt','Se o Multidict não tiver um link para o seu dicionário e você quiser que o incluamos, envie-nos um e-mail (caoimhin@smo.uhi.ac.uk) e nós daremos uma olhada. Alguns dicionários são muito mais fáceis de vincular do que outros. Alguns dicionários também funcionam muito melhor com o Wordlink do que outros - geralmente aqueles que são organizados e exibem seus resultados facilmente em uma janela estreita.','etimalta',1601551420,'etimalta',1601551420),(635,'sh','Ako Multidict se nije povezao sa vasim recnikom, i vi zelite da vas recnik bude ukljucen, posalji jedan mail na (caoimhin@smo.uhi.ac.uk) i mi cemo pogledati. Neki recnici se lakse povezuju sa drugima. Dok drugi recnici bolje rade na Multidict od ostalih -  obicno su oni sto su vise linearni i sto daju jasnije rezultate  u malim okvirima.','giuseppelic',1582724907,'giuseppelic',1582725262),(636,'br','M\'eo liammet ho keriadur da Multidict endeo hag e fellfe deoc\'h e vefe dilammet ganeomp evit abeg pe abeg, roit deomp da c\'houzout hag e vo graet eta.','Pêr',1579619482,'Pêr',1579619946),(636,'da','Hvis din ordbog i øjeblikket benyttes via Multidict, og du gerne vil have, at vi fjerner den, så giv os blot besked, og vi fjerner linket.','fred',1578557900,'fred',1578557900),(636,'en','If your dictionary is currently linked to by Multidict and you would like us to remove it for any reason, just let us know and we will do that. ','caoimhinsmo',1578502717,'caoimhinsmo',1578502717),(636,'es','Si Multidict incluye un enlace a su diccionario y, por alguna razón, prefiere que no esté, díganoslo y lo eliminaremos.','agimeno',1578614188,'agimeno',1578614188),(636,'fr','Si votre dictionnaire est actuellement lié à Multidict et que vous souhaitez que nous le supprimions pour une raison quelconque, faites-le nous savoir et nous le ferons.','Pêr',1579617267,'Pêr',1579617267),(636,'ga','Má tá d\'fhoclóir nasctha le Multidict faoi láthair agus gur mhaith leat go mbainfeadh muid é ar chúis ar bith, inis dúinn agus déanfaimid é.','CÓD',1579290191,'CÓD',1579290191),(636,'gd','Ma ’s e ’s gu bheil Multidict a’ ceangal ri ur faclair agus gum b’fhearr leibh air adhbhar sam bith nach biodh an ceangal sin ann, leig fios thugainn agus cuiridh sin às don cheangal.','caoimhinsmo',1578505741,'caoimhinsmo',1578506187),(636,'it','Se il tuo dizionario è al momento collegato a Multidict e desideri che venga rimosso per qualsiasi ragione, faccelo sapere e lo faremo.','AlexT',1578576223,'AlexT',1578576223),(636,'pt','Se o seu dicionário está atualmente vinculado ao Multidict e você deseja que o removamos por qualquer motivo, informe-nos e faremos isso.','etimalta',1601551433,'etimalta',1601551433),(636,'sh','Ako je tvoj recnik trenutno povezan sa Multidikt i zelis da bude sklonjen iz bilo kog razloga, javi nam i mi cemo ga skloniti.','giuseppelic',1582725368,'giuseppelic',1582725368),(638,'br','Klasket e vo ober gant Multidict gant ar furmioù-gerioù-mañ en troadur (pa adklikit)','Pêr',1579606106,'Pêr',1579606127),(638,'da','Multidict prøver med disse versioner af ordet (ved klik igen på ordet)','fred',1578645427,'fred',1578645427),(638,'en','