jenn gant an holl gerioù liammet d\'an enklask er geriadurioù.','Pêr',1579598434,'Pêr',1579684289),(658,'da','Kopier og indsæt en url (webadresse) i boksen ovenfor, angiv sproget, og klik på {{Process}} for at lave en visningskopi af siden hvor alle ord er knyttet til ordbogsopslag.','fred',1578827924,'fred',1578827924),(658,'en','Copy and paste a url into the box above, specify the language, and click {{Process}} to make a display copy of the page with all words linked to dictionary lookup.','caoimhinsmo',1578762015,'caoimhinsmo',1578762061),(658,'es','Copia y pega la URL de la página web en el recuadro de arriba, indica el idioma y, después, haz clic sobre el botón {{Process}} para generar una copia de pantalla de esa página web. El resultado es que todas las palabras aparecerán enlazadas a la selección de diccionarios que ofrecemos.\n','agimeno',1578855328,'agimeno',1578855644),(658,'fr','Copiez et collez une URL dans la case ci-dessus, spécifiez la langue et cliquez sur {{Process}} pour créer une copie d\'affichage de la page avec tous les mots liés à la recherche dans le dictionnaire.','Pêr',1579611397,'Pêr',1579611397),(658,'ga','Cóipeáil agus greamaigh url sa bosca thuas, sainigh an teanga, agus cliceáil {{Process}} chun leagan den leathanach a thaispeáint ina bhfuil gach focal nasctha le cuardaitheoir foclóirí','CÓD',1578951613,'CÓD',1578952329),(658,'gd','Cuir lethbhreac den URL sa bhogsa shuas, roghnaich an cànan, agus briog {{Process}} gus lethbhreac den duilleig a thaisbeanadh anns a bheil ceangail air gach facal a lorgas e sna faclairean air-loidhne.','caoimhinsmo',1578762420,'caoimhinsmo',1578762420),(658,'it','Copia e incolla l\'url nella stringa sopra, scegli la lingua, e clicca {{Process}} per visualizzare una copia della pagina con tutte le parole collegate al dizionario.','AlexT',1578830073,'AlexT',1578830180),(658,'pt','Copie e cole um url na caixa acima, especifique o idioma e clique em {{Processar}} para fazer uma cópia de exibição da página com todas as palavras vinculadas à pesquisa do dicionário.','etimalta',1601550286,'etimalta',1601550286),(658,'sh','Kopirajte i zalepite URL na niz iznad, izaberite jezik, i kliknite {{Process}} da bi ste videli jednu kopiju stranice sa svim recima koje su povezane sa recnikom  ','giuseppelic',1582644820,'giuseppelic',1582644820),(659,'br','Gwelit {{Help}} evit kaout muioc\'h a ditouroù.','Pêr',1579598533,'Pêr',1579598554),(659,'da','Se {{Help}} for mere information.','fred',1578827945,'caoimhinsmo',1619425968),(659,'en','See {{Help}} for more information.','caoimhinsmo',1578762028,'caoimhinsmo',1578762072),(659,'es','Haga clic sobre {{Help}} para obtener más información.','agimeno',1578855748,'agimeno',1578855748),(659,'fr','Voir {{Help}} pour plus d\'informations.','Pêr',1579611426,'caoimhinsmo',1619425985),(659,'ga','Féach {{Help}} le haghaidh tuilleadh eolais.','CÓD',1578952372,'CÓD',1578952372),(659,'gd','Faic {{Help}} airson barrachd fiosrachaidh.','caoimhinsmo',1578762165,'caoimhinsmo',1578762165),(659,'it','Vedi {{Help}} per ulteriori informazioni.','AlexT',1578830190,'AlexT',1578830252),(659,'pt','Consulte {{Help}}  para mais informações.','etimalta',1601550300,'caoimhinsmo',1619425998),(659,'sh','Vidite {{Help}} za dodatne informacije ','giuseppelic',1582644863,'giuseppelic',1582644905),(660,'br','Degemer Multidict','Pêr',1579600267,'Pêr',1579600274),(660,'da','Wordlink hjemside','caoimhinsmo',1578519276,'caoimhinsmo',1578774586),(660,'en','Multidict home page','caoimhinsmo',1578488225,'caoimhinsmo',1578494268),(660,'es','Página principal de Wordlink','caoimhinsmo',1578656588,'caoimhinsmo',1578774588),(660,'fr','Page d\'accueil de Multidict','Pêr',1579616882,'Pêr',1579616882),(660,'ga','Leathanach baile Multidict','CÓD',1579298795,'CÓD',1579298795),(660,'gd','Prìomh-dhuilleag Wordlink','caoimhinsmo',1578494280,'caoimhinsmo',1578774591),(660,'it','Wordlink home page ','caoimhinsmo',1578669145,'caoimhinsmo',1578774599),(660,'pt','Página inicial Multidict','etimalta',1600425997,'etimalta',1600425997),(660,'sh','Wordlink pocetna stranica ','giuseppelic',1582746621,'giuseppelic',1582746621),(661,'br','Implijout Wordlink','Pêr',1579599268,'Pêr',1579599268),(661,'da','Brug af Wordlink','fred',1578828431,'fred',1578828431),(661,'en','Using Wordlink','caoimhinsmo',1578777440,'caoimhinsmo',1578777440),(661,'es','Cómo funciona Wordlink','agimeno',1578856018,'agimeno',1578856018),(661,'fr','Utilisation de Wordlink','Pêr',1579612002,'Pêr',1579612002),(661,'ga','Conas Wordlink a úsáid','CÓD',1578955521,'CÓD',1578955521),(661,'gd','Ag obair le Wordlink','caoimhinsmo',1578777448,'caoimhinsmo',1578777448),(661,'it','Usare Wordlink','AlexT',1578831006,'AlexT',1578831053),(661,'pt','Usando Wordlink','etimalta',1601550537,'etimalta',1601550537),(661,'sh','Koristite Wordlink ','giuseppelic',1582647601,'giuseppelic',1582647601),(662,'br','Wordlink a liamm pajennoù web ger-ha-ger da geriadurioù enlinenn. E-barzh ar bajenn ger-liammet, ma teu war-wel ur ger gant un drekleur du pa dremenit warnañ, gellout a rit klikañ warnañ evit gellout mont da glask war e lerc\'h e-barzh ur geriadur - pe er fedoù, e-barzh un diuzadenn geriadurioù, dre ma labour Wordlink gant aozadurioù all, {Multidict}, ar pezh a ro an tu deoc\'h da wintañ en un doare aes etre ar geriadurioù disheñvel.','Pêr',1579599300,'Pêr',1579599640),(662,'da','Wordlink forbinder websider ord for ord til online ordbøger. Hvis der vises et ord med en sort baggrund på den linkede side, når du holder musen hen over det, kan du klikke på det for at slå det op i en ordbog - eller faktisk i et udvalg af ordbøger, fordi Wordlink fungerer sammen med en anden facilitet, {Multidict}, som giver dig mulighed for let at skifte mellem ordbøger.','fred',1578828463,'fred',1578828463),(662,'en','Wordlink links webpages word-by-word to online dictionaries. In the wordlinked page, if a word appears with a black background when you hover over it, then you can click on it to look it up in a dictionary - or in fact, in a selection of dictionaries, because Wordlink works in conjunction with another facility, {Multidict}, which enables you to switch easily between dictionaries.','caoimhinsmo',1578781026,'caoimhinsmo',1578781026),(662,'es','Wordlink enlaza cada una de las palabras de una página web a una selección de diccionarios en línea. Cuando se ha enlazado una página web a Wordlink, cada una de las palabras que se pueden buscar en los diccionarios aparecen con un recuadro negro cuando pasas por encima el cursor. La herramienta que permite cambiar de un diccionario a otro cuando se busca una palabra es {Multidict}.','agimeno',1578856523,'agimeno',1578856638),(662,'fr','Wordlink relie les pages Web mot à mot aux dictionnaires en ligne. Dans la page liée par un mot, si un mot apparaît sur fond noir lorsque vous le survolez, vous pouvez cliquer dessus pour le rechercher dans un dictionnaire - ou, en fait, dans une sélection de dictionnaires, car Wordlink fonctionne en conjonction avec un autre , {Multidict}, qui vous permet de basculer facilement entre les dictionnaires.','Pêr',1579612019,'Pêr',1579612019),(662,'ga','Nascann Wordlink leathanaigh idirlín focal ar fhocal le foclóirí ar líne. Ar leathanach a próiseáladh le Wordlink, má fheiceann tú cúlra dubh taobh thiar d\'fhocal nuair a chuireann tú an luch thairis ciallaíonn sin gur féidir leat é a chuardach i bhfoclóir - nó go deimhin i rogha foclóirí, mar oibríonn Wordlink i gcomhair le saoráid eile, {Multidict}, a ligeann duit malartú go furasta idir foclóirí.\n','CÓD',1578956191,'CÓD',1578956378),(662,'gd','Tha Wordlink a’ ceangal dhuilleagan WWW facal air an fhacal ri faclairean air-loidhne.  Ann an duilleag a chaidh a “wordlink-adh” (a ghiullachd le Wordlink), ma tha facal a’ nochdadh le cùl-raon dubh nuair a chuireas tu an luch thairis, tha sin a’ ciallachadh gum faod thu am facal a bhriogadh gus a lorg ann am faclair - no gu dearbh ann an iomadh faclair, oir tha Wordlink ag obair còmhla ri goireas eile, {Multidict}, a tha a’ leigeil dhut tionndadh gu furasta eadar faclairean eadar-dhealaichte.','caoimhinsmo',1578841831,'caoimhinsmo',1578850919),(662,'it','Wordlink collega le pagine web parola per parola ai dizionari online. Se, nella pagina collegata, una parola appare su sfondo nero spostando sopra il mouse, allora puoi cliccare sulla parola per cercarla nel dizionario-o più precisamente, in una selezione di dizionari, perché Wordlink funziona in combinazione con un altro strumento {Multidict}.','AlexT',1578831151,'caoimhinsmo',1578843373),(662,'pt','O Wordlink vincula páginas da web palavra por palavra a dicionários online. Na página com links de palavras, se uma palavra aparecer com um fundo preto quando você passa o mouse sobre ela, você pode clicar nela para procurá-la em um dicionário - ou, na verdade, em uma seleção de dicionários, porque o Wordlink funciona em conjunto com outro facilidade, {Multidict}, que permite alternar facilmente entre os dicionários.','etimalta',1601550556,'etimalta',1601550556),(662,'sh','Wordlink povezace stranice web rec po rec sa recnicima online. Ako na povezanoj stranici, jedna rec je prikazana na crnoj pozadini pomerajuci iznad mis,  mozete da pritisnete tu rec da biste je uneli u recnik ili u jedan izbor recnika, zato sto Wordlink radi u kombinaciji sa jos jednim instrumentom {Multidict}.','giuseppelic',1582647773,'giuseppelic',1582648013),(663,'br','E-barzh an doser ger-liammet, ar rak-liammoù a zo anezho a zalc\'ho da vont en-dro. Hag er fedoù e voc\'h kaset ganto d\'ur stumm ger-liammet eus ar bajenn liammet setu m\'ho po tro da dennañ gounit eus al liammoù ger-ha-ger davet geriadurioù e-barzh ur bajenn nevez ivez. Daoust da-se, ma n\'ho peus ket ezhomm eus ar rak-liammoù a zo anezho hag e karfec\'h bezañ gouest e-plas da welet an holl c\'herioù oc\'h enkorfañ ul liamm davet gerioù e-barzh ar geriadurioù enlinenn, kochit ken eeun ha tra ar voest {{Remove existing links}}.','Pêr',1579599660,'Pêr',1579684800),(663,'da','I det wordlinkede dokument fungerer forhenværende links stadig. Og faktisk fører de dig til en wordlinket version af den linkede side, så du også kan drage fordel af ord-for-ord-links til online ordbøger på den nye side. Hvis du dog ikke har brug for de allerede eksisterende links og foretrækker i stedet at være i stand til at slå alle ord op, herunder linkord i online ordbøger, skal du blot markere afkrydsningsfeltet {{Remove existing links}}.','fred',1578828506,'caoimhinsmo',1578845260),(663,'en','In the wordlinked document, pre-existing links will still work. And in fact they will take you to a wordlinked version of the linked page so that you have the benefit of word-by-word links to online dictionaries in the new page too. However, if you do not need the pre-existing links and would prefer instead to be able to look up all words including link words in the online dictionaries, simply tick the {{Remove existing links}} box.','caoimhinsmo',1578781913,'caoimhinsmo',1578845220),(663,'es','En la página web enlazada a Wordlink, cualquier hipervínculo seguirá funcionando. De hecho, si clicas sobre uno de esos hipervínculos, te llevará a una versión de la página web enlazada, asimismo, a Wordlink por lo que también se pueda buscar el significado de cada palabra en cualquiera de los diccionarios listados. Si, por el contrario, quieres eliminar los hipervínculos y prefieres que se puedan buscar todas las palabras en los diccionarios, marca el recuadro {{Remove existing links}}.','agimeno',1578856873,'agimeno',1578857267),(663,'fr','Dans le document lié par un mot, les liens préexistants continueront de fonctionner. Et en fait, ils vous amèneront à une version liée par un mot de la page liée afin que vous puissiez également bénéficier de liens mot à mot vers des dictionnaires en ligne dans la nouvelle page. Cependant, si vous n\'avez pas besoin des liens préexistants et préférez plutôt pouvoir rechercher tous les mots, y compris les mots de lien dans les dictionnaires en ligne, cochez simplement la case {{Supprimer les liens existants}}.','Pêr',1579612050,'Pêr',1579612068),(663,'ga','Má bhí naisc cheana féin i gcáipéis a phróiseáil tú le Wordlink, oibreoidh siad go fóill. Mar a tharlaíonn sé, má osclaíonn na naisc sin leathanach nua, feidhmeoidh Wordlink ansin freisin, ag nascadh focail aonair le foclóirí ar line. Ach, mura bhfuil na naisc a bhí ann cheana de dhíth ort, agus gurbh fhearr leat bheith in ann gach uile fhocal a chuardach sna foclóirí ar líne, téacs na nascanna san áireamh, níl le déanamh ach tic a chur sa bhosca {{Remove existing links}}.\n','CÓD',1579216930,'CÓD',1579216957),(663,'gd','Ann an duilleag a chaidh a ghiullachd le Wordlink, bidh na ceanglaichean a bha san duilleig roimhe fhathast éifeachdach.  An duilleag dhan toir iad thu, bidh i sin air a giullachd le Wordlink cuideachd a chum ’s gum bi na faclan a th’inntese ceangailte ri na faclairean.  Mur am bi ùidh agad, ge-tà, anns na ceanglaichean sin a bh’ann roimhe, agus ma ’s fhearr leat gum bi a h-uile facal ceangailte ri na faclairean, fiù’s na faclan air an robh ceangal eile roimhe, faodaidh tu {{Remove existing links}} a chomharrachadh.','caoimhinsmo',1578844163,'caoimhinsmo',1578851134),(663,'it','Nel documento collegato a Wordlink, i link già esistenti continueranno a funzionare e, una volta aperti, saranno collegati a Wordlink così che anche queste nuove pagine avranno il vantaggio di poter utilizzare i dizionari online per ogni parola. Tuttavia, se non ti servono i link esistenti e, invece, preferisci poter cercare tutte le parole incluse le parole che compongono il link sui dizionari online, basta che clicchi sulla scritta {{Remove existing links}}.','AlexT',1578831675,'caoimhinsmo',1578845304),(663,'pt','No documento wordlinked, os links pré-existentes ainda funcionarão. E, de fato, eles o levarão a uma versão com link de palavra da página vinculada para que você também tenha o benefício de links palavra por palavra para dicionários online na nova página. No entanto, se você não precisar dos links pré-existentes e preferir, em vez disso, poder pesquisar todas as palavras, incluindo palavras do link nos dicionários online, simplesmente marque a caixa {{Remover links existentes}}.','etimalta',1601550572,'etimalta',1601550572),(663,'sh','U dokumentu povezanom sa Wordlink, le veze sto vec postoje nastavice da rade, i jednom otvorene, bice povezane sa Wordlink tako da ce ove nove stranice imati prednost da mogu koristiti recnike online za nove reci. U slucaju, da vam ne trebaju postojece veze, i radije biste trazili sve reci ukljucujuci reci sto se nalaze u vezi sa recnicima online, dovoljno je da pritisnete na {{Remove existing links}}.','giuseppelic',1582648213,'giuseppelic',1582649217),(664,'br','Doareoù pajennoù \'zo n\'hallont ket mont en-dro : (1) Pajennoù Web « flashy »-kenañ hag a implij kalzig a Flash pe a lugantoù; (2) Pajennoù lec\'hiet a-drek ar sistemoù kevreañ. Wordlink na \'z aio ket en-dro, siwazh gant lec\'hiennoù ar rouedadoù-sokial pe ar VLE.','Pêr',1579618175,'Pêr',1579618413),(664,'da','Nogle typer af websider, som Wordlink normalt ikke fungerer på: (1) Meget “prangende” websider, der bruger masser af Flash eller plugins; (2) Sider, der ligger bag login-systemer. Så desværre fungerer Wordlink i øjeblikket ikke med sociale netværkswebsteder.','fred',1578905376,'fred',1578905376),(664,'en','Some types of page which Wordlink will not generally work on: (1) Very “flashy” webpages using lots of Flash or plugins; (2) Pages which lie behind login systems. So unfortunately, Wordlink will not currently work with social network sites or VLE’s.','caoimhinsmo',1578782004,'caoimhinsmo',1578848949),(664,'es','Hay que tener en cuanta que Wordlink puede no funcionar muy bien con páginas: (1) que utilicen Flash u otros plug-ins (programas adicionales); (2) a las que haya que acceder con usuario y clave de acceso. Esto significa que, de momento, no se puede utilizar Wordlink con redes sociales o aulas virtuales.','agimeno',1578857399,'agimeno',1578857763),(664,'fr','Certains types de pages sur lesquelles Wordlink ne fonctionnera généralement pas: (1) Pages Web très « flashy » utilisant beaucoup de Flash ou de plugins; (2) Pages situées derrière les systèmes de connexion. Malheureusement, Wordlink ne fonctionnera pas actuellement avec les sites de réseaux sociaux ou les VLE.','Pêr',1579612118,'Pêr',1579612259),(664,'ga','Tá saghsanna áirithe leathanaigh nach n-oibreoidh Wordlink orthu: (1) Leathanaigh idirlín an-mhaisithe a bhraitheann ar Flash, nó ar bhreiseáin; (2) Leathanaigh atá lonnaithe taobh thiar de thairseach logála isteach. Ar an drochuair mar sin, ní oibríonn Wordlink  faoi láthair \nle suíomh gréasáin soisialta, nó le timpeallachtaí fiíorúla foghlama.','CÓD',1579217423,'CÓD',1579217558),(664,'gd','Seòrsaichean duilleige air nach bi Wordlink ag obair: (1) Duilleagan a tha tuilleadh is spaideil agus toinnte, a’ cur feum air Flash no plugain; (2) Duilleagan a tha air cùlaibh login. Mar sin, gu mì-fhortanach, chan obraich Wordlink ri duilleagan bho na meadhanan soisealta no bho àrainneachd ionnsachaidh.','caoimhinsmo',1578848483,'caoimhinsmo',1578851177),(664,'it','Alcuni tipi di pagine su cui Wordlink normalmente non funziona: (1) Pagine web che usano in maniera massiccia Flash o plugin; (2) Pagine a cui si accede con nome utente e password. Perciò sfortunatamente, Wordlink non funziona al momento con i siti dei social network o con siti di apprendimento virtuale.','AlexT',1578925524,'AlexT',1578925814),(664,'pt','Alguns tipos de página em que o Wordlink geralmente não funciona: (1) Páginas da web muito “chamativas” que usam muito Flash ou plug-ins; (2) Páginas que estão por trás dos sistemas de login. Portanto, infelizmente, o Wordlink atualmente não funciona com sites de redes sociais ou VLEs.','etimalta',1601550590,'etimalta',1601550590),(664,'sh','Ovo su stranice na kojima Wordlink ne radi: (1) Stranice sto preterano koriste Flash ili plugin; (2) Stranice za koje vam treba Username i Password. Na zalost, Wordlink trenutno ne radi na stranicama drustvenih mreza o sa stranicama za virtualno ucenje.','giuseppelic',1582649332,'giuseppelic',1582649605),(665,'br','Ma vez implijet Wordlink ganeoc\'h e mod {{Splitscreen}}, gellout a rit ober e-seurt da rinklañ ar vevenn a-blom etre ar sternioù evit reiñ muioc\'h a spas da stern ar geriadur, hervez ar pezh a zere gant ment ho skramm hag koñpaktegezh pe get ar geriadur ispisial a vez implijet ganeoc\'h.','Pêr',1579618427,'Pêr',1579684912),(665,'da','Hvis du bruger Wordlink i {{Splitscreen}} -tilstand, kan du trække den lodrette grænse mellem rammerne for at give enten mere eller mindre plads til ordbogsrammen, alt efter hvad der passer til din skærmstørrelse og kompaktheden eller andet for den bestemte ordbog, du anvender.','fred',1578828576,'caoimhinsmo',1578846395),(665,'en','If you are using Wordlink in “Splitscreen” mode, you can drag the vertical boundary between the frames to give either more or less space to the dictionary frame, according to what suits your screen size and the compactness or otherwise of the particular dictionary you are using.','caoimhinsmo',1578782033,'caoimhinsmo',1578782033),(665,'es','Si se utiliza Wordlink en modo {{Splitscreen}}, se puede desplazar el eje vertical que separa la página web incrustada del diccionario para modificar el espacio que le damos a cada elemento.','agimeno',1578857999,'agimeno',1578858495),(665,'fr','Si vous utilisez Wordlink en mode {{Splitscreen}}, vous pouvez faire glisser la limite verticale entre les cadres pour donner plus ou moins d\'espace au cadre du dictionnaire, selon ce qui convient à la taille de votre écran et la compacité ou non du dictionnaire particulier que vous utilisez.','Pêr',1579612189,'Pêr',1579612230),(665,'ga','Má tá tú ag úsáid Wordlink i modh {{Splitscreen}}, is féidir leat an teorainn ingearach a tharraingt idir na frámaí chun níos mó nó níos lú spáis a thabhairt do fhráma an fhoclóra, ag brath ar cibé socrú a fhóireann do mhéid do scáileán agus ar dhlús an fhoclóra atá á\n úsáid agat.','CÓD',1579217624,'CÓD',1579281993),(665,'gd','Ma tha thu a’ cleachdadh Wordlink anns an rian {{Splitscreen}}, faodaidh tu an t-inghear eadar na frèamaichean a shlaodadh dhan taobh chlì no dhan taobh dheas, gus barrachd rùim no nas lugha de rùim a thoirt dhan fhaclair, mar a riaras do leud a’ sgrìn agus leud an fhaclair.','caoimhinsmo',1578846334,'caoimhinsmo',1578851615),(665,'it','Se stai usando Wordlink nella modalità a {{Splitscreen}}, puoi trascinare il bordo verticale delle cornici per dare più o meno spazio alla schermata del dizionario, a seconda della grandezza e compatezza del tuo schermo oppure del dizionario specifico che stai usando.','AlexT',1578832260,'caoimhinsmo',1578846411),(665,'pt','Se você estiver usando o Wordlink no modo “Tela dividida”, você pode arrastar o limite vertical entre os quadros para dar mais ou menos espaço ao quadro do dicionário, de acordo com o que se adequa ao seu tamanho de tela e tamanho compacto ou não do dicionário específico que você está usando.','etimalta',1601550602,'etimalta',1601550602),(665,'sh','Ako koristite Wordlink kao {{Splitscreen}}, mozete da vucete vertikalnu ivicu rama da biste imali manje ili vise prostora za ram recnika, u zavisnosti od velicine i od kompaktnosti vaseg monitora ili od posebnog recnika sto koristite.','giuseppelic',1582649644,'giuseppelic',1582710162),(666,'br','Ar {skouer pajennadoù-mañ} a ziskouez penaos ez a en-dro Wordlink, ha penaos liammañ d\'ar pajennoù ger-liammet.','Pêr',1579606403,'Pêr',1579606457),(666,'da','Disse {eksempel sider} illustrerer, hvordan Wordlink fungerer, og hvordan man linker til Wordlinkede sider.','fred',1578828600,'fred',1578828600),(666,'en','These {example pages} illustrate how Wordlink works, and how to link to Wordlinked pages.','caoimhinsmo',1578781833,'caoimhinsmo',1578781833),(666,'es','Estas {páginas} son ejemplos para ver cómo funciona Wordlink y para saber cómo enlazar a una página web que ha sido procesada a través de Wordlink.','agimeno',1578858594,'agimeno',1578858706),(666,'fr','Ces {pages d\'exemple} illustrent le fonctionnement de Wordlink et comment créer un lien vers des pages liées par mots.','Pêr',1579612301,'Pêr',1579612301),(666,'ga','Léiríonn na {example pages} seo conas a oibríonn Wordlink, agus conas nascadh le leathanaigh a próiseáladh le Wordlink.','CÓD',1579218318,'CÓD',1579218318),(666,'gd','Tha na {duilleagan eisimpleireach} seo a’ sealltainn mar a tha Wordlink ag obair, agus ciamar a nithear ceangal a-null gu duilleagan a tha air an wordlink-adh.','caoimhinsmo',1578782739,'caoimhinsmo',1578851737),(666,'it','Queste {pagine esempio} illustrano come funziona Wordlink, e come collegarsi alle pagine che usano Wordlink.','AlexT',1578832398,'AlexT',1578832509),(666,'pt','Estas {páginas de exemplo} ilustram como o Wordlink funciona e como vincular a páginas do Wordlink.','etimalta',1601550615,'etimalta',1601550615),(666,'sh','Ove {stranice primer} pokazuju kako radi Wordlink, i kako povezati stranice sto koriste Wordlink.','giuseppelic',1582650245,'giuseppelic',1582650352),(667,'br','Gellout a rit sikour al lennerien ha na gomzont ket ho yezh war ar bemdez en ur reiñ dezho ul liamm davet Wordlink war ho pajennadoù. Spisait eta ar yezh orin (sl) ha chomlec\'h ar bajennad (url) evel arventennoù evel e-barzh al liamm davet Wordlink da-heul:','Pêr',1579619185,'Pêr',1579684960),(667,'da','Du kan hjælpe læsere, der ikke er sikre i dit sprog, ved at give et link til Wordlink på dine sider. Angiv kildesproget (sl) og sideadressen (url) som parametre i linket til Wordlink som følger:','fred',1578905439,'fred',1578905439),(667,'en','You can help readers who are not fluent in your language by providing a link to Wordlink on your pages. Specify the source language (sl) and the page address (url) as parameters in the link to Wordlink as follows:','caoimhinsmo',1578849424,'caoimhinsmo',1578849647),(667,'es','Puedes ayudar a los lectores que no hablan muy bien tu idioma mediante la incorporación de un enlace a Wordlink en tu página web. Has de especificar el idioma original (sl) y la dirección web (url) como parámetros dentro del enlace a Wordlink, de la siguiente forma:','agimeno',1578858945,'agimeno',1578859026),(667,'fr','Vous pouvez aider les lecteurs qui ne parlent pas couramment votre langue en fournissant un lien vers Wordlink sur vos pages. Spécifiez la langue source (sl) et l\'adresse de page (url) comme paramètres dans le lien vers Wordlink comme suit :','Pêr',1579618024,'Pêr',1579618036),(667,'ga','Is féidir leat cuidiú le léitheoirí nach bhfuil líofa i do theanga trí nasc chuig Wordlink a chur ar fáil do do leathanaigh. Sainigh an teanga fhoinseach (sl) agus seoladh an leathanaigh (url) mar pharaiméadair sa nasc chuig Wordlink mar a leanas:','CÓD',1579254107,'CÓD',1579281980),(667,'gd','Faodaidh tu luchd-leughaidh nach eil fileanta ’nad chànan a chuideachadh le bhith a’ cur ceangal ri Wordlink air do dhuilleagan.  Sònraich cànan na duilleige (sl) agus seòladh na duilleige (url) mar a leanas anns a’ cheangal ri Wordlink:','caoimhinsmo',1578849857,'caoimhinsmo',1578850127),(667,'it','Lettori che non hanno confidenza con la tua lingua possono essere facilitati fornendo loro un collegamento a Wordlink sulle tue pagine. Specifica la lingua originaria (sl) e l\'indirizzo della pagina (url) come parametri del collegamento a Wordlink come segue:\n','AlexT',1578925975,'giuseppelic',1582650959),(667,'pt','Você pode ajudar os leitores que não são fluentes em seu idioma, fornecendo um link para o Wordlink em suas páginas. Especifique o idioma de origem (sl) e o endereço da página (url) como parâmetros no link para o Wordlink da seguinte forma:','etimalta',1601550627,'etimalta',1601550627),(667,'sh','Mozes pomoci citaocima sto ne razumeju dobro tvoj jezik pruzajuci im vezu sa Wordlink na tvojim stranicama. Odredite izvorni jezik (sl) i adresu stranice (url) kao parametre veze sa Wordlink kao sto sledi: ','giuseppelic',1582650750,'giuseppelic',1582710345),(668,'br','E-plas spisaat ar chomlec\'h gwirion, gellout a rit lavaret ken eeun ha tra \"url = referer\", en degouezh ma vefe kemeret e kont an url adalek ar bajenn gervel. An tu mat gant an dra-se, eo, e kendalc\'h da vont en-dro ha pa vefe fiñvet ar bajennad. Daoust da-se, ar fet da gas titouroù davet an daveer a c\'hall bezañ lazhet e-barzh ar merdeerioù, e-se eo ne vez ket fizius-tre an hentenn-se.','Pêr',1579619363,'Pêr',1579685030),(668,'da','I stedet for at angive den faktiske adresse, kan du også blot sige “url = referer”, i hvilket tilfælde url\'en er hentet fra adressen på opkaldssiden. Dette har også den fordel, at linket fortsætter med at fungere, hvis siden flyttes. Dog kan afsendelsen af referencerinformation forsvinde i browsere, så denne metode er ikke 100% pålidelig','fred',1578828663,'fred',1578828663),(668,'en','Instead of specifying the actual address, you can also simply say “url=referer”, in which case the url is taken from the address of the calling page. This also has the merit that the link will continue to work if the page is moved. However, the sending of referer information can be switched off in browsers, so this method is not 100% reliable','caoimhinsmo',1578782322,'caoimhinsmo',1578782322),(668,'es','En lugar de especificar la dirección web, puedes simplemente poner “url=referer”, con lo cual se coge la URL de la página web en cuestión automáticamente. La ventaja de este sistema es que el enlace seguirá funcionando aunque cambie la dirección de la página. Por otra parte, la función tampoco es 100% fiable porque se puede deshabilitar la opción de enviar la información de la página de referencia en los navegadores web.','agimeno',1578859088,'agimeno',1578859534),(668,'fr','Au lieu de spécifier l\'adresse réelle, vous pouvez également simplement dire \"url = referer\", auquel cas l\'url est prise à partir de l\'adresse de la page appelante. Cela a également le mérite que le lien continue de fonctionner si la page est déplacée. Cependant, l\'envoi d\'informations sur le référent peut être désactivé dans les navigateurs, donc cette méthode n\'est pas fiable.','Pêr',1579618008,'Pêr',1579618008),(668,'ga','In áit an seoladh féin a shainiú, is féidir leat “url=referer” a lua go bunúsach, sa chás sin léitear an url ó sheoladh an spriocleathanaigh. An buntáiste a bhaineann leis seo ná go n-oibreoidh an nasc go fóill má bhogtar an leathanach. Ar an lámh eile, is féidir le seoladh eolas tagróra a bheith múchta i mbrabhsálaithe, mar sin de, ní féidir brath go hiomlán ar an mhodh seo.','CÓD',1579254193,'CÓD',1579282000),(668,'gd','An àite gach url fa leth a sgrìobhadh, faodaidh tu dìreach “url=referer” a sgrìobhadh air gach duilleig.  An uair sin, cleachdaidh Wordlink url na duilleige a tha an déidh a ghairm.  Buannachd eile leis a sin, ’s e gum bi an ceangal fhathast ag obair ma théid an duilleag a ghluasad gu seòladh ùr.  Gabhaidh bacadh a chur sa bhrabhsair air an fhiosrachadh ‘referer’ a tha seo, ge-tà.  Mar sin, chan eil an dòigh-obrach seo gu tur cinnte.','caoimhinsmo',1578850360,'caoimhinsmo',1578850774),(668,'it','Invece di specificare l\'indirizzo vero e proprio, puoi semplicemente scrivere “url=referer”, in questo modo l\'url viene preso dall\'indirizzo della pagina di riferimento. Il vantaggio è che il link continuerà a funzionare anche se la pagina viene spostata. Tuttavia, l\'invio della informazione \"referer\" può essere disattivato nei browser, perciò questo metodo non è sicuro al cento per cento.','AlexT',1578832557,'AlexT',1578832978),(668,'pt','Em vez de especificar o endereço real, você também pode simplesmente dizer “url = referer”, caso em que o url é obtido do endereço da página de chamada. Isso também tem o mérito de que o link continuará a funcionar se a página for movida. No entanto, o envio de informações de referência pode ser desativado nos navegadores, portanto, este método não é 100% confiável','etimalta',1601550639,'etimalta',1601550639),(668,'sh','Umesto navodjenja stvarne adrese, mozes samo reci “url=referer”, u tom slucaju url je preuzet iz adrese pozivne stranice. Ovo je prednost jer link ce nastaviti da radi i ako stranica bude pomerena. Medjutim, slanje referentnih informacija moze da iskljuci browser, znaci ovaj metod nije siguran sto posto.','giuseppelic',1582651282,'giuseppelic',1582651954),(669,'br','Evit an aozerien web','Pêr',1579599252,'Pêr',1579599252),(669,'da','For webforfattere','fred',1578905304,'fred',1578905304),(669,'en','For web authors','caoimhinsmo',1578849239,'caoimhinsmo',1578849239),(669,'es','Para desarrolladores web','agimeno',1578855916,'agimeno',1578855916),(669,'fr','Pour les auteurs Web','Pêr',1579611987,'Pêr',1579611987),(669,'ga','Le haghaidh údar idirlín','CÓD',1578955481,'CÓD',1578955481),(669,'gd','Airson luchd-sgrìobhaidh làraichean-lìn','caoimhinsmo',1578849270,'caoimhinsmo',1578849270),(669,'it','Per autori di materiale sul web','AlexT',1578925414,'AlexT',1578925414),(669,'pt','Para autores da web','etimalta',1601550525,'etimalta',1601550525),(669,'sh','Za web autore ','giuseppelic',1582647551,'giuseppelic',1582647551),(671,'br','Pajennadoù skouer da ziskouez penaos ez a en-dro Wordlink','Pêr',1579606509,'Pêr',1579606509),(671,'da','Eksempel på sider for at illustrere Wordlinks funktion','fred',1578905480,'fred',1578905480),(671,'en','Example pages to illustrate Wordlink','caoimhinsmo',1578694431,'caoimhinsmo',1578854382),(671,'es','Ejemplos de páginas para ver cómo funciona Wordlink','agimeno',1578857947,'agimeno',1578857947),(671,'fr','Exemples de pages pour illustrer Wordlink','Pêr',1579617954,'Pêr',1579617954),(671,'ga','Leathanaigh shamplacha a léiríonn conas a oibríonn Wordlink','CÓD',1579254673,'CÓD',1579254673),(671,'gd','Duilleagan eisimpleireach gus Wordlink a thaisbeanadh','caoimhinsmo',1578694457,'caoimhinsmo',1578854391),(671,'it','Pagine di  esempio per illustrare Wordlink','AlexT',1578926026,'AlexT',1578926026),(671,'pt','Páginas de exemplo para ilustrar o Wordlink','etimalta',1601550673,'etimalta',1601550673),(671,'sh','Stranice primer za ilustraciju Wordlink ','giuseppelic',1582652899,'giuseppelic',1582652899),(672,'br','Wordlink a zo un aozadur diazezet war WWW hag a em-liamm pajennoù Web tidek, ger-ha-ger, da geriadurioù enlinenn. Diorroet eo bet gant {Caoimhín Ó Donnaíle} e {Sabhal Mòr Ostaig} e stern ar raktres {POOLS-T} arc\'hantaouet gant Europa (etre 2008-2010). Dalc\'het en deus da vont war-raok an diorren e-diabarzh ar stern {TOOLS} arc\'hantaouet gant Europa (etre2012-2014) ha kenderc\'hel a ra bepred en deiz a-hiziv e-diabarzh ar frammad {COOL} arc\'hantaouet gant Europa (etre 2018-2022).','Pêr',1579619375,'Pêr',1579685117),(672,'da','Wordlink er en WWW-baseret facilitet, der automatisk forbinder vilkårlige websider, ord for ord med online ordbøger. Det blev udviklet af {Caoimhín Ó Donnaíle} i {Sabhal Mòr Ostaig} som en del af det europæiske finansierede {POOLS-T} -projekt (2008-2010). Udviklingen blev fortsat som en del af det europæiske finansierede {TOOLS} -projekt (2012-2014) og videreføres som en del af det europæiske finansierede {COOL} -projekt (2018-2022).','fred',1578905519,'fred',1578905519),(672,'en','Wordlink is a WWW based facility which links arbitrary webpages automatically, word by word with online dictionaries. It was developed by {Caoimhín Ó Donnaíle} at {Sabhal Mòr Ostaig} as part of the European funded {POOLS-T} project (2008-2010). Development was continued as part of the European funded {TOOLS} project (2012-2014), and is being further continued as part of the European funded {COOL} project (2018-2022).','caoimhinsmo',1578860598,'caoimhinsmo',1578860698),(672,'es','Wordlink es un servicio basado en WWW que enlaza automáticamente páginas webs, palabra por palabra con diccionarios en línea. Fue desarrollado por {Caoimhín Ó Donnaíle} en {Sabhal Mòr Ostaig} como parte del proyecto europeo financiado {POOLS-T} (2008-2010). Su desarrollo se ha continuado como parte del proyecto europeo financiado {TOOLS} (2012-2014), y está siendo ulteriormente desarrollado como parte del proyecto europeo financiado {COOL} (2018-2022).','sodisar',1579374875,'sodisar',1579375126),(672,'fr','Wordlink est une installation basée sur WWW qui relie automatiquement des pages Web arbitraires, mot à mot, à des dictionnaires en ligne. Il a été développé par {Caoimhín Ó Donnaíle} à {Sabhal Mòr Ostaig} dans le cadre du projet {POOLS-T} financé par l\'Europe (2008-2010). Le développement s\'est poursuivi dans le cadre du projet {TOOLS} financé par l\'Europe (2012-2014) et se poursuit dans le cadre du projet {COOL} financé par l\'Europe (2018-2022).','Pêr',1579617944,'Pêr',1579617944),(672,'ga','Saoráid WWW is ea Wordlink a nascann aon leathanach idirlín go huathoibríoch, ar bhonn focal ar fhocal le foclóirí ar líne. Is é {Caoimhín Ó Donnaíle} ag {Sabhal Mòr Ostaig} a d\'fhorbair é mar chuid den tionscadal {POOLS-T} (2008-2010) a mhaoinigh an Coimisiún Eorpach. Lean an obair forbartha ar aghaidh mar chuid den tionscadal {COOL}(2018-2022), tionscadal atá á chómhaoiniú ag an Choimisiún Eorpach.\n','CÓD',1579254768,'CÓD',1579255116),(672,'gd','’S e goireas Eadarlìn a tha ann an Wordlink a tha a’ ceangal duilleag-lìn sam bith, facal air an fhacal, ri faclairean air-loidhne. Chaidh a chruthachadh le {Caoimhín Ó Donnaíle} aig {Sabhal Mòr Ostaig} mar phàirt den phròiseact Eòrpach {POOLS-T} (2008-2010). Chaidh a leasachadh mar phàirt den phròiseact Eòrpach {TOOLS} (2012-2014). Tha an obair leasachaidh a’ leantainn oirre mar phàirt den phròiseact Eòrpach COOL (2018-2021).','caoimhinsmo',1578861894,'caoimhinsmo',1578861933),(672,'it','Wordlink è uno strumento basato sul WWW che collega pagine web automaticamente, parola per parola a dizionari online. E\' stato creato da  {Caoimhín Ó Donnaíle} a {Sabhal Mòr Ostaig} nell\'ambito del progetto {POOLS-T} del (2008-2010) finanziato dall\'Unione Europea. Il lavoro  è proseguito come parte del progetto{TOOLS} del (2012-2014) ed è portato avanti come progetto {COOL} del (2018-2022), entrambi finanziati dall\'Unione Europea.','AlexT',1578926045,'AlexT',1578926484),(672,'pt','O Wordlink é um recurso baseado em WWW que vincula páginas da web arbitrárias automaticamente, palavra por palavra, a dicionários online. Foi desenvolvido por {Caoimhín Ó Donnaíle} em {Sabhal Mòr Ostaig} como parte do projeto {POOLS-T} financiado pela Europa (2008-2010). O desenvolvimento continuou como parte do projeto {TOOLS} com financiamento europeu (2012-2014), e está sendo continuado como parte do projeto {COOL} com financiamento europeu (2018-2022).','etimalta',1601550687,'etimalta',1601550687),(672,'sh',' Wordlink je istrument basiran na WWW sto povezuje stranice web automacki, rec po rec sa recnicima online. Razvio ga je {Caoimhín Ó Donnaíle} i {Sabhal Mòr Ostaig} kao deo projekta {POOLS-T} od (2008-2010) finansiranog od UE.  Razvoj je nastavljen kao deo projekta {TOOLS} od (2012-2014) i nastavlja se dalje kao projekat {COOL} od (2018-2022), oba finansirana od Evropske Unije.','giuseppelic',1582652295,'giuseppelic',1582652763),(673,'br','Mont a ra en-dro mat-tre gant {Multidict}, un arc\'hweladur enklask e meur a yezh, ha diazez {Clilstore} eo, ur stal endalc\'hadoù gant gwirioù amstrizh hag un danvez pedagogel enkorfet evit an deskiñ yezhoù.','Pêr',1579619383,'Pêr',1579685226),(673,'da','Det fungerer sammen med {Multidict}, en opslagsfacilitet til flere ordbøger, og det er grundlaget for {Clilstore}, en database med copyleft-indhold og sprogintegreret undervisningsmateriale.','fred',1578905552,'fred',1578905552),(673,'en','It works in conjunction with {Multidict}, a multiple dictionary lookup facility, and it is the basis of {Clilstore}, a store of copyleft content and language integrated teaching materials.','caoimhinsmo',1578861333,'caoimhinsmo',1578861333),(673,'es','Funciona en conjunto con {Multidict}, un servicio de búsqueda de diccionarios, y es la base de {Clilstore}, una plataforma de materiales copyleft de Aprendizaje Integrado de Contenidos y Lenguas Extranjeras. ','sodisar',1579375173,'sodisar',1579375246),(673,'fr','Il fonctionne conjointement avec {Multidict}, une fonction de recherche dans plusieurs dictionnaires, et il est la base de {Clilstore}, un magasin de contenu copyleft et de matériel pédagogique intégré à la langue.','Pêr',1579617899,'Pêr',1579617899),(673,'ga','Oibríonn sé i gcomhair le {Multidict}, saoráid cheadaithe foclóra, agus is é is bunús le {Clilstore}, stóras d\'ábhar teagaisc a thacaíonn le foghlaim chomhtháite ábhar agus teanga, atá á chur ar fáil ar bhonn cóipcheada.','CÓD',1579255136,'CÓD',1579255348),(673,'gd','Tha e ag obair ann an co-bhonn ri {Multidict}, goireas gus facal a lorg ann an iomadh faclair.  Tha e ’na bhunaid aig {Clilstore}, stòras fosgailte de stuth teagaisg gus cànan agus cuspair eile a ionnsachadh còmhla.','caoimhinsmo',1578862039,'caoimhinsmo',1578862186),(673,'it','Funziona in abbinamento a {Multidict}, uno strumento di ricerca su più dizionari, ed è alla base del {Clilstore}, una piattaforma che contiene contenuti utilizzabili e materiale didattico per l\'apprendimento della lingua.','AlexT',1578926502,'AlexT',1578926653),(673,'pt','Ele funciona em conjunto com o {Multidict}, um recurso de pesquisa de vários dicionários, e é a base do {Clilstore}, um armazenamento de conteúdo copyleft e materiais de ensino integrados de linguagem.','etimalta',1601550702,'etimalta',1601550702),(673,'sh','Radi u paru sa {Multidict}, istrument za trazenje u vise recnika, i cini basu {Clilstore}, jedne platforme sto sadrzi nastavni materijal za ucenje jezika.','giuseppelic',1582653062,'giuseppelic',1582653511),(674,'br','Kontant-tre e vimp o resevout evezhiadennoù pe kinnigadennoù war ar an aozadur-mañ - Kasit anezho ken eeun ha tra dre bostel (e n\'eus forzh peseurt yezh) da {caoimhin@smo.uhi.ac.uk}. M\'ho peus kinnigadennoù war ar sujed a c\'heriadurioù enlinenn all hag a c\'hallfe bezañ talvoudus da ouzhpennañ d\'ar sistem, hervezoc\'h, bez e vimp laouen-tre da gemer anezho e kont.','Pêr',1579619390,'Pêr',1579685254),(674,'da','Vi vil sætte stor pris på at modtage kommentarer eller forslag til denne facilitet - bare send dem via e-mail (på ethvert sprog) til {caoimhin@smo.uhi.ac.uk}. Hvis du har forslag til andre online ordbøger, som du mener ville være værd at tilføje til systemet, vil vi være meget glade for at overveje dem.','fred',1578905632,'fred',1578905632),(674,'en','We would be very glad indeed to receive comments or suggestions on this facility - Simply send them by e-mail (in any language) to {caoimhin@smo.uhi.ac.uk}. If you have suggestions as to other online dictionaries which you think would be worth adding to the system, we would be very happy to consider them.','caoimhinsmo',1578861514,'caoimhinsmo',1578861514),(674,'es','Nos alegrará mucho recibir comentarios o sugerencias sobre este servicio - Es suficiente con mandarlos por correo electrónico (en cualquier idioma) a {caoimhin@smo.uhi.ac.uk}. Si tienes sugerencias sobre otros diccionarios en línea que crees que podría valer la pena añadir al sistema, nos complacerá tomarlos en consideración.','sodisar',1579375319,'sodisar',1579375402),(674,'fr','Nous serions très heureux de recevoir des commentaires ou des suggestions sur cette installation - Envoyez-les simplement par e-mail (dans n\'importe quelle langue) à {caoimhin@smo.uhi.ac.uk}. Si vous avez des suggestions concernant d\'autres dictionnaires en ligne qui, selon vous, mériteraient d\'être ajoutés au système, nous serions très heureux de les prendre en considérations.','Pêr',1579617881,'Pêr',1579622893),(674,'ga','Fáiltímid roimh thuairimí nó mholtaí ar an tsaoráid seo - cuir ríomhphost i dteanga ar bith chuig {caoimhin@smo.uhi.ac.uk}. Má tá moltaí agat maidir le foclóirí ar line eile a shíleann tú a chuirfeadh leis an chóras, bheimis sásta breathnú orthu.','CÓD',1579255482,'CÓD',1579255606),(674,'gd','Bhitheamaid gu math toilichte beachdan agus molaidhean fhaighinn mun ghoireas seo.  Cuir gu {caoimhin@smo.uhi.ac.uk} iad, ann an cànan sam bith.  Ma tha molaidhean agad a thaobh faclairean eile air-loidhne a dh’fhaodadh a bhith math anns an t-siostam seo, bhitheamaid toilichte sùil a chur orra.','caoimhinsmo',1578862360,'caoimhinsmo',1578862488),(674,'it','Saremmo molto felici di ricevere commenti o suggerimenti riguardo a questo strumento-Basta inviarli via mail (in qualsiasi lingua) a {caoimhin@smo.uhi.ac.uk}. Se avete suggerimenti riguardanti altri dizionari online che ritenete opportuno vengano aggiunti al sistema, li prenderemo volentieri in considerazione.','AlexT',1578926764,'AlexT',1578926870),(674,'pt','Ficaríamos muito contentes em receber comentários ou sugestões sobre este recurso - basta enviá-los por e-mail (em qualquer idioma) para {caoimhin@smo.uhi.ac.uk}. Se você tiver sugestões de outros dicionários online que julgue valerem a pena adicionar ao sistema, ficaríamos muito felizes em considerá-las.','etimalta',1601550718,'etimalta',1601550718),(674,'sh','Bili bi smo mnogo zadovoljni da primimo komentare ili predloge sto se tice ovog instrumenta - Mozete ih poslati elektronskom postom (na bilo kom jeziku) na {caoimhin@smo.uhi.ac.uk}. Ako imate predloge za dodatak drugih recnika online, rado cemo ih razmotriti.','giuseppelic',1582710586,'giuseppelic',1582710807),(675,'br','Multidict a ra e-seurt ma vo aesoc\'h da gas da benn enklaskoù er geriadurioù enlinenn e kalzik a yezhoù hag eskemm anezho.','Pêr',1579619410,'Pêr',1579686914),(675,'da','Multidict gør det nemt at finde online ordbøger på mange sprog og hurtigt skifte mellem dem.','fred',1578905035,'fred',1578905035),(675,'en','Multidict makes it easy to find online dictionaries in many languages, and to swop quickly between them.','caoimhinsmo',1578868344,'caoimhinsmo',1578868344),(675,'es','Multidict facilita la detección de diccionarios en muchos idiomas, y poder cambiar rápidamente entre ellos.','sodisar',1579373178,'sodisar',1579373267),(675,'fr','Multidict facilite la recherche de dictionnaires en ligne dans de nombreuses langues et la permutation rapide entre eux.','Pêr',1579617535,'Pêr',1579617535),(675,'ga','Le Multidict is éasca teacht ar fhoclóirí ar líne i gcuid mhór teangacha, agus malartú go gasta eatarthu','CÓD',1579281854,'CÓD',1579281854),(675,'gd','Tha Multidict ga fhàgail furasta faclairean air-loidhne a lorg ann an iomadh cànan, agus tionndadh gu luath eadarra.','caoimhinsmo',1578868383,'caoimhinsmo',1578868383),(675,'it','Multidict facilita l\'individuazione di dizionari online in molte lingue, e permette di passare velocemente da uno all\'altro.','AlexT',1578926966,'AlexT',1578926966),(675,'pt','O Multidict torna mais fácil encontrar dicionários online em vários idiomas e alternar rapidamente entre eles.','etimalta',1601551007,'etimalta',1601551007),(675,'sh','Multidict olaksava trazenje recnika online na mnogim jezicima, i omogucava da predjete brzo sa jednog na drugi.','giuseppelic',1582722769,'giuseppelic',1582722769),(676,'br','Gellout a rit cheñch yezh an etrefas.','Pêr',1579606309,'Pêr',1579606319),(676,'da','Du kan ændre sprog på grænsefladen','fred',1578905078,'fred',1578905078),(676,'en','You can change the interface language.','caoimhinsmo',1578868778,'caoimhinsmo',1578868778),(676,'es','Puedes cambiar el idioma de la interfaz.','sodisar',1579373283,'sodisar',1579373283),(676,'fr','Vous pouvez changer la langue de l\'interface.','Pêr',1579617522,'Pêr',1579617522),(676,'ga','Is féidir leat teanga an chomhéadáin a athrú.','CÓD',1579281884,'CÓD',1579281969),(676,'gd','Is urrainn dhut cànan na h-eadar-aghaidh atharrachadh.','caoimhinsmo',1578868807,'caoimhinsmo',1578868807),(676,'it','Puoi modificare la lingua dell\'interfaccia.','AlexT',1578926993,'AlexT',1578926993),(676,'pt','Você pode alterar o idioma da interface.','etimalta',1601551019,'etimalta',1601551019),(676,'sh','Mozes da promenis jezik na interface.','giuseppelic',1582722799,'giuseppelic',1582722799),(677,'br','Daou vod a zo da etrefas Multidict, {{basic}} hag {{advanced}}. Ar mod {{advanced}} a ziskouez an holl arc\'hweladurioù, pa ziskouez bezañ ar mod {{basic}} sklaeroc\'h ha dibistigoc\'h ha ne ziskouez nemet an arc\'hweladurioù pennañ.','Pêr',1579619416,'Pêr',1579686951),(677,'da','Multidict-grænsefladen har to tilstande, {{basic}} og {{advanced}}. {{Advanced}} -tilstanden viser alle faciliteter, mens {{basic}} -tilstanden er klarere og mindre rodet og kun viser de vigtigste faciliteter.','fred',1578905111,'fred',1578905111),(677,'en','The Multidict interface has two modes, {{basic}} and {{advanced}}.  The {{advanced}} mode shows all the facilities, while the {{basic}} mode is clearer and less cluttered and shows only the main facilities.','caoimhinsmo',1578870972,'caoimhinsmo',1578907652),(677,'es','La interfaz de Multidict tiene dos modalidades, {{básica}} y {{avanzada}}. La modalidad {{avanzada}} muestra todas las opciones, mientras que la {{básica}} es más intuitiva, menos saturada, y solo muestra las opciones principales.','sodisar',1579373361,'sodisar',1579373503),(677,'fr','L\'interface Multidict a deux modes, {{basic}} et {{advanced}}. Le mode {{advanced}} affiche toutes les installations, tandis que le mode {{basic}} est plus clair et moins encombré et ne montre que les installations principales.','Pêr',1579617499,'Pêr',1579617510),(677,'ga','Tá dhá mhodh ag comhéadán Multidict, {{basic}} agus {{advanced}}.  Táispeánann an modh {{advanced}} na saoráidí go léir, agus tá an modh  {{basic}} níos soiléire agus níos bunúsaí, gan ann ach ná príomhshaoráidí.','CÓD',1579282127,'CÓD',1579282207),(677,'gd','Tha dà dhòigh-obrach anns an eadar-aghaidh aig Multidict, {{basic}} agus {{advanced}}.  Tha {{advanced}} a’ nochdadh nan goireasan gu léir.  Tha {{basic}} nas soilleire, gun a bhith cho “trang”, agus chan eil e a’ sealltainn ach na goireasan as cudromaiche.','caoimhinsmo',1578871234,'caoimhinsmo',1578871350),(677,'it','L\'interfaccia di Multidict funziona con doppia modalità, {{base}} e {{avanzata}}. La modalità {{avanzata}} mostra tutte le opzioni, mentre quella {{base}} è più chiara, lineare e mostra solo le opzioni principali.','AlexT',1578927028,'AlexT',1578927204),(677,'pt','A interface Multidict possui dois modos, {{basic}} e {{advanced}}. O modo {{avançado}} mostra todas as instalações, enquanto o modo {{básico}} é mais claro e menos confuso e mostra apenas as instalações principais.','etimalta',1601551029,'etimalta',1601551029),(677,'sh','Interface Multidict radi na dva nacina, {{basic}} i {{advanced}}. Nacin {{advanced}} pokazuje sve opcije, dok {{basic}} je jednostavniji, linearan i pokazuje samo osnovne opcije.','giuseppelic',1582722908,'giuseppelic',1582723091),(678,'br','Gellout a rit ober e-seurt da wintañ Multidict etre ar protokol \"http\" hag ar protokol \"https\". Internet a zo o tremen er mare-mañ eus ar protokol \"http\" war meur a vloaz d\'ar protokol \"https\", hag a zo sur. Kavout a reomp gwelloc\'h ober gant ar protokol \"https\" ar muiañ ma c\'hallomp, siwazh, geriadurioù \'zo na \'z eont en-dro nemet gant an \"http\" avat, dre-se eo ret kaout an diskoulm-se evit an degouezhioù-mañ.','Pêr',1579619422,'Pêr',1579687048),(678,'da','Du kan nemt skifte Multidict mellem http-protokol og https-protokol. Internettet er i øjeblikket ved at skifte fra http-protokol til https, hvilket er mere sikkert. Vi foretrækker at bruge https, hvor det er muligt, men desværre fungerer nogle ordbøger stadig kun med http, vi holder øje med udviklingen og vil ændre løbende.','fred',1578905206,'fred',1578905206),(678,'en','You can switch Multidict easily between http protocol and https protocol.  The Internet is currently in the process of changing over from http protocol to https, which is more secure, over the course of several years.  We prefer to use https wherever possible, but unfortunately some dictionaries still only work with http, hence the need for this fallback.','caoimhinsmo',1578871730,'caoimhinsmo',1578871859),(678,'es','En Multidict puedes pasar fácilmente del protocolo http al https. Actualmente Internet se encuentra en un proceso de cambio del protocolo http al https, que es más seguro, que durará varios años. Nosotros preferimos usar https siempre que sea posible, pero desafortunadamente algunos diccionarios todavía funcionan solo con http, de ahí la necesidad de esa segunda opción.','sodisar',1579373596,'sodisar',1579373755),(678,'fr','Vous pouvez facilement basculer Multidict entre le protocole « http » et le protocole « https ». Internet est actuellement en train de passer du protocole « http » à « https », qui est plus sécurisé, sur plusieurs années. Nous préférons utiliser « https » dans la mesure du possible, mais malheureusement, certains dictionnaires ne fonctionnent toujours qu\'avec « http », d\'où la nécessité de cette solution de rechange.','Pêr',1579617457,'Pêr',1579687265),(678,'ga','Is féidir leat Multidict a mhalartú go furasta idir prótacal http agus prótacal https. Le roinnt blianta anuas bhí an t-idirlíon ag athrú ó http go prótacál https. Is fearr linn http a úsáid nuair is féidir, ach ar an drochuair tá roinnt foclóirí ann a oibríonn le http amháin, sin an fáth a bhfuil an cúltaca seo de dhíth.\n','CÓD',1579282402,'CÓD',1579282562),(678,'gd','Faodaidh tu tionndadh gu furasta eadar http agus https.  Tha an t-Eadarlìon a’ gluasad gu luath a-nis, thairis air beagan bhliadhnaichean, bhon phròtacal “http” a-null gu “https”, a tha nas tèarainte.  Is fheàrr linn a bhith ag obair le https, ach gu mì-fhortanach tha faclairean ann fhathast nach eil ag obrachadh le http.  Mar sin, bidh feum agad uaireannan tuiteam air ais gu http.','caoimhinsmo',1578871939,'caoimhinsmo',1578872372),(678,'it','Con Multidict puoi passare facilmente dal protocollo http a quello https. Internet subirà nel corso degli anni un passaggio da http a https che è più sicuro. Noi preferiamo utilizzare il protocollo https quando possibile, ma sfortunatamente, alcuni dizionari funzionano ancora solo con quello http, per cui a volte, si rende necessario tornare al vecchio protocollo.','AlexT',1578927296,'AlexT',1578927580),(678,'pt','Você pode alternar facilmente o Multidict entre o protocolo http e o protocolo https. A Internet está atualmente em processo de mudança do protocolo http para o https, que é mais seguro, ao longo de vários anos. Preferimos usar https sempre que possível, mas infelizmente alguns dicionários ainda funcionam apenas com http, daí a necessidade desse fallback.','etimalta',1601551041,'etimalta',1601551041),(678,'sh','Sa Multidict mozes lako preci sa protokola http na https. Internet ce tokom godina pretrpeti prelaz sa http na https sto je sigurniji. Mi radije koristimo protokol https kad je to moguce, ali na zalost , pojedini recnici rade jos uvek samo sa http, zato ponekad je potrebno vratiti se na stari protokol .','giuseppelic',1582723262,'giuseppelic',1582723467),(679,'br','Gellout a rit klikañ war an arouez «↔» evit eskemm ar yezh orin hag ar yezh vukenn.','Pêr',1579619427,'Pêr',1579621265),(679,'da','Du kan klikke på symbolet \'↔\' for at skifte kildesprog og målsprog.','fred',1578905254,'fred',1578905254),(679,'en','You can click the ‘↔’ symbol to swop the source language and target language.','caoimhinsmo',1578872562,'caoimhinsmo',1578872789),(679,'es','Puedes pinchar en el simbolo  ‘↔’  para intercambiar el idioma origen y el idioma meta.','sodisar',1579373803,'sodisar',1579374095),(679,'fr','Vous pouvez cliquer sur le symbole «↔» pour échanger la langue source et la langue cible.','Pêr',1579617444,'Pêr',1579617444),(679,'ga','Is féidir leat cliceáil ar an siombal ‘↔’ chun an teanga fhoinseach agus an sprioctheanga a mhalartú thart.','CÓD',1579282633,'CÓD',1579282633),(679,'gd','Faodaidh tu ‘↔’ a bhriogadh gus an cànan bunais agus an cànan amais a mhalairt.','caoimhinsmo',1578872579,'caoimhinsmo',1578872844),(679,'it','Puoi cliccare il simbolo ‘↔’ per scambiare la lingua di partenza e quella in cui tradurre.','AlexT',1578927595,'AlexT',1578927687),(679,'pt','Você pode clicar no símbolo ‘↔’ para trocar o idioma de origem e o idioma de destino.','etimalta',1601551056,'etimalta',1601551056),(679,'sh','Mozes da pritisnes na znak ‘↔’ da bi zamenio izvorni jezik sa onim na koji prevodis. ','giuseppelic',1582723494,'giuseppelic',1582723578),(680,'br','Gellout a rit klikañ war \"Achap\" evit kuitaat Multidict ha tizhout e-se degemer ar geriadur.','Pêr',1579619433,'Pêr',1579621216),(680,'da','Du kan klikke på \"Esc\" for at forlade Multidict og gå til ordbogens egen hjemmeside.','fred',1578912268,'fred',1578912268),(680,'en','You can click “Esc” to leave Multidict and go to the dictionary’s own homepage.','caoimhinsmo',1578905306,'caoimhinsmo',1578905306),(680,'es','Pudes pinchar en \"Esc\" para salir de Multidict e ir a la página principal del diccionario.','sodisar',1579374136,'sodisar',1579374136),(680,'fr','Vous pouvez cliquer sur « Échap »  pour quitter Multidict et accéder à la page d\'accueil du dictionnaire.','Pêr',1579617429,'Pêr',1579687157),(680,'ga','Is féidir leat cliceáil ar “Esc” le Multidict a fhágáil agus dul díreach chuig leathanach baile an fhoclóra féin.','CÓD',1579282692,'CÓD',1579282692),(680,'gd','Faodaidh tu “Esc” a bhriogadh gus Multidict fhàgail agus falbh a-null gu làrach-lìn an fhaclair fhéin.','caoimhinsmo',1578905378,'caoimhinsmo',1578905378),(680,'it','Puoi cliccare \"Esc\" per uscire da Multidict a andare alla homepage del dizionario.','AlexT',1578927734,'AlexT',1578927734),(680,'pt','Você pode clicar em “Esc” para sair do Multidict e ir para a página inicial do próprio dicionário.','etimalta',1601551067,'etimalta',1601551067),(680,'sh','Mozes da pritisnes na \"Esc\" da izadjes iz Multidict i da odes na pocetnu stranicu  recnika.','giuseppelic',1582723679,'giuseppelic',1582723679),(681,'br','Multidict a oar reiñ a-wechoù liammoù herrek davet yezhoù tost an eil eus ebenn.','Pêr',1579619444,'Pêr',1579621167),(681,'da','Multidict giver undertiden hurtige links til nært beslægtede sprog f.eks. dansk-norsk.','fred',1578912315,'fred',1578912315),(681,'en','Multidict sometimes provides quick links to closely related languages.','caoimhinsmo',1578905499,'caoimhinsmo',1578905883),(681,'es','A veces Multidict facilita enlaces a idiomas estrechamente relacionados.','sodisar',1579374158,'sodisar',1579374177),(681,'fr','Multidict fournit parfois des liens rapides vers des langues étroitement liées.','Pêr',1579617407,'Pêr',1579617407),(681,'ga','In amanna, soláthraíonn Multidict mearnaisc chuig teangacha a bhfuil gaol gairid eatarthu.','CÓD',1579282854,'CÓD',1579282854),(681,'gd','Tha Multidict uaireannan a’ toirt cheanglaichean luath gu cànanan a tha dlùth-chàirdeach.','caoimhinsmo',1578905544,'caoimhinsmo',1578905891),(681,'it','Multidict, a volte, fornisce link veloci a lingue strettamente correlate.','AlexT',1578927784,'AlexT',1578927784),(681,'pt','O Multidict às vezes fornece links rápidos para idiomas intimamente relacionados.','etimalta',1601551079,'etimalta',1601551079),(681,'sh','Multidict, ponekad daje brzi link za vrlo povezane jezike.','giuseppelic',1582723826,'giuseppelic',1582723826),(682,'br','Al liamm-mañ a ro an tu da ziuzañ aesoc\'h ar geriadurioù unyezhek en ur dermeniñ ar yezh vukenn evel bezañ ar yezh orin.','Pêr',1579619449,'Pêr',1579621106),(682,'da','Dette link gør det nemt at vælge at vælge etsproglige ordbøger ved at indstille målsproget til at være det samme som kildesproget.','fred',1578912361,'fred',1578912361),(682,'en','This link makes it easy to select to select monolingual dictionaries, by setting the target language to be the same as the source language.','caoimhinsmo',1578905718,'caoimhinsmo',1578907732),(682,'es','Este enlace facilita la selección de diccionarios monolingues eligiendo el mismo idioma meta que el idioma origen. ','sodisar',1579374268,'sodisar',1579374268),(682,'fr','Ce lien facilite la sélection des dictionnaires monolingues en définissant la langue cible comme étant la langue source.','Pêr',1579617396,'Pêr',1579617396),(682,'ga','Éascaíonn an nasc seo roghnú foclóirí aonteangacha, tríd an teanga céanna a shocrú mar sprioctheanga agus mar theanga fhoinseach.','CÓD',1579282983,'CÓD',1579282983),(682,'gd','Tha an ceangal seo gad thoirt gu faclairean aon-chànanach, le bhith a’ cur a’ chànain amais co-ionnann ris a’ chànain bunais.','caoimhinsmo',1578905789,'caoimhinsmo',1578905830),(682,'it','Questo link permette di selezionare facilmente i dizionari monolingue, scegliendo la stessa lingua per entrambe le parole.','AlexT',1578927911,'AlexT',1578927911),(682,'pt','Este link facilita a seleção para selecionar dicionários monolíngues, definindo o idioma de destino para ser igual ao idioma de origem.','etimalta',1601551090,'etimalta',1601551090),(682,'sh','Ovaj link daje mogucnost brzog izbora recnika jednog jezika, birajuci isti jezik za obe reci. ','giuseppelic',1582723954,'giuseppelic',1582723954),(683,'br','Multidict a zo gantañ ul \"logo\" da bep geriadur. Ur wech ma vezont krog da vezañ anavezet ganeoc\'h e vo posupl deoc\'h d\'ober ganto evit tremen eus ur geriadur d\'egile.','Pêr',1579619455,'Pêr',1579687321),(683,'da','Multidict har et \"logo\" for hver ordbog. Når du begynder at genkende dem, kan du bruge dem til at skifte hurtigere fra ordbog til ordbog.','fred',1578912405,'fred',1578912405),(683,'en','Multidict has a “favicon” for each dictionary.  Once you start recognising them, you can use them to swop more quickly from dictionary to dictionary.','caoimhinsmo',1578906090,'caoimhinsmo',1578907780),(683,'es','Multidict tiene una \"favicon\" para cada diccionario. Una vez que sepas reconocerlas, puedes usarlas para cambiar más rápidamente de un diccionario a otro.','sodisar',1579374563,'sodisar',1579374563),(683,'fr','Multidict a un « logo » pour chaque dictionnaire. Une fois que vous commencez à les reconnaître, vous pouvez les utiliser pour passer plus rapidement d\'un dictionnaire à l\'autre.','Pêr',1579617383,'Pêr',1579687335),(683,'ga','Tá deilbhín suímh ag Multidict le haghaidh gach foclóra. A luaithe agus a théann tú i dtaithí orthu, is féidir leat iad a úsáid chun malartú go gasta ó fhoclóir go foclóir.','CÓD',1579283102,'CÓD',1579283102),(683,'gd','Tha “favicon” aig Multidict airson gach faclair.  Aon uair ’s gum fàs thu eòlach orra, faodaidh tu briogadh orra airson gluasad nas luaithe bho fhaclair gu faclair.','caoimhinsmo',1578906095,'caoimhinsmo',1578906095),(683,'it','Multidict mostra una icona per ogni dizionario. Una volta che sai riconoscerle, puoi utilizzarle per passare più velocemente da un dizionario all\'altro.','AlexT',1578927924,'AlexT',1578928058),(683,'pt','Multidict tem um \"favicon\" para cada dicionário. Depois de começar a reconhecê-los, você pode usá-los para alternar mais rapidamente de um dicionário para outro.','etimalta',1601551102,'etimalta',1601551102),(683,'sh','Multidict pokazuje jednu ikonu za svki recnik. Jednom kad znas da je prepoznas, mozes da je koristis da predjes brze sa jednog recnika na drugi.','giuseppelic',1582724074,'giuseppelic',1582724074),(684,'br','Sellit ouzh al listennad {yezhoù} evit gwelet an holl yezhoù meret gant Multidict er mare-mañ.','Pêr',1579619460,'Pêr',1579687351),(684,'da','Se listen med {sprog} for at se alle de sprog, der i øjeblikket håndteres af Multidict.','fred',1578912460,'fred',1578912460),(684,'en','See the {languages} list to see all the languages currently handled by Multidict.','caoimhinsmo',1578906238,'caoimhinsmo',1578907450),(684,'es','Ver la lista de {idiomas} para ver todos los idiomas que Multidict maneja actualmente.','sodisar',1579374600,'sodisar',1579374600),(684,'fr','Consultez la liste des {langues} pour voir toutes les langues actuellement gérées par Multidict.','Pêr',1579617355,'Pêr',1579687367),(684,'ga','Féach liosta na d{teangacha} go bhfeicfidh tú na teangacha go léir a láimhseálann Multidict.','CÓD',1579283238,'CÓD',1579283238),(684,'gd','Faic na {cànanan} gu léir fhaicinn air a bheil Multidict eòlach an-dràsta.','caoimhinsmo',1578906334,'caoimhinsmo',1578907509),(684,'it','Vedi la lista delle {lingue} per sapere quali sono al momento disponibili tramite Multidict.','AlexT',1578928090,'AlexT',1578928170),(684,'pt','Consulte a lista de {idiomas} para ver todos os idiomas atualmente tratados pelo Multidict.','etimalta',1601551111,'etimalta',1601551111),(684,'sh','Vidi spisak {jezika} da znas koji su trenutno dostupni pomocu Multidict.','giuseppelic',1582724267,'giuseppelic',1582724267),(685,'br','Multidict a ra gant Javascript evit gellout asuriñ an etreoberiadurezh hag an toupinoù evit gellet derc\'hel soñj eus ho tibaboù geriadurioù hag a yezh vukenn graet a-ziagent. Ma vez lazhet Javascript pe an toupinoù c\'hoazh, Multidict a c\'hallo mont en-dro dre an hanter, nemet darn vuiañ e arc\'hweladurioù na vint ket hegerz ken.','Pêr',1579619466,'Pêr',1579620864),(685,'da','Multidict bruger Javascript til at give interaktivitet og cookies til at huske de tidligere valg af ordbøger og målsprog. Hvis du har Javascript eller Cookies deaktiveret i din browser, fungerer Multidict muligvis stadig delvist, men de fleste af dens faciliteter vil ikke være tilgængelige.','fred',1578912495,'fred',1578912495),(685,'en','Multidict makes use of Javascript to provide interactivity, and cookies to remember the your previous choices of dictionaries and target languages. If you have Javascript or Cookies disabled in your browser, Multidict may still partially work, but most of its facilities will not be available.','caoimhinsmo',1578906811,'caoimhinsmo',1578907159),(685,'es','Multidict usa Javascript para proporcionar interactividad, y las cookies para memorizar tu anterior elección de diccionarios e idiomas meta. Si tu navegador tiene Javascript o las Cookies deshabilitadas, Multidict podría funcionar parcialmente, pero la mayoría de servicios no estarán disponibles.','sodisar',1579374675,'sodisar',1579374762),(685,'fr','Multidict utilise Javascript pour assurer l\'interactivité et les cookies pour mémoriser vos choix précédents de dictionnaires et de langues cibles. Si Javascript ou les cookies sont désactivés dans votre navigateur, Multidict peut toujours fonctionner partiellement, mais la plupart de ses fonctionnalités ne seront pas disponibles.','Pêr',1579617336,'Pêr',1579617336),(685,'ga','Úsáideann Multidict Javascript le idirghníomhaíocht a sholáthar, agus fianáin chun chuimhneamh ar na foclóirí agus na sprioctheangacha a roghnaigh tú roimhe. Má tá tú tar éis Javascript nó Fianáin a dhíchumasú i do bhrabhsálaí, tá seans ann go n-oibreoidh Multidict go pointe, ach ní bheidh an chuid is mó dá shaoráidí ar fáil.\n','CÓD',1579283480,'CÓD',1579283480),(685,'gd','Tha Multidict a’ cur feum air Javascript gus goireasan eadar-ghnìomhach a thoirt dhut, agus briosgaidean gus do roghainnean faclair agus cànain a chuimhneachadh.  Ma tha thu air Javascript no briosgaidean air an cur dheth ’nad bhrabhsair, faodaidh gum bi Multidict fhathast ag obair gu ìre bhig, ach cha bhi a’ mhórchuid d’a ghoireasan ri’m faighinn.','caoimhinsmo',1578906897,'caoimhinsmo',1578907310),(685,'it','Multidict utilizza Javascript per permettere l\'interattività, e i cookies per tenere in memoria i dizionari e le lingue da te precedentemente scelti. Se hai disabilitato Javascript o Cookies sul tuo browser, Multidict potrà funzionare parzialmente, ma la maggior parte delle sue opzioni non saranno disponibili.','AlexT',1578928362,'AlexT',1578928362),(685,'pt','Multidict faz uso de Javascript para fornecer interatividade e cookies para lembrar as suas escolhas anteriores de dicionários e idiomas de destino. Se você tem Javascript ou Cookies desabilitados em seu navegador, Multidict ainda pode funcionar parcialmente, mas a maioria de seus recursos não estarão disponíveis.','etimalta',1601551393,'etimalta',1601551393),(685,'sh','Multidict korsti Javascript da pruzi interaktivnost, i kolacice da zadrzi u memoriji recnike i jezike predhodno od tebe  izabrane. Ako si onemogucio Javascript i Cookies na tvom Browseru, Multidict ce moci samo delimicni da radi, i veci deo njegovih opcija nece ti biti dostupacno.','giuseppelic',1582724481,'giuseppelic',1582724677),(686,'br','N\'ho peus ket an aotre','Pêr',1579605768,'Pêr',1579605768),(686,'da','Du har ikke tilladelse','fred',1579076854,'fred',1579076854),(686,'en','You do not have permission','caoimhinsmo',1578993246,'caoimhinsmo',1579000483),(686,'es','Yo tienes permiso','agimeno',1581897489,'agimeno',1581897489),(686,'fr','Vous n\'avez pas la permission','Pêr',1579612857,'Pêr',1579612857),(686,'ga','Níl cead agat','CÓD',1579864440,'CÓD',1579864440),(686,'gd','Chan eil cead agad','caoimhinsmo',1578993260,'caoimhinsmo',1579000490),(686,'it','non sei autorizzato','giuseppelic',1579082277,'giuseppelic',1579082277),(686,'pt','Você não tem permissão','etimalta',1600425585,'etimalta',1600425585),(686,'sh','Nemas dopustenje ','giuseppelic',1581939591,'giuseppelic',1581939591),(687,'br','Yezhoù meret gant Multidict','Pêr',1579605868,'Pêr',1579686689),(687,'da','Sprog, der håndteres af Multidict','fred',1579076951,'fred',1579076951),(687,'en','Languages handled by Multidict','caoimhinsmo',1579002462,'caoimhinsmo',1579002462),(687,'es','Idiomas manejados por Multidict','sodisar',1579373116,'sodisar',1579373116),(687,'fr','Langues gérées par Multidict','Pêr',1579617703,'Pêr',1579617703),(687,'ga','Teangacha a láimhseálann Multidict','CÓD',1579277071,'CÓD',1579277071),(687,'gd','Cànanan a tha Multidict a’ làimhseachadh','caoimhinsmo',1579002493,'caoimhinsmo',1579002493),(687,'it','Lingue gestite da multidict','giuseppelic',1579082913,'sodisar',1579373123),(687,'pt','Idiomas tratados pelo Multidict','etimalta',1601550829,'etimalta',1601550829),(687,'sh','Jezici kojima se bavi Multidict ','giuseppelic',1582721969,'giuseppelic',1582721969),(688,'br','«AltSl» a ziskouez ar yezhoù ha na vezont ket heñvel a-walc\'h, pe \'vefe a-fet skritur (da skouer an daneg e-skoaz bokmål Bro-Norvegia), evit gellet bezañ implijet evel «yezhoù bukenn alternativel». E berr gomzoù, bez e c\'hallfer klask war-lerc\'h ur ger e-barzh o geriadurioù ha kaout ur chañs da ober berzh.','Pêr',1579619398,'Pêr',1579686609),(688,'da','“AltSl” angiver de sprog, der er ens nok, både i betydning og stavemåde (f.eks. Dansk sammenlignet med norsk bokmål), til at blive brugt som ”alternative kildesprog”. Det vil sige, du kan prøve at slå et ord op i deres ordbøger og have en rimelig chance for succes.','fred',1579076905,'fred',1579076905),(688,'en','“AltSl” indicates those languages which are similar enough, both in meaning and in spelling (e.g. Danish compared to Norwegian Bokmål), to be used as “alternate source languages”. That is to say, you could try looking up a word in their dictionaries and have a reasonable chance of success.','caoimhinsmo',1579011584,'caoimhinsmo',1579011584),(688,'es','\"AltSl\" indica esos idiomas que se parecen bastante, tanto en significado como en ortografía (por ejemplo, el danés comparado con el Bokmål noruego), para poderlos usar como \"idioma origen alternativo\". Es decir, puedes probar a buscar una palabra en sus diccionarios y tener buenas posibilidades de encontrarla.','sodisar',1579372528,'sodisar',1579373830),(688,'fr','«AltSl» indique les langues qui sont suffisamment similaires, tant dans leur sens que dans leur orthographe (par exemple le danois par rapport au bokmål norvégien), pour être utilisées comme «langues sources alternatives». Autrement dit, vous pouvez essayer de rechercher un mot dans leurs dictionnaires et avoir une chance raisonnable de succès.','Pêr',1579617767,'Pêr',1579617767),(688,'ga','Léiríonn “AltSl” na teangacha sin atá cosúil go leor lena chéile, i dtaca le ciall agus litriú de (m.sh. Danish agus an Ioruais Bokmål), le gur féidir iad a úsáid mar \"teangacha foinseacha malartacha\". Is é sin, dá gcuardófá focal i bhfoclóir dá gcuid bheadh seans maith ann go n-éireodh leat.\n','CÓD',1579275951,'CÓD',1579276098),(688,'gd','Tha “AltSl” a’ comharradh nan cànanan a tha faisg gu leòr, chan ann a-mhàin a thaobh brìghe ach a thaobh litreachaidh cuideachd (m.e. Danmhairgis an taca ri  Nirribhis Bokmål), gus an gabh iad an cleachdadh mar “cànanan bunais eadar-róghnach”.  Mar sin, gum b’urrainn dhut facal a shireadh sna faclairean aca agus gum biodh cothrom agad a bhith soirbheachail.','caoimhinsmo',1579013011,'caoimhinsmo',1579015044),(688,'it','“AltSl” indica linguaggi abbastanza simili, sia per significato che per ortografia (per esempio il danese confrontato con il Bokmål norvegese), che possono essere utilizzati come lingua da cui tradurre. Ciò significa che puoi cercare una parola in quei dizionari ed avere una buona possibilità di trovarla.','AlexT',1579082127,'AlexT',1579082541),(688,'pt','“AltSl” indica aqueles idiomas que são semelhantes o suficiente, tanto no significado quanto na grafia (por exemplo, dinamarquês em comparação com o bokmål norueguês), para serem usados ​​como “idiomas de origem alternativos”. Ou seja, você pode tentar pesquisar uma palavra em seus dicionários e ter uma chance razoável de sucesso.','etimalta',1601550778,'etimalta',1601550778),(688,'sh','“AltSl” ukazuje na jezike mnogo slicne, i po znacenju i po pravopisu (na primer Danski uporedjen sa Norveskim Bokmål), mogu biti korisceni kao jezik sa kog da se prevede. To znaci da mozes da trazis rec u tim recnicima i da imas veliku mogucnost da je nadjes.','giuseppelic',1582720826,'giuseppelic',1582721103),(689,'br','«AltTl» a ziskouez ar yezhoù hag a zo heñvel a-walc\'h e-barzh ster ar gerioù (ha neket dre ret er reizhskrivañ) evit bezañ implijet evel bezñ «yezhoù bukenn alternativel». Gellout a rafent bezañ komprenet ha reiñ ster pe awen d\'ur c\'homzer er yezh a vez lakaet ar gaoz warni. Evel da skouer, ur serbeger hag a glaskfe lenn ar Wikipedia italian a c\'hallfe kavout spletus kaout ur geriadur italianeg-kroateg. Pe c\'hoazh ur gouezeleger a Vro-Skos hag a glaskfe ur ger gouezelek dereat a c\'hallfe tennañ gounit eus ur geriadur saozneg-manaveg.','Pêr',1579619404,'Pêr',1579622677),(689,'da','“AltTl” angiver de sprog, der er ens nok i ordbetydninger (dog ikke nødvendigvis i stavemåde) til at blive brugt som ”alternative målsprog”. De kunne forstås og give mening eller inspiration til en taler for det pågældende sprog. For eksempel kan en serbisk taler, der forsøgte at læse den italienske Wikipedia, finde en italiensk til kroatisk ordbog nyttig. Eller en skotsk gælisk taler, der prøver at tænke på et passende gælisk ord, kan finde en engelsk til Manx-ordbog nyttig som inspiration.','fred',1579076930,'fred',1579076930),(689,'en','“AltTl” indicates those languages which are similar enough in word meanings (though not necessarily in spelling) to be used as “alternate target languages”. They could be understood and provide meaning or inspiration to a speaker of the language in question. For example, a speaker of Serbian who was trying to read the Italian Wikipedia might find an Italian to Croatian dictionary useful. Or a Scottish Gaelic speaker trying to think of a suitable Gaelic word might find an English to Manx dictionary useful as inspiration.','caoimhinsmo',1579011601,'caoimhinsmo',1579011601),(689,'es','\"AltTl\" indica esos idiomas que se parecen bastante por el significado (pero no necesariamente en ortografía) para poderlos usar como \"idioma meta alternativo\". Se pueden entender y proporcionar significado o inspiración a un hablante del idioma en cuestión. Por ejemplo, a un hablante de serbo que está intentando leer Wikipedia en italiano le podría parecer útil un diccionario del italiano al croata. O a un hablante de escocés gaélico que busca una palabra gaélica adecuada le puede parecer una inspiración útil un diccionario del inglés al manés.','sodisar',1579372747,'sodisar',1579373086),(689,'fr','«AltTl» indique les langues qui sont suffisamment similaires dans la signification des mots (mais pas nécessairement dans l\'orthographe) pour être utilisées comme «langues cibles alternatives». Elles pourraient être comprises et donner un sens ou une inspiration à un locuteur de la langue en question. Par exemple, un locuteur du serbe qui essayait de lire le Wikipedia italien pourrait trouver utile un dictionnaire italien-croate. Ou un locuteur gaélique écossais essayant de penser à un mot gaélique approprié pourrait trouver un dictionnaire anglais-manx utile comme inspiration.','Pêr',1579617729,'Pêr',1579622046),(689,'ga','Léiríonn “AltTl” na teangacha sin atá cosúil go leor lena chéile i dtaca le ciall na bhfocal de (ach ní litriú per se) chun go bhféadfaí iad a úsáid mar \"sprioctheangacha malartacha\". Thuigfí iad, agus thabharfadh siad inspioráid do chainteoir na teanga atá i gceist. Mar shampla, seans go mbeadh foclóir Iodáilis - Cróitis áisiúil ag cainteoir Seirbise a bhí ag iarraidh Vicipéid na Iodáilise a léamh. Nó seans go bhfaigheadh cainteoir Gàidhlig a bhí ag lorg focal oiriúnach Gàidhlig inspioráid i bhfoclóir Béarla - Manainnis.','CÓD',1579276226,'CÓD',1579276782),(689,'gd','Tha “AltTl” a’ comharradh nan cànanan a tha faisg gu leòr a thaobh brìghe (ged nach eil iad is dòcha faisg a thaobh litreachaidh), agus gum b’urrainn dhaibh bhith feumail mar “cànanan amais eadar-róghnach”.  Mar eisimpleir, neach-labhairt Sèirbise a tha a’ leughadh Uicipeid na h-Eadailtise, is dòcha gum biodh faclair Eadailtis gu Cròthaisis feumail dha. No neach-labhairt Gàidhlig na h-Albann a tha a’ feuchainn smaoineachadh air facal Gàidhlig a bhiodh iomchaidh, is dòcha gum biodh faclair Beurla gu Manainnis feumail dha mur am faigheadh e dad sna faclairean Beurla gu Gàidhlig.','caoimhinsmo',1579013560,'caoimhinsmo',1579014339),(689,'it','“AltTl” indica lingue abbastanza simili per significato (ma non per forza per ortografia) da utilizzare come \" lingua alternativa da cui tradurre\". Potrebbero essere comprensibili e fornire ispirazione ad una persona che parli quella lingua. Per esempio un serbo che provi a leggere una pagina di Wikipedia in italiano potrebbe trovare utile un dizionario Italiano-Croato. Oppure un parlante gaelico che provi a cercare una parola gaelica adeguata potrebbe  trovare utile un dizionario inglese-gaelico mannese.','AlexT',1579082925,'AlexT',1579083067),(689,'pt','\"AltTl\" indica os idiomas que são semelhantes o suficiente no significado das palavras (embora não necessariamente na grafia) para serem usados ​​como \"idiomas de destino alternativos\". Eles podem ser compreendidos e fornecer significado ou inspiração para um falante do idioma em questão. Por exemplo, um falante de sérvio que estava tentando ler a Wikipedia italiana pode achar útil um dicionário italiano para croata. Ou um falante de gaélico escocês tentando pensar em uma palavra gaélica adequada pode achar um dicionário de inglês para manx útil como inspiração.','etimalta',1601550806,'etimalta',1601550806),(689,'sh','“AltTl” pokazuje dovoljno slicne jezike po znacenju (iako ne nuzno po pisanju) da se koriste kao \"rezervni jezik sa kog prevesti\".  Mogli bi biti razumljivi i mogli bi dati ispiraciju jednoj osobi sto prica taj jezik,  na primer jedan Srbin sto prova da cita jednu stranicu na Wikipediji na Italijanskom mogao bi da nadje koristan recnik Italijansko-Hrvatskog. Ili osoba sto prica Galski sto prova da trazi jednu rec galskog u recniku Engleskog - Manx.','giuseppelic',1582721360,'giuseppelic',1582721884),(690,'br','yezhoù mammenn alternativel','Pêr',1579605956,'Pêr',1579605964),(690,'da','alternative kildesprog','fred',1579076966,'fred',1579076966),(690,'en','alternative source languagesalternative source languages','caoimhinsmo',1579033121,'Pêr',1579605931),(690,'es','idioma origen alternativo','sodisar',1579373136,'sodisar',1579373833),(690,'fr','langues sources alternativeslangues sources alternatives','Pêr',1579617687,'Pêr',1579617687),(690,'ga','teangacha foinseacha eile','CÓD',1579277091,'CÓD',1579277091),(690,'gd','cànanan bunais eadar-róghnach','caoimhinsmo',1579033176,'caoimhinsmo',1579033176),(690,'it','Lingua alternativa da cui tradurre','