t mat ez emaint gwaeget mat.','Pêr',1629202333,'Pêr',1629202496),(947,'da','Det er sandsynligvis, fordi du har indlejret store billeder i teksten. Clilstore tillader kun små indlejrede billeder. Det er bedre at linke til billeder frem for at integrere dem i teksten. Hvis du integrerer billeder, skal du muligvis først reducere deres pixelstørrelse og sikre, at de er korrekt komprimeret.','fred',1628053549,'fred',1628053590),(947,'en','This is probably because you have embedded large images in the text.  Clilstore allows small embedded images but not large ones.  It is better to link to images rather than embed them in the text.  If you do embed images, you may need to first reduce their pixel size, and ensure that they are properly compressed.','caoimhinsmo',1626716517,'caoimhinsmo',1626722849),(947,'es','Esto probablemente sucede porque has incluido una imagen demasiado grande en el texto. No se pueden incluir imágenes demasiado grandes. Es preferible insertar un enlace a una imagen grande que incluirla en el cuerpo de la unidad. Si decides subir la imagen e incluirla, quizás tengas que reducir el tamaño para que no pese tanto. Esto lo puedes hacer fácilmente con cualquier editor de imágenes.','agimeno',1626804746,'agimeno',1626804913),(947,'fr','C\'est probablement parce que vous avez intégré de grandes images dans le texte. Clilstore autorise les petites images intégrées mais pas les grandes. Il est préférable de créer des liens vers des images plutôt que de les intégrer dans le texte. Si vous intégrez des images, vous devrez peut-être d\'abord réduire leur taille en pixels et vous assurer qu\'elles sont correctement compressées.','Pêr',1627740594,'Pêr',1627740594),(947,'ga','Is dócha go bhfuil seo amhlaidh toisc gur chuir tú íomhánna sa téacs atá rómhór. Ligeann Clilstore duit íomhánna a chur isteach i dtéacs ach ní íomhánna atá rómhór. Is fearr nasc a chruthú chuig íomhánna ná iad a neadú i dtéacs. Má neadaíonn tú íomhánna, seans go mbeidh ort dlús na bpicteilíní a ísliú agus féachaint chuige go bhfuil siad comhbhruite mar ba chóir.','CÓD',1630928467,'CÓD',1630928467),(947,'gd','Mar as trice, tha seo a’ tachairt ma tha thu air ìomhaighean móra a leabachadh am broinn an teacsa. Tha Clilstore a’ gabhail ri ìomhaighean beaga am broinn an teacsa, chan eil ri ìomhaighean móra.  Tha e nas fheàrr ìomhaighean a cheangal ris an teacsa seachas iad a leabachadh ’na bhroinn. Ma tha thu ag iarraidh an cur am broinn an teacsa, is dòcha gum bi feum agad an lughdachadh agus an dùbhlachadh an toiseach.','caoimhinsmo',1626716645,'caoimhinsmo',1626720288),(947,'it','Probabilmente hai inserito immagini molto grandi nel testo. Clilstore non permette l\'inserimento di immagini grandi ma solo di quelle piccole. Sarebbe meglio collegare le immagini tramite un link piuttosto che inserirle nel testo, ma se devi inserire le immagini è necessario ridurre prima la dimensione dei pixel e assicurarsi che siano adeguatamente compresse.','AlexT',1627235437,'AlexT',1627235585),(947,'sh','Verovatno ste ubacili slike mnogo velike za tekst. Clilstore ne dozvoljava unos slika velikog formata ma samo one male. Bilo bi bolje povezati slike pomocu linka nego da ih unesete u tekst,ali ako morate da ubacite slike potrebno je da im prvo smanjite dimenzije pixel i da proverite jesu li pravilno komprimirane.','giuseppelic',1638281380,'giuseppelic',1638281529),(948,'br','Pellgas','caoimhinsmo',1627744474,'caoimhinsmo',1627855480),(948,'da','Upload','caoimhinsmo',1608726978,'caoimhinsmo',1627855484),(948,'en','Upload','caoimhinsmo',1608718757,'caoimhinsmo',1627855487),(948,'es','Subir','caoimhinsmo',1609757772,'caoimhinsmo',1627855490),(948,'fr','Téléverser','caoimhinsmo',1613930461,'caoimhinsmo',1627855493),(948,'ga','Uaslódáil','caoimhinsmo',1610377137,'caoimhinsmo',1627855498),(948,'gd','Luchdaich','caoimhinsmo',1608718784,'caoimhinsmo',1627855517),(948,'it','Carica','caoimhinsmo',1609099571,'caoimhinsmo',1627855522),(948,'sh','Ucitaj ','caoimhinsmo',1613945811,'caoi