','Pêr',1579394623,'',0),(243,'da','{An Sruth} er frit søgbar webbaseret tekst, der indeholder skotske gæliske, irske gæliske og engelsksprogede udtryk og information om, hvordan man bruger dem; det fungerer som et sprogindlærings- og forskningsværktøj med økonomisk støtte fra Colmcille i Skotland og Irland.','Rex',1600719519,'Rex',1600719519),(243,'de','{An Sruth} ist frei durchsuchbarer internetbasierter Text, der schottisch-gälische, irisch-gälische und englische sprachliche Ausdrücke sowie Informationen zu deren Anwendung enthält; er dient als Sprachlern- und -forschungswerkzeug mit finanzieller Unterstützung durch Colmcille in Schottland und Irland.','2000-mmd',1571575474,'caoimhinsmo',1579372590),(243,'en','{An Sruth} is a freely available, searchable web-based text of Scottish and Irish Gaelic, and English, phrases, idioms, multi-word expressions and usages for use as a learning and research resource and language tool, with financial support from Colmcille in Scotland and Ireland.','',0,'caoimhinsmo',1579372595),(243,'fr','{An Sruth} est un texte librement accessible et consultable sur le Web de gaélique écossais et irlandais, ainsi qu\'en anglais, phrases, idiomes, expressions et uses à plusieurs mots, pouvant être utilisé comme ressource d\'apprentissage et de recherche et outil linguistique, avec le soutien financier de Colmcille en Écosse et l\'Irlande.','',0,'caoimhinsmo',1579372602),(243,'ga','Tá {An Sruth} ina théacs inchuardaithe poiblí saor ar an Idirlíon d’abairtí,  de leaganacha cainte, de chora cainnte agus de nathanna i nGaeilge na hÉireann, Gaeilge na hAlban agus i mBéarla le húsáid mar áis agus uirlis, le tacaíocht ó Cholmcille in Éirinn agus in Albain.','',0,'caoimhinsmo',1579372608),(243,'gd','Tha {An Sruth} na theacsa poblach saor a ghabhas rannsachadh air an Lìon de dh’abairtean, de dh’fhaclan, de ghnàthasan-cainnte agus de chleachdaidhean-cainnte ann an Gàidhlig na h-Alba, Gàidhlig na h-Èireann agus sa Bheurla ri chleachdadh mar ghoireas agus acain, le taic bho Cholmcille ann an Alba agus ann an Èirinn.','',0,'caoimhinsmo',1579372613),(243,'it','{An Sruth} è un testo disponibile sul web, liberamente consultabile, di Gaelico Scozzese e Irlandese, e Inglese, frasi, modi di dire, espressioni di più parole e usi da utilizzare come risorsa di apprendimento e ricerca e strumento linguistico, con il sostegno finanziario di Colmcille in Scozia e Irlanda.','pizzoccheriale',1575479957,'caoimhinsmo',1579372622),(243,'lt','{An Sruth} yra nevaržomai prieinamas, interneto paieška grįstas tekstas sudarytas iš Škotų, Airių Gėlų ir Anglų kalbų frazių, idijomų, daugžodinių išsireiškimų ir vartojimo būdų, skirtas naudoti kaip mokomasis ir tyrinėjimo įrankis; finansiškai remiamas Colmcille Škotijoje ir Airijoje','etimalta',1575365697,'caoimhinsmo',1579372629),(243,'pt','{An Sruth} é um texto disponível na Web, pesquisável e disponível gratuitamente na Web, do gaélico escocês e irlandês e inglês, frases, expressões idiomáticas, expressões com várias palavras e usos para uso como recurso de aprendizado e pesquisa e ferramenta de idioma, com apoio financeiro de Colmcille na Escócia e Irlanda.','etimalta',1577438984,'caoimhinsmo',1579372633),(243,'sh','{An Sruth} je tekst slobodno dostupan na webu, na Galskom, Skockom, Irskom i Engleskom, reci, izrazi, idiomi, uzrecice, recenice koje se koriste kao resursi za ucenje i kaojezicni istrumenti, saekonomsom  podrskom od Colmclile u Skockoj i Irskoj.','giuseppelic',1582717639,'giuseppelic',1582717990),(244,'bg','Помощ','',0,'',0),(244,'br','Skoazell','Pêr',1579394623,'',0),(244,'cy','Cymorth','1999-dil',1570907843,'1999-dil',1570907917),(244,'da','Hjælp','',0,'',0),(244,'de','Hilfe','',0,'',0),(244,'en','Help','',0,'',0),(244,'es','Ayuda','',0,'',0),(244,'fr','Aide','',0,'',0),(244,'ga','Cabhair','',0,'',0),(244,'gd','Cobhair','',0,'caoimhinsmo',1609982175),(244,'hi','मदद','caoimhinsmo',1605784523,'caoimhinsmo',1605784523),(244,'it','Aiuto','',0,'',0),(244,'lt','Pagalba','etimalt