atenbank ab und zu mit einer aktuellen Kopie der Referenzdatenbank überschrieben wird, i.d. Regel einmal die Woche oder im Monat.','2000-mmd',1571566730,'caoimhinsmo',1579374856),(257,'en','You are working here with a {copy} of the Bunadas database.  You or anyone are free to write and experiment here as much as you like, because this database will be overwritten from time to time, perhaps weekly or monthly, with a fresh copy of the authoritative database.','',0,'caoimhinsmo',1579374859),(257,'es','Estás trabajando con una {copia} de la base de datos Bunadas. Puedes experimentar con el sistema todo los que qieras.','',0,'caoimhinsmo',1579374863),(257,'fr','Vous travaillez ici avec une {copie} de la base de données Bunadas. Vous ou n\'importe qui êtes libre d\'écrire et d\'expérimenter ici autant que vous le souhaitez, car cette base de données sera écrasée de temps en temps, par exemple chaque semaine ou chaque mois, par une nouvelle copie de la base de données faisant autorité.','',0,'caoimhinsmo',1579374869),(257,'ga','Tá tú ag obair anseo le {cóip} de bhunachar sonraí Bunadas.  Thig leatsa nó le duine ar bith scríobh agus trialacha a dhéanamh anseo mar is mian leat.  Óir forscríofar an bunachar sonraí seo ó am go ham, gach seachtain nó gach mí b’fhéidir, le cóip nua den bhunachar sonraí údarásach.','',0,'CÓD',1579872842),(257,'gd','Tha thu ag obair an seo le {lethbhreac} den stòr-dàta Bunadas. Faodaidh tusa no duine sam bith sgrìobhadh agus cluich agus deuchainnean a dhèanamh mar a thogras sibh an seo. Oir théid sgrìobhadh thairis air an stòr-dàta seo bho àm gu àm, is dòcha a h-uile seachdain no a h-uile mìos, le dàta bhon stòr-dàta ùghdarrasail.','',0,'caoimhinsmo',1579374881),(257,'it','Stai lavorando con una {copia} del database Bunadas. Tu o chiunque altro siete liberi di scrivere e sperimentare quanto volete, perché questo database viene sovrascritto di tanto in tanto, talvolta settimanalmente o mensilmente, con una nuova copia del database principale.','Ale